INSERT INTO `remanga_title` VALUES (1,'Всеведущий читатель','omniscient-reader','omniscient-reader/0130c65d23185690a4b0d7f4a833fe06.jpg','Манхва',2020,184,'<p>&laquo;Я знаю то, что сейчас произойдёт&raquo;.Когда он подумал об этом, всё изменилось.С того момента началась игра со смертью в мире, где каждый должен сделать всё, чтобы выжить. В мире, конец которого известен только ему.</p>',8.0,1,1),(5,'Нуб максимального уровня','i-am-a-fulltime-newbie-exclusive','i-am-a-fulltime-newbie-exclusive/d9cf8ea470bdd2f51efdc6b127747538.jpg','Манхва',2021,130,'<p>Главный герой Джин Хек &ndash; игрок и стример, единственный, кто прошёл до конца&nbsp;&laquo;Башню испытаний&raquo;.<br />\r\nКогда он увидел концовку игры, захотел бросить её. Но в тот же день &laquo;Башня испытания&raquo; стала реальностью. И главному герою не осталось ничего, кроме как показать, на что способен тот, кто знает все нюансы игры.<br />\r\n<br />\r\n&laquo;Я покажу вам, что такое настоящий задрот!&raquo;</p>',0.0,0,0),(6,'Прирождённый наёмник','the-strongest-mercenary','the-strongest-mercenary/203c75395dd09fc4c8b103bd5be067c9.jpg','Манхва',2020,166,'<p>Юй Идзинь когда-то был единственным выжившим в авиакатастрофе. Чтобы выжить, он становится наёмником. Спустя 10 лет он возвращается к своей семье в родной город. Сможет ли он забыть свое прошлое и жить жизнью обычного школьника?</p>',0.0,0,0),(3,'Охотник SSS-уровня','sss-level-hunter','sss-level-hunter/10c4175d9c7f128e1d8b1eeb682eabeb.jpg','Манхва',2019,104,'<p>Ким Кон Чжа спокойно живет в своей халупе, завидуя всем популярным охотникам. Однажды его желание быть лучше всех сбывается и он получает легендарный навык &ldquo;Копирование способностей&rdquo;... ценой своей жизни.</p>\r\n\r\n<p>Прежде чем он успевает понять это, его убивает охотник №1, Летний дух! Но это активирует его навык, и теперь он скопировал новый, &ldquo;Путешествие во времени после смерти&rdquo;.</p>\r\n\r\n<p>Как Ким Кон Чжа же будет использовать эти навыки, чтобы победить конкурентов и подняться на вершину?</p>',0.0,0,0),(4,'Милый дом','sweet_home_hwang_youngchan','sweet_home_hwang_youngchan/8526d40b663441e5189f6263cefca146.jpg','Манхва',2017,141,'<p>Много ли для счастья надо хикикомори? Знай себе в четырех стенах сиди, остальных нахрен посылай и в один комп вникай. А что родители с сестренкой внезапно померли? Так и чёрт с ними, оставили после себя &laquo;копейки&raquo;: пришлось в дешевую общагу переехать, жить на фастфуде и даже день Х назначить, чтоб delete-нуться из этого мира. Только не знал наш герой, что не суждено ему сдохнуть человеческими методами, ибо, как говорится, &laquo;ночь темна и полна ужасов&raquo;, а днем и тем паче &mdash; не забалуешь.</p>',0.0,0,0),(7,'Регрессия мага 8-го класса','regression-of-class-8-wizard','regression-of-class-8-wizard/82ab9edb86767eb3786f1da8f2afead7.jpg','Манхва',2021,81,'<p>История рассказывает об Иане Пэйдже, архимаге и первом человеке, который прорвался через уровень шестого класса, а затем и седьмого, став самым могущественным магом восьмого класса.<br />\r\n<br />\r\nПосле целой жизни, состоящей из войн и убийств, он сумел окончательно объединить континент. Состарившись, единственными его желаниями стали стремление прожить остаток жизни в мире и попытки найти спасение от горестей, привнесённых пролитой им кровью. Тем не менее его старый друг, обезумев от паранойи, не мог спокойно сосуществовать рядом с кем-то настолько сильным и предал Иана, убив его.<br />\r\n<br />\r\nНа последнем издыхании Иан использовал магию времени, которая переместила его в прошлое, в то время, когда он был маленьким мальчиком. Имея при себе все свои знания из прошлого, Иан решил сделать нечто большее, чтобы просто прожить жизнь с меньшим количеством сожалений.</p>',0.0,0,0),(8,'Наномашины','machines','machines/4440e5f7f133e292d5b4ef42161b4134.jpg','Манхва',2020,181,'<p>Чен Ёун — незаконнорожденный принц, появившийся на свет без единой частички Нейгуна. С самого раннего детства он находился под гнетом всеобщего отвращения. Всеми забытый, с отсутствием какой-либо мотивации, год за годом Ёун влачил свое жалкое существование. Ни на что не рассчитывая... и не претендуя. Будучи изгоем, исконно презираемым шестью великими кланами, в один прекрасный день он оказался в окружении десятка подосланных убийц. Когда глаза практически застлала пелена белого света... и казалось, он уже начал теряться, проваливаясь в пучину безграничного отчаяния, на горизонте возникла еле заметная фигура. Неизвестный &quot;потомок&quot;, снизошедший из будущего, в мгновение ока уничтожил всех врагов. Прошептав нечто непонятное, он подсадил в тело нашего героя какой-то странный предмет... наномашину. С этого момента его судьба кардинально переменилась. Поселившийся где-то внутри искусственный интеллект дал его жизни невероятный импульс. Больше не будет как прежде. Это... новая ветвь истории. Истории о парне, который бросил вызов небесам.</p>',0.0,0,0),(226,'Моя дочь — финальный босс','my-daughter-is-the-final-bos','my-daughter-is-the-final-bos/e0bb6dec89054da75d45fdbdd1d72dc1.jpg','Манхва',2022,102,'<p>Моя дочь разрушила мир. В конце её дивергенции я беспомощно умер. Когда снова открыл глаза, передо мной стояла моя пятилетняя дочь. [Остановите пять несчастий Соль-а Ли. (0/5)] Мне дали ещё один шанс. Если её неправильно воспитать, то мир погибнет.</p>',0.0,0,0),(9,'Система всемогущего дизайнера','the-greatest-estate-designer','the-greatest-estate-designer/410eea7b75616a31ba7029f3beabf62b.jpg','Манхва',2021,120,'<p>Инженер-строитель Ким Су Хо стал аристократом на страницах романа. Но вот незадача! Поместье на грани банкротства? Тогда нужно спасать землю. Проектировать, строить и продавать. [Уникальная возможность, которую так ждал весь континент! Вас ждут идеальная транспортная развязка, лучший школьный район, приятный лесной массив и барон Фронтера, владелец уникальной недвижимости премиум-класса. Договор купли-продажи заключается в порядке очереди!]</p>',0.0,0,0),(10,'Я стал графским ублюдком','trash-of-the-counts-family','trash-of-the-counts-family/92591200027bfd0079701e44237e2f02.jpg','Манхва',2020,110,'<p>Я очнулся в романе, в теле молодого наследника графства, прославленного не без помощи его жестоких выродков.<br />\r\nНо я не собираюсь быть таким же ублюдком.</p>',0.0,0,0),(11,'Пламя бесчисленных невзгод','flame-of-countless-adversity','flame-of-countless-adversity/14a2dd21bfed08f6ba5a99f5849debab.jpg','Маньхуа',2021,112,'<p>Линь Цзе, добрый и отзывчивый владелец книжного магазинчика в другом мире. Он всегда рекомендует посетителям книги, помогающие им в трудной ситуации, и иногда предлагает свои собственные труды. Со временем они начинают относиться к нему с искренним уважением и в благодарность время от времени приносят, по мнению Линь Цзе, простые сувениры, а так же рассазывают окружающим о не совсем обычном владельце книжного. </p><p> </p>',0.0,0,0),(12,'Возрождение Хуашань','return-volcano','return-volcano/652ceac5b9d286d3df09fd99e1103283.jpg','Манхва',2021,102,'<p>13-й ученик великой школы Хуашань, один из трех величайших фехтовальщиков в мире - благородный клинок цветущей сливы Чхон Мён.<br />\r\nПоследним ударом клинка он убивает Чхонма, повергшего весь мир в хаос, и погибает на вершине горы из голов тысячи демонов.<br />\r\nА спустя 100 лет он перерождается в теле ребенка, чтобы возродить из пепла некогда одну из самых великих, но ныне всеми забытую школу Мурима - Хуашань.<br />\r\nЦветки сливы рано или поздно опадают. Однако когда приходит холодная зима, а за ней - весна, слива распускается в своем полном великолепии.</p>',0.0,0,0),(13,'Жнец дрейфующей Луны','reaper-mont','reaper-mont/a0a30dfca4226f8f2ddd06c4234abb56.jpg','Манхва',2022,65,'<p>Он оказался в самой глубине Цзянху. Не зевайте, если не хотите, чтобы вас поглотила бездна.</p>',0.0,0,0),(14,'Ублюдок FFF-ранга','fffclass-trashero','fffclass-trashero/high_cover.jpg','Манхва',2019,172,'<p>Когда ценой жизни своих товарищей герой добрался до замка Владыки Демонов и одолел его хозяина, ему нужно было только одно &ndash; возвращение на землю. Весь этот мир и люди, его населяющие, не стоили для парня ни гроша. Однако, вместо того, чтобы вернуться обратно домой, он получил ранг F за всё, что натворил. Ублюдку F-ранга придется начать все заново!</p>',0.0,0,0),(15,'Новая жизнь убийцы богов','two-new-life','two-new-life/f64c96eaab11057ba1ac6e99069b309f.jpg','Манхва',2021,99,'<p>Возвращение самой желанной фантазии человечества.<br />\r\n&quot;Уж если противные боги дали мне этот шанс, я воспользуюсь им. Хоть я и хочу умереть, но я должен убить их.&quot;<br />\r\nДжефир - последний оставшийся в живых человек. Битва с демонами закончилась поражением, но боги дали ему возможность вернуться на 10 лет назад. Демоны, которые забрали у людей всё, и боги, которые спокойно наблюдали за этим. В этот раз я не дам вам спокойно жить.</p>',0.0,0,0),(16,'Чёртова реинкарнация','damn-reicarnation','damn-reicarnation/f339b6ee9a8d5b89b0fe4bedb6627007.jpg','Манхва',2022,77,'<p>Во время путешествия, призванного сокрушить всех демонов, Гамель отважно жертвует собственной жизнью ради спасения товарища, а перед смертью берет с него клятву закончить их общее дело.</p>\r\n\r\n<p>Спустя многие годы наш герой перерождается в семье того самого друга - воина Вермута, которого он когда-то спас, и, вопреки ожиданиям, узнает, что миссия по уничтожению демонов так и не была завершена.</p>\r\n\r\n<p>Теперь он - Юджин Лайонхарт. Потомок великого гения с бесценным опытом прошлой жизни и невиданным прежде талантом. И благодаря усердным тренировкам в этот раз он обязательно добьется своей цели.</p>',0.0,0,0),(30,'Реинкарнация врача','medical-reincarnation','medical-reincarnation/ad125a4552ce166c8852d0de57225392.jpg','Манхва',2019,149,'<p>Ким Джи Хун живёт жизнью безуспешного хирурга. Но ему предоставился шанс обрести новую жизнь и он возвращается к школьным будням, чтобы стать лучшим дерматологом и грести много&nbsp;денег!</p>',0.0,0,0),(17,'Легенда о северном клинке','legend-of-the-northern-blade','legend-of-the-northern-blade/d82b3c2026790ee0387f87a5e8788fa9.jpg','Манхва',2019,171,'<p>Когда мир погрузился во тьму, мастера боевых искусств собрались, чтобы сформировать &laquo;Северный небесный клан&raquo;. Благодаря клану люди снова обрели мир и покой. Однако с течением времени мастера боевых искусств начали строить заговор против &laquo;северного небесного клана&raquo;, который в конечном итоге привел к смерти лидера клана, Джин Кван-Хо, и уничтожению клана вместе с ним. Когда все покинули клан, единственный сын Джин Кван-Хо, Джин Му-Вон, остался в нем. Му-Вон никогда не изучал боевые искусства, но он находит Технику, тайно оставленную его отцом, и начинает изучать боевые искусства Северного Небесного Клана.</p>',0.0,0,0),(18,'Воин-скелет не смог удержать подземелье','skeleton_soldier_couldnt_protect_the_dungeon','skeleton_soldier_couldnt_protect_the_dungeon/bca6489ad16f240f3c4d6cb7e6b936eb.jpg','Манхва',2018,263,'<p>Он проснулся в могиле под дождем, и не помнит кто он....<br />\r\nЗащитить хозяйку было его единственным предназначением которое он хотел выполнить больше всего, но он не смог исполнить его. Однако судьба каждый раз дарует ему новый шанс, а может и проклятие... Шанс стать сильнее и спасти свою госпожу. Шанс переписать историю, и узнать кто же он на самом деле...<br />\r\n&nbsp;</p>',0.0,0,0),(19,'Эволюция монстров-питомцев','gods-pet-evolution','gods-pet-evolution/42e9c0e89bbdb0e3ffaf5d5e64a64bde.jpg','Маньхуа',2021,261,'<p>Мир пережил катаклизм, и теперь по Земле бродят монстры. Из-за катастрофы люди начали открывать в себе удивительный дар. Эта эра ознаменовалась появлением новой профессии. Тренеры &ndash; люди, которые обучают и используют монстров в своих целях. С этого момента и начинается история Гао Пэна. Амбициозный молодой человек с собственными мечтами, которому повезло родиться в золотой век выращивания монстров.&nbsp;<br />\r\n&nbsp; &ldquo;Даже если это - червь, я смогу превратить его в дракона, который взлетит к небесам!&rdquo;</p>',0.0,0,0),(20,'Выбери меня!','the-pick-me-up','the-pick-me-up/b0b4c6229f0563beb475292b5c8f75ac.jpg','Манхва',2022,70,'<p><br />\r\nОт студии, создавшей &laquo;Поднятие Уровня в одиночку&raquo;, &laquo;Возвращение героя уровня катастрофы&raquo; и &laquo;Всеведущий читатель&raquo;!<br />\r\n<br />\r\n&laquo;Выбери меня!&raquo; &ndash; мобильная гача, известная невероятной сложностью. Хан Со Джин, один из пяти сильнейших &quot;мастеров&quot; мира, теряет сознание во время прохождения особого подземелья, а просыпается уже в теле 1-звёздочного персонажа по имени Хан Ислат под управлением другого игрока.<br />\r\n<br />\r\nЧтобы вернуться обратно, ему придётся возглавить команду героев и пройти 100 уровней подземелья без права на ошибку.</p>',0.0,0,0),(21,'Игрок, который вернулся спустя 10 000 лет','player-who-returned-10000-years-laters','player-who-returned-10000-years-laters/a3678dee8752836ed8cbf5b6977fc02a.jpg','Манхва',2022,65,'<p>Внезапно оказавшись в Аду, всё, что у него осталось это вера и тяга к жизни. Он уничтожал тысячи демонов на всех кругах Преисподней. Даже семь верховных герцогов Ада пали после встречи с ним.</p><p> </p><p>— Владыка, зачем вам обратно на землю? Вся Преисподняя в ваших руках!</p><p>— Заткнись и продолжай подготовку к обряду!</p><p> </p><p>Ни вкусной пищи, ни привычных развлечений… лишь ужасающие демоны и безжизненные пустыни.</p><p> </p><p>— Как же хочется вернуться обратно домой…</p><p> </p><p>Спустя 10,000 лет Игрок возвращается на землю.</p>',0.0,0,0),(22,'Ветролом','wind_breaker','wind_breaker/6439bba67c9e5a152ca08644123045db.jpg','Манхва',2013,478,'<p>Ветролом &mdash; драма о юных уличных гонщиках, мечтающих о свободе.Главный герой, Джа Хён &mdash; сын успешных родителей и лучший ученик в своей школе. Он никогда не знал, что значит &laquo;бороться за свою мечту&raquo;, ведь вся его жизнь определялась родителями, которые хотят для сына только одного &mdash; успешного окончания школы. Но однажды Джа Хён, с детства любящий велоспорт, оказывается втянут в деятельность местных гонщиков, что заставляет героя пересмотреть приоритеты родителей и прислушаться к себе, ведь на своем новом пути он обретает друзей, любовь и приключения.</p>',0.0,0,0),(67,'Друид с Сеульского вокзала','seoul-station-druid','seoul-station-druid/853f9086f13cc7b6849b973e566789f8.jpg','Манхва',2021,118,'<p>Пак Су Хо, провел тысячу лет с животными и стал друидом.<br />\r\nТем временем мир превратился в мир жестокости и появились монстры. Друид и царь зверей, выживший в ожесточенной битве за выживание в течение тысячи лет, отправляется покорять мир.<br />\r\n&quot;Отныне я правитель!&quot;</p>',0.0,0,0),(23,'Сказания о демонах и богах','tales_of_demons_and_gods','tales_of_demons_and_gods/0685323f81241e9161fa096a8b0be461.jpg','Маньхуа',2015,451,'<p>Сильнейший в мире заклинатель демонов Не Ли погиб в битве с Мудрецом-Императором. Но его душа воплотилась вновь, вернувшись на десятилетия назад, в нём самом, тринадцатилетнем подростке. Теперь у него есть шанс исправить все ошибки, совершённые в прошлом: спасти от монстров родной город, защитить любимую, друзей и семью. В детстве Не Ли &nbsp;был самым слабым учеником в классе, имея духовную силу на уровне простых людей. Он и мечтать не смел стать воином, не говоря уже о заклинателе демонов, но опыт и знания, накопленные в предыдущей жизни, помогут ему стать сильнее. Ведь сейчас он знает то, что неведомо профессорам в их боевой академии.&nbsp;</p>',0.0,0,0),(24,'Ублюдок','bastard-hwang-youngchan','bastard-hwang-youngchan/4f4e6ff55dc2bbf6ad1a4b595d5fc1d9.jpg','Манхва',2014,94,'<p>&laquo;В моем доме серийный убийца!&raquo;. Сон У Джин &mdash; паренек со слабым здоровьем, находящийся на нижней ступени школьной иерархии, но он не так прост, каким кажется на первый взгляд. &laquo;Bastard&raquo; &mdash; веб-манхва, повествующая нам о серийном убийце. Отличная мрачная рисовка и кровавый сюжет заставят вас не отрываться от экрана монитора до самого конца.</p>',0.0,0,0),(25,'Элисед','eleceed','eleceed/192da4a25a7efe417d1ff3ee76e84631.jpg','Манхва',2018,273,'<p>Кайден - загадочный человек, который словно комета спустился с неба. Весь израненный, почти потерявший последние силы, он решает скрыть свое присутствие - ведь по-другому от погони не уйти. По дороге Кайден встречает обычную дворовую кошку и, почти не думая, решает вселиться в ее тело. Со Джи У - энергичный и общительный молодой человек из средней школы, который очень любит кошек. Один раз по пути домой он встречает до боли потрепанного кота и берет его к себе домой. Наш У не только добрый, но еще и обладает одной скрытой способностью. Какой же?</p>',0.0,0,0),(26,'Боксёр','the-boxer','the-boxer/9481f914bccb6def4a28b28bd35ae2bb.jpg','Манхва',2019,133,'<p>Шокирующий талант, с которым никто не может столкнуться! Это благословение или проклятие?!</p>',0.0,0,0),(27,'Реинкарнация тёмного магистра','the-celestial-horse-cant-live-ordinary','the-celestial-horse-cant-live-ordinary/45d89489fd9c804a4f3717e2dad94d88.jpg','Манхва',2021,98,'<p>Демон Пэк Чун Хёк.<br />\r\nНекогда сильнейшая личность в Муриме умирает и обнаруживает себя в теле старшего сына дома Дмитрий. В теле человека, которого все называют дураком. Человека, который постоянно находится в тени своего младшего брата и которому глубоко плевать на мнение окружающих.<br />\r\nНо теперь, демон... Нет, Роман Дмитрий больше не сможет жить привычной жизнью.</p>',0.0,0,0),(28,'Младший сын мастера меча','the-younget-son-of-a-swordman','the-younget-son-of-a-swordman/6c99ef7d7ee5e5a69fdb3f182adc15e7.jpg','Манхва',2022,100,'<p>Джин Ранкандел &ndash; младший сын в семье самых великих мечников в стране, бросивший тень на всех Ранканделов. Со скандалом его выперли из дома, но судьба дала ему ещё один шанс.<br />\r\n&ndash; Как ты распорядишься своей силой?<br />\r\n&ndash; Использую для достижения своих целей.<br />\r\nВоспоминания о былых днях, невероятный талант и контракт с Богом.<br />\r\nТеперь он готов взойти на вершину.</p>',0.0,0,0),(29,'От нерадивого аристократа до усердного гения','lazy-confucius-becomes-a-genius','lazy-confucius-becomes-a-genius/e0a5818a113e0b394e020501ef6850ae.jpg','Манхва',2021,103,'<p>Юный Айрон Парейра сделал свой мир грёз убежищем от боли трагедии прошлого. Людей забавляло это, они подняли его на смех и прозвали нерадивым аристократом. Однако подобное отношение никак не задевало нашего героя необходимостью меняться.<br />\r\nТак бы всё и продолжалось, не повстречай он во сне бездарного юношу, который тридцать семь лет подряд обучался владению мечом, да так и умер с оружием в руках.</p>',0.0,0,0),(2,'Пик боевых искусств','martial_peak','martial_peak/56169d91c6668d8ab647b3c781e453fc.jpg','Маньхуа',2018,3631,'<p>На основе одноименного романа. Путь на вершину боевых искусств - путь одинокий и длинный. Перед лицом невзгод ты должен оставаться сильным и неотступным. Только тогда ты сможешь преодолеть все препятствия и стать по-настоящему сильным. Небесная Башня обучает своих учеников самым суровым образом, чтобы они могли выстоять в мире боевых искусств. Но только из-за одного самого незначительного проступка наш главный герой, Ян Кай, может быть исключен из Небесной Башни.</p>',8.0,1,0),(31,'Мир после разрушения','world-after-destrucion','world-after-destrucion/25bc8a52726a02d37aed61630c425e4a.jpg','Манхва',2022,104,'<p><strong>Авторская история от создателя &quot;Всеведущего читателя&quot; о человеке, отказавшемся вернуться в прошлое.</strong></p><p></p><p><em>Люди были призваны стать ходоками и захватить башню, чтобы спасти человечество.</em></p><p><em>На 77 этаже башни они нашли <strong>&quot;Камень Возвращения&quot;</strong>, благодаря чему появилась возможность вернуться в прошлое.</em></p><p><em>Многие покинули настоящее, поэтому последней надеждой стал отряд <strong>&quot;Лови момент&quot;</strong>, сформированный оставшимися ходоками.</em></p><p><em>Последний из отряда достиг 100 этажа, но он уже не знает, чему верить</em></p>',0.0,0,0),(32,'Возвращение безумного демона','light-horse-regression','light-horse-regression/b87004ca012351efd6ef521fae277b7c.jpg','Манхва',2021,97,'<p>Изаха&nbsp;- безумец повёрнутый на боевых&nbsp;искусствах. Во время погони сектантов за ним, в неравной схватке он решил спрыгнуть с утёса. И казалось бы, всё уже кончено, но открыв глаза, некая сущность вознаградила его шансом на новую жизнь. Вспышка, весь избитый&nbsp;Изаха&nbsp;лежит в кровати. Тут&nbsp;он понимает, что перенёсся на много лет назад, во времена, когда он был никем и никому не нужен, в один из худших периодов его&nbsp;жизни, когда его избили за нелепую шутку. Безумец, что вернулся&nbsp;в своё прошлое, изменит ли он ход времени? Станет ли он вновь известен в народе как &quot;Безумный демон&quot;? Или он просто покарает всех своих врагов?</p>',0.0,0,0),(33,'Сильнейший пробужденный из психушки','the-strongest-from-the-asylum','the-strongest-from-the-asylum/267c363adf61c22e4431322d47934fd3.jpg','Маньхуа',2021,205,'<p>Это мир, где злые существа сеют хаос. Однако, даже если злые существа сильны, все они исчезают после этой психушки и даже превращаются в ингредиенты и домашних животных без всякого достоинства. Это психиатрическая больница &quot;Цинь Шань&quot;, где таланты изобилуют, а сильные окружены. В ответ на это Линь Фань, тяжело больной человек с системой, сказал: Я точно не псих, я обычный человек, который любит заниматься культивацией. Обычно я просто трогаю розетки, залезаю на высоковольтную коробку и в дни грозы стою на крыше, чтобы подарить небесам танец с палочками.</p>\r\n\r\n<p>&nbsp;</p>',0.0,0,0),(34,'Однажды я стала принцессой','suddenly-became-a-princess-one-day','suddenly-became-a-princess-one-day/295162e8179a147b4cf14cf1cbce22e0.jpg','Манхва',2017,126,'<p>Когда я открыла глаза, я стала принцессой.&nbsp;Но почему из всех персонажей этой истории именно принцессой, судьба которой тесно переплетена с кровавым Императором?&nbsp;Если я хочу выжить, то должна быть неприметной для его глаз.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Когда это в моём замке начали жить ничтожные людишки?&raquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Человек, у которого нет ни капли сочувствия, ни слезы, этот холодный император Клод!&nbsp;Неужели Атанасия, пойманная императором, сможет выжить?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Я...Что мне делать?..&raquo;</p>',0.0,0,0),(35,'Я прокачиваюсь во сне, убивая монстров','gao-wu-landing-10000-years-into-the-future','gao-wu-landing-10000-years-into-the-future/e1f8349eb71447a674965efcf89dfd7e.jpg','Маньхуа',2023,71,'<p>В эру рассвета боевых искусств на человечество нападают монстры из других миров. Лу Шень, главный герой, перерождается и попадает в эту эру, где люди из-за мутации в генах раскрыли истинный потенциал человеческого тела, возведя мастерство боевых искусств в абсолют, ведь на монстров больше не действует привычное вооружение.<br />\r\nОднако у Лу Шеня нет никаких талантов, он беспечно прожигает свою жизнь, играя в компьютер. И в один момент ему начинают сниться сны, где он попадает на 10 000 лет вперёд, в апокалиптичный мир, населённый зомби. Случайно наткнувшись на одного из ходячих трупов, главный герой убивает его.<br />\r\nВ последствии выясняется, что убив нежить, Лу Шень поглощает его память.<br />\r\nС этого момента начинается путь к вершине и спасению мира!</p>',0.0,0,0),(36,'Убийство героя','kill-the-hero','kill-the-hero/c1b3e705bc955ae7f44e984d051bc0f6.jpg','Манхва',2020,146,'<p>Этот мир не был милосерден, и я отвечал ему столь же искренней ненавистью. Когда он стал Игрой, для меня не изменилось ничего. Однако встреча с Ли Сэ-Чжуном &ndash; героем, Воином, членом самой почитаемой из гильдий &ndash; дала мне дом, товарищей и смысл жизни. Смыслом этим стало &ndash; уничтожить эти чертовы подземелья и закончить Игру! Я умер от меча в спину. От меча того, кому верил, у врат последнего подземелья&hellip; Теперь я вернулся и знаю точно, кто станет добычей &laquo;охотничьего пса&raquo; Ким У-Джина, чего бы мне это ни стоило!</p>',0.0,0,0),(37,'Моё перерождение в древо: Начало эволюции','evolution-frm-the-big-tree','evolution-frm-the-big-tree/7bb930961e137c362e1c4076a5091fc4.jpg','Маньхуа',2022,103,'<p>После смерти Юй Цзыюй перерождается и становится&hellip; <strong>Ивой</strong>!</p>\r\n\r\n<p>И неизвестно, сумеет ли он приспособиться к такой знакомой, но в то же время чуждой окружающей среде &ndash; ведь так совпало, что его перерождение случилось как раз во время <strong>Великой эпохи возрождения духовной энергии</strong>.</p>\r\n\r\n<p>Возрождение духовной энергии знаменует возвышение всех существ&hellip;</p>\r\n\r\n<p>Рев хищных зверей стал способен сотрясти горы и взволновать реки, а существа с могущественной силой наводнили этот мир в таком количестве, что он вот-вот лопнет по швам.</p>\r\n\r\n<p>Но, несмотря на все это, во время подобной эпохи выросла величественная ива, способная безгранично развиваться и эволюционировать.</p>\r\n\r\n<p>Плоды, что растут на ней, способны даровать другим необычайные способности, а духовная энергия, которую она распространяет, укрепляет силы зверей, что обитают на ее территории.</p>\r\n\r\n<p>&hellip;</p>\r\n\r\n<p>Одни величают ее мировым древом &ndash; Иггдрасилем, день за днем восславляя его существование!</p>\r\n\r\n<p>Другие &ndash; &laquo;великим божественным древом&raquo;, подпирающим небосвод!</p>\r\n\r\n<p>Разумеется, большинство просто зовут его &laquo;священным древом&raquo;, или &laquo;проклятым деревом&raquo;, или же &laquo;дьявольским деревом&raquo;&hellip; Да и еще много как.</p>\r\n\r\n<p><strong>И все же, при любом его упоминании в голосе каждого ясно слышится благоговейный трепет.</strong></p>',0.0,0,0),(38,'Поднятие уровня с богами','19651-with-god-up-level','19651-with-god-up-level/f45e0d6697fbe48b2fe492ab6491b5f5.jpg','Манхва',2021,96,'<p>Он был храбрейшим и сильнейшим из всех, но даже его в самом конце ожидало лишь отчаяние. В последние мгновения ему был дан еще один шанс. Благодаря жертве бога времени &laquo;Хроноса&raquo; его судьба еще не была предрешена. Вернувшись в прошлое, он снова попытается взобраться на &laquo;Башню&raquo; со своим непревзойденным талантом, чтобы побороть древнее зло, которое грозит уничтожить этот мир.</p>',0.0,0,0),(39,'Я получил предмет мифического класса','i-got-a-mythical-class-item','i-got-a-mythical-class-item/7c00da0d8daec9321b85b160fe713930.jpg','Манхва',2022,84,'<p>&nbsp;</p>\r\n\r\n<p>Я получил единственный в мире мифический предмет. Но что? Этот предмет принадлежит мне?</p>',0.0,0,0),(40,'Как демон-император стал дворецким','how-the-demon-emperor-became-a-butler','how-the-demon-emperor-became-a-butler/33d7a28cca50eac631deac6e4023a8c2.jpg','Маньхуа',2019,432,'<p>Издревле демон-император возвышался над всеми и поэтому его титул передавался по наследству. Однажды он умер из-за предательства близкого человека. Возродившись, он потерял свои силы, но с ним остался его внутренний демон, который втягивал его в неприятности. Он замкнулся в себе. Ему пришлось стать личным дворецким старшей дочери одной важной семьи. Пройдя путь от демона-императора до дворецкого, как же ему теперь уживаться с Госпожой и демоном внутри него? Как возглавить гибнущий клан? Каким образом они вместе вернутся на вершину этого мира?!</p>',0.0,0,0),(41,'Освободите эту Ведьму','release-that-witch','release-that-witch/7d105ef171b5d63c6fc6633526723fba.jpg','Маньхуа',2018,553,'<p>Чэн Янь прошел сквозь время и попал в мир, подобный Средневековой Европе, став Роландом, 4-м принцем королевства. Но этот мир не такой, к какому он уже привык. Ведьмы и магия здесь &mdash; нормальное явление. Сможет ли Роланд заполучить трон короля и решить выпавшие на его долю проблемы? Только его опыт современных технологий и помощь ведьм, известных как &laquo;слуги Дьявола&raquo;, позволит ему добиться успеха!</p>',0.0,0,0),(42,'Это и вправду герой?','this-is-the-real-story-of-a-hero','this-is-the-real-story-of-a-hero/2c14d05d755a261bd1f8bcd59f9a10d3.jpg','Манхва',2022,97,'<p>Никогда ещё не было таких героев. То ли герой, то ли сам дьявол. Кан Хансу вместе с одноклассниками переместился в другой мир. Его друзья пришли в неописуемый восторг от магии и нового окружения, но сам Хансу желал лишь возвращения домой.<br />\r\nС какой это стати он должен оставить свой тёплый, уютный дом и начать приключения в чужом мире?..<br />\r\nДаже призвавшая их богиня лишь развела руками от бессилия и пообещала отправить Хансу домой. Вот только...<br />\r\nОткрыв глаза, он вновь увидел этот мир! Все друзья исчезли, а вокруг были лишь монстры!<br />\r\nБогиня меня обманула?<br />\r\nКак вернуться домой?<br />\r\nНо больше всего меня волнует другой вопрос&hellip; Как здесь выжить?!</p>',0.0,0,0),(43,'Выходи замуж за моего супруга!','marriage-with-a-killer','marriage-with-a-killer/7a6da6e0ffcb44c70b9e719e31162998.jpg','Манхва',2021,68,'<p><strong>&quot;Умоляю, не порть нашу жизнь, хорошо? Живые люди должны жить, а ты ведь всё равно умрешь!..&quot;.<br />\r\nНа моих глазах, моя единственная подруга горестно плакала, а я умерла на руках у мужа, в спальне, где они изменили мне, даже не прожив отведённого врачами срока.</strong></p>\r\n\r\n<p><strong>Как вдруг:<br />\r\n&quot;Чивона, обед уже закончился!&quot;</strong></p>\r\n\r\n<p><strong>Я очнулась в своём офисе, в компании, где работала 10 лет назад.<br />\r\nМне был подарен второй шанс.</strong></p>\r\n\r\n<p><strong>Теперь, чтобы изменить свою судьбу, кто-то должен встать на моё место.<br />\r\nЭтим &quot;кто-то&quot; будет моя лучшая подруга.</strong></p>\r\n\r\n<p><strong>Ты хотела моего мужа -&nbsp;ты выйдешь за него замуж.</strong><br />\r\n&nbsp;</p>',0.0,0,0),(44,'Безграничный маг','a-infinite-wizard','a-infinite-wizard/98a7d1dcb086de927833b07335b8bc55.jpg','Манхва',2022,57,'<p>Ребёнок, брошенный в конюшне и воспитанный как простолюдин, Широн. Дитя, которое благодаря своей врождённой проницательности научилось читать. В один прекрасный день он выезжает в город и сталкивается с так сильно интересующей его магией... По этой причине Широн и начинает мечтать стать магом. Однако перед ним возникает множество преград из-за его статуса. Он узнаёт об обратной стороне этого мира задолго до своего взросления. В этом странном, каком-то искажённом мире... Сможет ли он осуществить свою мечту стать магом?</p>',0.0,0,0),(45,'Герой иного мнения','hero-with-another-opinion','hero-with-another-opinion/4a77436ade36f6fd110367da5718af4a.jpg','Рукомикс',2020,22,'<p>Иногда жизнь может преподносить своеобразные сюрпризы, что диву даёшься. И это говорю я, что прожил одну жизнь демоном, а вторую человеком.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Теперь же меня ждёт ещё третья &mdash; в роли Героя на стороне добра. Причем в мире том, самом первом. Ирония? Меня не раз называли сволочью и психом, а тут я стану борцом за светлое будущее.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>И у меня, как Бывшего Темного Повелителя, есть свое мнение.</p>',0.0,0,0),(46,'От рыцаря самого низкого ранга до монарха','from-the-lowest-ranked-knight-to-monarch','from-the-lowest-ranked-knight-to-monarch/9fe837d8b314cc1a98046cd08c095350.jpg','Манхва',2021,129,'<p>В пятнадцать я лишился правой руки на поле битвы, став калекой.<br/>Последующие двадцать четыре года мало кто верил, что для такого, как я, подходит путь воина: меня отговаривали, смотрели с сочувствием, презирали... А в тридцать девять отрубили вторую руку и вынудили спрыгнуть с утеса.<br/>И я умер. Умер, но перед собственной смертью умудрился подгадить отправившему меня на тот свет засранцу. Да так удачно, что... вернулся в свои пятнадцать лет! На то самое поле боя, где мне вот-вот отрубят правую руку!</p>',0.0,0,0),(47,'Месть железнокровной Гончей Меча','the-return-of-the-a-ironblooded-hound','the-return-of-the-a-ironblooded-hound/baaabc7d21230873b1e26af4732e23dc.jpg','Манхва',2023,53,'<p>Он был гончей семьи Баскервиль: Викир.<br />\r\nНо его преданность была вознаграждена клеветой и лезвием гильотины.<br />\r\n&quot;Я больше никогда не буду жить жизнью гончей&quot;.<br />\r\nНа пороге смерти возникла неожиданная возможность.<br />\r\nГлаза Викира загорелись красным, когда он точил свои клыки в темноте.<br />\r\n&quot;Ну погоди, Хьюго. На этот раз я перережу тебе глотку&quot;.<br />\r\nПришло время гончей отомстить своему хозяину.</p>',0.0,0,0),(49,'Возвращение героя максимального уровня','full-level-hero-is-returning','full-level-hero-is-returning/7ea257e489aab9ab9036f3a8e3ad97b9.jpg','Манхва',2020,146,'<p>Дейви - бессильный принц маленькой страны.<br />\r\nКогда он впал в кому и его душа покинула тело, она переместилась в огромную галерею душ былых героев.<br />\r\nВзяв все в свои руки, Дейви возвращается.</p>',0.0,0,0),(50,'Я стану хозяйкой этой жизни','in-this-life-ill-become-the-head-of-the-family','in-this-life-ill-become-the-head-of-the-family/f7e7305b424894726072fe32fd88d332.jpg','Манхва',2021,127,'<p>&mdash; Фирентия переродилась внебрачной дочерью главы самого влиятельного рода империи. Но однажды её отец умер, родственники выставили её за порог, а те аристократы, с которыми она хорошо ладила, отвернулись от неё.&nbsp;<br />\r\nА затем её, подвыпившую, сбил экипаж, и вдруг, открыв глаза, она вернулась в свои семь лет.&nbsp;<br />\r\nТам, в прошлой жизни, подобно большому псу, за ней увивался второй принц, который станет врагом всего её рода.&nbsp;<br />\r\n- Тия, ты намного красивее меня!&nbsp;<br />\r\n- Шутить изволил?&nbsp;<br />\r\n- Нет, я правду говорю.&nbsp;<br />\r\nНу и ладно, и второй принц, и родовое имущество, всё это моё!&nbsp;<br />\r\nЯ обязательно стану хозяйкой этой жизни.</p>',0.0,0,0),(51,'Безграничные пассивные навыки','lag','lag/3bd0caab80527233ede7c28d0def1470.jpg','Манхва',2022,96,'<p>Что будет, если дать расчётливому человеку возможность бесконечно наращивать количество пассивных навыков и поставить перед ним целью выбраться из заточения, в которое он попал против своей воли? L.A.G - мистическое сооружение с огромным количеством помещений и этажей, что бесконечно тянутся вниз. Здесь люди вынуждены сражаться за свою жизнь в попытках попасть на самый нижний этаж, в котором, предположительно, они найдут все ответы. В придачу ко всему, L.A.G играет роль системы, благодаря которой игроки получают навыки и постоянно наращивают боевой потенциал. Здесь не выживает сильнейший - сильнейшим становится тот, кто выжил.</p>',0.0,0,0),(52,'Логин Мурим','murim-login','murim-login/03451c15339f37dd1b89c4c1854feae8.jpg','Манхва',2020,178,'<p>Эпоха, когда охотники зарабатывают, зачищая врата от монстров. Джин Тэ-Кён - низкоранговый охотник, подобравший VR капсулу и случайно зашедший в игру, сюжет которой разворачивается в мире боевых искусств. После множества взлетов и падений Тэ-кён все-таки смог выбраться из этого мира. Сила и навыки, которые Джин получил в Муриме, появились у него и в реальном мире. Благодаря этому, он смог продолжить получать деньги, работая охотником... Однако он все же решает вернуться в Мурим из-за беспокойства за его друзей-NPC&nbsp;</p>',0.0,0,0),(53,'Становление богом','one_hundred_to_make_god','one_hundred_to_make_god/86a77e61b95507bda3d352fb3dbbbb65.jpg','Маньхуа',2015,1133,'<p>Луо Чжень, для того что бы спасти свою сестру Луо Янь, встал на путь изучения высшего боевого искусства &laquo;Становление Богом&raquo;. Только так он сможет вернуть Луо Янь свободу. Правда, чем ближе он к своей цели, тем сложнее препятствия, появляющиеся на его пути!</p>',0.0,0,0),(54,'Туториал продвинутого игрока в башне','the-tutorial-tower-of-the-advances-player','the-tutorial-tower-of-the-advances-player/491e7d66481fee68a020d55928f4a2c3.jpg','Манхва',2019,189,'<p>В мире появились монстры и таинственная Башня. Главный герой стал охотником, но в отличии от других, он не смог выйти из башни после её зачистки. И спустя 12 лет после того как башня была освобождена... Он вернулся!</p>',0.0,0,0),(55,'Возвращение замороженного игрока','return-of-the-frozen-player','return-of-the-frozen-player/f804ac0bd88320b0f7470c00768362a3.jpg','Манхва',2021,95,'<p>В 2019 году мир переменился, и появились такие явления как: врата, монстры, система и игроки, - которых ранее не существовало.&nbsp;<br />\r\nНа протяжении 5 лет между человечеством и захватчиками происходила борьба за власть и территории.<br />\r\n[Финальный босс &quot;Снежная королева&quot; появился]<br />\r\nЕсли убить его, человечество сможет обрести свободу и вернуться к прежней жизни.&nbsp;<br />\r\n24 ноября 2024 года четверо из 5 игроков вошли в последнее подземелье на Антарктиде, чтобы победить финального босса на территории Земли. Одним взмахом руки &quot;Снежная королева&quot; заморозила Тихий океан, повергнув человечество в отчаяние.&nbsp;<br />\r\nПоследнему игроку удалось победить финального босса, однако в процессе поглощения ее &quot;ядра&quot; он превратился в ледяную глыбу. А спустя 25 лет, когда поглощение завершилось, он очнулся от криогенного сна, получив фрост-способность EX-класса.&nbsp;</p>',0.0,0,0),(56,'Я основал Клуб Бессмертия','club-of-the-immortals','club-of-the-immortals/614cd1a8271703e0f30d3f58af0c7bbc.jpg','Маньхуа',2021,249,'<p>Лу Ли самый заурядный и не имеющий никаких жизненных целей работник, который однажды получает необычные способности. С тех пор ему подвластно замедление и ускорение времени, но самое главное - продажа и покупка продолжительности жизни. Приобретение новых способностей побудило главного героя основать элитный клуб - клуб бессмертных.&nbsp;</p>',0.0,0,0),(57,'Моя судьба злодея','i-dstiny-villin','i-dstiny-villin/3c8b49f6ff559996b68428c91c5e40d0.jpg','Маньхуа',2021,103,'<p>Гу Чангэ попадает в фэнтези-мир, где, по-классике, оказывается в шкуре главного козла отпущения.<br />\r\nУдивительно, что главный герой сразу же снизыскал расположение у императрицы, чем вызвал бурю ненависти в свой адрес. К счастью, Чангэ - уважаемый человек в городе и единственное, что его спасает от кары в данной ситуации это высокий статус в обществе. Подождите-ка... а вы уже знаете, что здесь есть необычная система рангов, в которой присутствуют яркие герои всех мастей? Проанализировав события, герой понимает, что выгоднее всего вжиться в свою новую роль и пойти по пути персонажа-злодея!</p>',0.0,0,0),(58,'Легендарный механик','super-god-mechanic','super-god-mechanic/db10e048cb795095c6bb00237cec2362.jpg','Маньхуа',2021,251,'<p>Играя в &quot;Звёздное море&quot;, известный бустер Хан Сяо погибает и переносится в мир игры десятилетней давности. Там он становится обычным НПС с системой игрока. Переродившись на базе противников, Хан Сяо выбирает класс &quot;механик&quot;, чтобы получить возможность вернуть свою жизнь. Знаменитый бустер, зная все патчи игры наизусть, попытается уничтожить противников, попутно создавая себе личную армию!</p>',0.0,0,0),(188,'Чистый Злодей','pure-vilain','pure-vilain/1cea38fbecc101577dd3096a1a7804a0.jpg','Манхва',2022,74,'В этом мире существует особая полиция, борющаяся с преступниками-сверхлюдьми. Лучшему стражу порядка Хан До Рёну, проводившему мирные и спокойные деньки, приходится иметь дело с несносной злодейкой! Это история наихудшей бандитки Роуз Парк, которая влюблена в сильнейшего героя.',0.0,0,0),(59,'Факультет зачистки подземелий','hero-high-school-dungeon-attack-department','hero-high-school-dungeon-attack-department/2505df2e85aca2e70989a1deb2dfe1b7.jpg','Манхва',2022,45,'Двадцать первый век. На планету Земля проникли части иного мира и изменили её до неузнаваемости... Настала эпоха существования Подземелий, кишащих монстрами, Охотников, которые эти Подземелья зачищают, а также лучшего элитного заведения, занимающегося воспитанием и подготовкой этих Охотников, - Старшей школы героев.\r\n\r\nОтец Ю Ча Рёна некогда был лучшим Охотником Азии, но в настоящем его репутация испорчена, он болен и забыт.\r\n\r\nРади лечения отца сын занимается контрабандой, незаконно зачищая Подземелья. Но однажды он встречает девушку, которая просит его помочь ей поступить в Старшую школу.\r\n\r\nЭто история о юноше, вынужденном скрывать своё происхождение и забыть о своей мечте, но которому, наконец, представилась возможность себя отыскать в мире Подземелий.',0.0,0,0),(60,'Возмездие величайшего копейщика','regression-of-the-history-of-changi','regression-of-the-history-of-changi/bf527ab272d3270bb39b47c22e1e6fee.jpg','Манхва',2021,116,'<p>Непревзойденный копейщик.<br />\r\n<br />\r\nСтереотип о необходимости владения мечом разрушает ярчайшая звезда из герцогской семьи. Герой, что положил конец войне империи, и имя ему - Джошуа Сандерс.<br />\r\n<br />\r\nНесмотря на его величие и репутацию, теперь он полумертвый истекает багрового цвета кровью. Ранен он не кем иным, как рукой собственного императора, - Кайзера...<br />\r\n<br />\r\n&quot;Кайзер!.. Не мечтай, что всё закончится так легко!!!&quot;.<br />\r\n<br />\r\nПоследние мгновения смерти сопроводили излияния огромного количества энергии от его соратника - копья, что носило имя &quot;Ругия&quot;...<br />\r\n<br />\r\nЯ... Помолодел?.. Ругия, что ты, черт возьми, такое?!<br />\r\n<br />\r\nДжошуа вернул себе молодое тело, и его месть начнется с этого момента!</p>',0.0,0,0),(61,'Реинкарнация Мага Тьмы спустя 66666 лет','the-black-sorcerer-reincarnated-in-66666-years','the-black-sorcerer-reincarnated-in-66666-years/eed4ed7fb90c82160a331e79fa704933.jpg','Манхва',2021,100,'<p>Могущественный колдун Диабло Вольфир запечатан на века по замыслу бога.<br />\r\nС тех пор уже прошло 66666 лет, и могучий колдун снова ступил на эту землю!</p>',0.0,0,0),(62,'Сильнейшая секта на все века','the-strongest-sect-for-all-ages','the-strongest-sect-for-all-ages/7e120c5fa0dfb60e3d7a2554ebfdb8c2.jpg','Маньхуа',2021,289,'<p>Сделать днищенскую секту сильнейшей всего за 100 лет? Нет ничего проще (и веселее)! С помощью супер совершенной Системой лучших сект в мире главный герой должен возвысить свою секту Железной Кости... или помереть.</p>',0.0,0,0),(63,'Берегись этой чертовки!','beware-of-the-villainess','beware-of-the-villainess/401bdef0bbc8c988e4680741a1912505.jpg','Манхва',2020,125,'<p>Я стала злодейкой романа! Ненавижу ли я это? Нет!<br />\r\nЭто довольно интересно. Дочь герцога - это безработный богатый человек. Как я могу упустить такой шанс?! Это лучший шанс наслаждаться жизнью. Я должна забыть сюжет и просто жить так, как мне хочется! Вскоре после того, как я проснулась злодейкой, я увидела, как мой жених, главный герой романа, изменил мне. Я видела, как он обнимал другую женщину, и он так мило улыбался. У меня потекли слезы... Ха-ха! Шучу! я не плакала! Мои слезы стоят слишком много, чтобы тратить их на этот мусор. Вместо слез я закричала: &quot;Ваше высочество, вы так низко пали?!&quot; Возлюбленная главного героя, которая полностью перевернёт главную историю! Почему? Потому что это пустая трата времени для девушки - быть окруженной дешевыми мужчинами.</p>',0.0,0,0),(64,'Созвездие, вернувшееся из бездны','43828-the-constellation-from-hells','43828-the-constellation-from-hells/29c2c83540d45d043b668a5a562ef165.jpg','Манхва',2021,132,'<p>Я вернулся из ада спустя несколько тысяч лет, чтобы спасти человечество от гибели</p>',0.0,0,0),(65,'Король меча','sword-king','sword-king/4a3de49a637927e5bbe59249c1c5be5b.jpg','Манхва',2019,186,'<p>В момент, когда его переместили в другой мир, Рю Хан-Бин был обычным человеком, который недавно вернулся из армии. Хоть он и остался один в пустынном мире с кучей монстров, ему дали задание - стать сильнее. Но есть одна проблема - &quot;система&quot;, которая должна была давать подсказки, полна недоработок.&nbsp;</p>',0.0,0,0),(66,'Убить злодея','villain-to-kill','villain-to-kill/65a13e3346f7b1ace1fe73c911d28527.jpg','Манхва',2021,119,'<p>Кассиана убили и&nbsp;ложно обвинили&nbsp;в убийстве своего друга. Когда он умирая думал о том, что это конец, его душа переселилась в&nbsp;тело школьника.<br />\r\nПсайкер высшего класса решает перестать геройствовать и ступает на путь злодея.</p>',0.0,0,0),(68,'Прокачка в Аду','rad-in-hell','rad-in-hell/2158fdd5f948b8081bedc78305e33842.jpg','Манхва',2021,57,'<p>Кан Хёнму - нищий парень. Его мечты стать охотником разбиты в дребезги. И в один момент, когда он замечтался о том, чтобы быстро разбогатеть, перед его глазами возникло загадочное уведомление: &quot;Уровень сложности: Ад. Локация: Планета Апокалипсис&quot;. Теперь ему суждено прокачивать скиллы на Земле будущего, наводнённой монстрами!</p>',0.0,0,0),(69,'Искатель подземелий','the_dungeon_seeker','the_dungeon_seeker/480ff896495c713e1d324a8e47c07421.jpg','Манга',2016,33,'<p>Дзюмпэй Такэда, ученик старшей школы, с детства знаком с Норико Тацумией и хулиганом Кидо Сётой. Однажды во время обычных издевательств над Дзюмпэем, все они перенеслись в другой мир по зову некоего &laquo;Бога&raquo;. Призванные Герои должны были обладать могуществом, но оказывается, что характеристики Дзюмпэя еще ниже, чем у простого крестьянина. Втянутый в смертельный лабиринт той единственной, кому он верил, он ищет путь, чтобы отомстить.</p>',0.0,0,0),(70,'Истинное образование','true-education','true-education/10c4e028ff21b8d50fc22dccb513fe1d.jpg','Манхва',2020,125,'<p>На Хва Джин, член бюро по образованию, со всей серьезностью борется со студентами, дабы восстановить разрушенный авторитет преподавателей!</p>',0.0,0,0),(71,'Гениальный маг, пожирающий лекарства','drugeating-genius','drugeating-genius/64e25087abceef8644905b0c7cb2c1ff.jpg','Манхва',2023,48,'<p>Достигнув предела своего таланта в магии, главный герой в наказание был отправлен в игровой мир &mdash; в огромный город под названием Валкан. Чтобы выжить, пытается выстроить отношения с другими людьми и исследует тайну &laquo;закрытого мира&raquo;, стремясь предотвратить конец света.</p>',0.0,0,0),(72,'Сильнейший профессор магии','i-got-a-fake-job-at-the-acadmy','i-got-a-fake-job-at-the-acadmy/9829929388180122cd13c59c4d9e6acb.jpg','Манхва',2022,76,'<p>Я стал профессором в лучшей академии Теон, потому что меня... приняли за другого?.. Являясь сильнейшим магом и рыцарем, мне было не трудно прикинуться каким-то профессором в академии, но всё оказалось куда сложнее, чем я думал. Сейчас я сижу на двух стульях и пытаюсь собрать информацию, но куда же приведет меня эта опасная ситуация с ходьбой на краю обрыва?</p>',0.0,0,0),(73,'Насколько же богат этот граф?!','lords-coins-are-not-reduced','lords-coins-are-not-reduced/aa95568ac06074340fb0a56b19f3b402.jpg','Манхва',2021,115,'<p>На рынке измерений, появился новичок, превосходящий любого!<br />\r\nЧеловек, в прошлой жизни Потерявший всё состояние, погибший от рук жалких наёмников и проигравший злейшему врагу...<br />\r\nЭрн Стилгард переродился!<br />\r\n<br />\r\nЗначит, моя книга измерений и все воспоминания остались со мной? Ну держитесь! Я переверну ваш рынок с ног на голову!&nbsp;</p>\r\n\r\n<p>&nbsp;</p>',0.0,0,0),(74,'Существование','being','being/3e5466e6fdb2c45105ecb4916b04c94e.jpg','Манхва',2022,71,'<p>В один день он - муравей, в другой - огромный динозавр. Настало последнее перерождение существа, пережившего десятки тысяч реинкарнаций. Он родился, обладая умениями каждого существа, которым некогда являлся. Почему ему дана эта способность? Ли Чжа Ин наконец-то понял: &quot;Я существую, чтобы уничтожить человечество!&quot;.</p>',0.0,0,0),(75,'О моём перерождении в слизь','regarding_reincarnated_to_slime','regarding_reincarnated_to_slime/high_cover.jpg','Манга',2015,113,'<p><strong>37-летний японец-холостяк был зарезан на улице каким-то мерзавцем-грабителем. </strong></p><p></p><p><strong>Тут бы и истории конец, да всё обернулось иначе, неожиданно он переродился слизью в фэнтезийном мире. </strong></p><p></p><p><strong>Но что может сделать, пускай и разумная, но слизь?</strong></p>',0.0,0,0),(76,'Я неизбежно стала вороной','if-you-do-you-become-a-crow','if-you-do-you-become-a-crow/91fdc87e3e914b48d86e86a8ac1080d2.jpg','Манхва',2022,93,'<p>После смерти в результате несчастного случая она переродилась в отомэ-игре... как ворона!.. Не могу поверить, что я &ndash; ворона! Не какой-то там второстепенный персонаж, а птица... Я пыталась найти человека, который растил бы меня, кормил и заботился, и первым встречным был не кто иной, как наследный принц Камут.<br />\r\n&ndash; Ты такая милая, Рэйнел.<br />\r\n&ndash; Кар, кар-кар! [Так возьми меня к себе в качестве питомца!]<br />\r\nКронпринц действительно взял меня к себе: любил, холил и лелеял. Вот я и подумала, что ничего страшного, если буду заигрывать с ним, ведь я же ворона, в конце да концов! И то, что моё сердце трепещет из-за него &ndash; это ничего, между нами ничего и быть не могло, поэтому я особо ни на что не рассчитывала... Но однажды...<br />\r\n&ndash; Привет, Рэйнел.<br />\r\n&ndash; Ч-что со мной происходит?..</p>',0.0,0,0),(77,'S-Ранг притворяющийся слабаком','school-life-that-pretended-to-be-a-waste','school-life-that-pretended-to-be-a-waste/67a10943ad49d8c0237d6b2d5087d0d6.jpg','Манхва',2022,52,'<p><strong>Человечество раскрыло сущность души, Эдею, и достигло её материализации. </strong></p><p><strong>Всё общество оказалось зависимо от неуязвимой для обычного оружия Эдеи. </strong></p><p><strong>Люди стали думать только о её боевой мощи. Главный герой, Пак Чжин Сон, обладал открытой душой и выраженными боевыми способностями. </strong></p><p></p><p><strong>Однако после введения системы рангов и слабой военной подготовки в старшей школе он присоединился к числу слабейших и был вынужден страдать от насмешек сверстников на протяжение 10 лет… Но в действительности его Эдея представляла собой </strong></p><p><strong><em>«Нескончаемую жажду смерти» S-ранга. </em></strong></p><p>Пак Чжин Сон был сильно обеспокоен постоянными мыслями об убийстве и продолжал жить, считая себя неудачником F-ранга. </p><p><strong>Сможет ли Пак Чжин Сон, жаждущий смерти, взять под контроль свои желания и доказать, что душа лежит вне ранговой системы?</strong></p>',0.0,0,0),(78,'Игрок, который не может повысить уровень','a-player-who-cant-level-up','a-player-who-cant-level-up/b8246c2ba3f4a04b5e51e06b00483fb7.jpg','Манхва',2021,125,'<p><strong>В возрасте восемнадцати лет Ким Ги Кю стал Игроком и был призван в Башню. Он считал, что теперь его жизнь просто обязана наладиться&hellip;<br />\r\nНо что бы он не делал, как бы не старался, даже спустя пять лет его уровень оставался прежним.<br />\r\nНикто, в том числе и сам Ким Ги Кю, не предполагал, что его способностям только предстоит раскрыться и сотрясти Башню до основания!</strong></p>',0.0,0,0),(79,'Величайший в истории младший сын маркиза','youngest-son-of-the-marquis','youngest-son-of-the-marquis/40cc958cde03fdcb5eeac0b56d93d3c5.jpg','Манхва',2021,88,'<p>Я пришел сюда с единственной целью - отомстить. Я сверг империю Тулкан, единую нацию, которая доминировала на континенте. Я всегда добивался победы. Я добился всего, что мне было нужно, и был доволен. Поэтому я смирился со своей приближающейся смертью. У меня больше не было причин жить. И вот мое сердце перестало биться. Я точно почувствовал, что оно остановилось. Однако, что же произошло? &quot;Это не черная магия, и на иллюзию это тоже не похоже&quot;. В зеркале отражался мальчик с короткими черными волосами. Я выглядел точно так же, как в 14 лет, то есть 20 лет назад. Юноша, еще не потерявший свой детский жир, похлопал себя по щекам и пробормотал: &quot;Как это возможно?&quot;. Я вернулся. В то время, о котором я сожалею.</p>',0.0,0,0),(80,'Невероятное обучение','tutorial-is-too-difficult','tutorial-is-too-difficult/cb8243aebbd28af8589a15f214cd6f79.jpg','Манхва',2021,139,'<p>Однажды, посреди серых скучных будней, перед глазами появляется уведомление. [Вы хотите пройти обучение?]<br />\r\n<br />\r\nЗа ним сразу же вылезло окно выбора сложности. [Лёгкая] [Обычная] [Сложная] [Адская]. Я без колебаний выбрал адскую сложность.<br />\r\n<br />\r\nИ пожалел.<br />\r\nЗнаю, она называется адской, но это слишком.</p>',0.0,0,0),(81,'Злодейка, перевернувшая песочные часы','the-villainess-reverses-the-hourglass','the-villainess-reverses-the-hourglass/9c71787b3e461b396a7e54ac72d486a1.jpg','Манхва',2020,125,'<p>С замужеством ее матери-проститутки за графа, статус Арии в обществе тут же вознёсся до небес. Проведя жизнь в роскоши, Ария несправедливо встречает смерть из-за планов своей сестры Миэль. И прямо перед смертью она видит, как песочные часы падают, как будто это была фантазия. И вот так она чудесным образом вернулась в прошлое.&ldquo;Я хочу стать очень элегантной, как моя сестра Миэль.&rdquo;Чтобы противостоять злодейке, она должна стать еще более злой злодейкой. Это был новый путь, который Ария выбрала, чтобы отомстить Миэль, убившей ее и ее мать.</p>',0.0,0,0),(82,'Как защитить старшего брата главной героини','how-to-protect-the-main-heroines-brothers','how-to-protect-the-main-heroines-brothers/703306c5f928fc29b06f9cec25624f10.jpg','Манхва',2021,43,'<p>Я переродилась в новелле 19+ с реверс-гаремом.<br />\r\n<br />\r\nПроблема в том, что я стала старшей сестрой второго, злого главного героя...<br />\r\nМой чертов отец в конце концов похитил старшего брата главной героини.<br />\r\nТеперь осталось только дожидаться мести от главной героини и разрушения рода?<br />\r\nАх, избежать смертельной концовки и правда тяжело.<br />\r\n<br />\r\n&quot;Я тоже заинтересована в этой игрушке&quot;.<br />\r\n<br />\r\nРаз уж так вышло, то я тебя защищу. Поэтому обязательно отплати мне той же монетой, понял?</p>',0.0,0,0),(83,'Супер бог зоомагазина','super-god-pets-shop','super-god-pets-shop/4dcda51b3b969ae4c5f38f66ee6ca48c.jpg','Маньхуа',2022,128,'<p>В эпоху небесных зверей сила домашних питомцев определяет все! Все мастера боевых зверей усердно трудились и постепенно улучшали силу своих питомцев. Пока не появился таинственный зоомагазин! Всего за несколько дней совершенствования скелеты низшего уровня действительно могут убить золотого дракона одним ножом?! Работающая девушка в магазине даже утверждала, что она богиня... Что касается босса Су Пина: разве это не рутинное дело по превращению милых домашних питомцев в сильнейших королевских зверей?</p>',0.0,0,0),(84,'Нань Хао и Шан Фэн','nan-hao-and-shang-feng','nan-hao-and-shang-feng/6415d5891ac4d8578be5e8d3d7b5c196.jpg','Маньхуа',2019,99,'<p bis_size=\"{&quot;x&quot;:20,&quot;y&quot;:20,&quot;w&quot;:795,&quot;h&quot;:20,&quot;abs_x&quot;:264,&quot;abs_y&quot;:403}\">История о буднях двух школьных друзей. Иногда весёлая, иногда грустная, иногда драматичная, но всегда интересная!</p>',0.0,0,0),(85,'Незначительный персонаж собственной истории','extra-novel','extra-novel/410ecd5cef038dc8a05f04c01956a4c7.jpg','Манхва',2022,84,'<p>В каждом романе часто присутствует свой собственный мир и множество персонажей, живущих в нём. Однако помимо главных героев и их помощников, а также нескольких других второстепенных личностей мы ничего не знаем о них.<br />\r\n&laquo;Чхундон, ты какого уровня?&raquo;<br />\r\nЯ понятия не имею, кто я такой. Мне даже не известно, почему меня именно так зовут. Весь мой рассказ может быть ограничен фактом о поступлении в специализированное военное училище. Моя линия практически не соприкасается с основной линией, и поэтому моё имя сложно найти на страницах этого романа.<br />\r\nЯ просто вне сюжета&hellip; точнее, я лишь одна из множества декораций&hellip;</p>',0.0,0,0),(86,'Инструкция по перерождению','regression-instruction','regression-instruction/e976a271950e6882bec3ab7c3fc2f883.jpg','Манхва',2021,88,'<p>Однажды меня призвали в этот мир.<br />\r\nОтовсюду посыпалось множество монстров, настало тяжёлое время.<br />\r\nКо всему прочему, мой талант оказался худшим из всех.<br />\r\n[Уровень таланта игрока худший из худших.] [Большая часть характеристик ничтожно низка.]<br />\r\nБудь ты воин или маг.<br />\r\nБудь ты регрессор из будущего.<br />\r\nЯ использую вас всех ради того, чтобы выжить!&nbsp;&nbsp;</p>',0.0,0,0),(87,'Смертельная мгла','dark-mortal','dark-mortal/938aacf481dae6141793789fccb9fe9a.jpg','Манхва',2019,81,'<p>Из-за пожара Каннам потерял родителей и ослеп. Он не мог видеть ничего, кроме существа по имени Ккамджан. Этот Ккамджан &mdash; галлюцинация или нечто большее? &laquo;Твои шрамы, твои глаза и даже&hellip; твоя сила! Я всё для тебя изменю.&raquo;</p>',0.0,0,0),(88,'Башня Бога','tower_of_god','tower_of_god/83068d5bf414739309abbc7de537031b.jpg','Манхва',2010,603,'<p><strong>Башня &mdash; место, в котором испытывается воля и где исполняются самые невероятные желания.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Если Башня избрала тебя, то всё, что надо сделать: покорить её, и тогда всё: богатство, власть, сила &mdash; что бы ты ни пожелал станет твоим.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Однако покорение может занять годы, если не века. А ты готов покорить Башню?</strong></p>',0.0,0,0),(89,'Некромант-одиночка','necromancer-alone','necromancer-alone/157d40dee67e244627c14fe5e14d3510.jpg','Манхва',2021,106,'<p>Мир на грани разрушения. Существа, упоминания о которых встречались лишь в мифах и легендах, теперь заполоняют города, обживаются под людскими жилищами и в метро, пожирая всё живое.<br />\r\nА что до человечества&hellip; Ему будет предложено занять новую роль в нынешнем мире выживания.<br />\r\nСонву выбрал класс &laquo;некромант&raquo;, и теперь трупы, что обагряют Землю, ему только на руку.</p>',0.0,0,0),(90,'S-ранги, Которых Я Воспитал','sclasses-i-grew-up-wit','sclasses-i-grew-up-wit/176c066961a08763b8e1631657488f0b.jpg','Манхва',2021,111,'<p>Охотник F-ранга. И вдобавок ко всему, старший брат, который даже не может начать догонять своего великолепного младшего брата, который уже стал S-ранговым.<br />\r\nПрожив жизнь, которая развалилась на части, и даже разрушив жизнь своего младшего брата, я получил еще один шанс, регрессировав на пять лет назад, я принял следующее решение:<br />\r\n&mdash; Я стану &laquo;идеальным воспитателем&raquo;.<br />\r\nПравильно, на этот раз, вместо того, чтобы быть посредственным охотником, я буду тихо поддерживать тех, кто способнее.<br />\r\nВот о чём я думал, но... S-ранги немного... странные.</p>',0.0,0,0),(264,'Целитель, пожирающий яд','poison-healer','poison-healer/203e8782714bcd8c2cb8827fb0e6da19.jpg','Манхва',2022,50,'Чон Хесон — главный герой, смертельно больной из-за различных ядов. Парень, которого никогда нигде не были рады, поведает о том, как он стал сильнейшим охотником на Земле, на которую напали монстры, вырвавшиеся из подземелий!',0.0,0,0),(91,'Слишком сильный новичок','newee-is-too-strong','newee-is-too-strong/592166b8d08f8c790f501e71efde91e3.jpg','Манхва',2022,83,'<p>Джэджу (с корейского навык/талант) рос без родителей в приюте, полностью оправдывая своё имя. Однажды он услышал, что приют переживает не лучшие времена и вынужден закрыться через 3 года. Пытаясь накопить денег, Джэджу получает оповещение на телефоне. Там он видит видео с собой, покоряющим башню в прямом эфире. Семь лет назад в мире внезапно появилась башня, случайным образом забирающая людей. Те, кто успешно прошёл башню, становятся &laquo;пробуждёнными&raquo;, и богатство для них лишь вопрос времени!</p>',0.0,0,0),(92,'Ванпанчмен','one_punch_man','one_punch_man/3dc09e7d0989027e1f0556675ec3ca11.jpg','Манга',2011,277,'<p bis_size=\"{&quot;x&quot;:20,&quot;y&quot;:20,&quot;w&quot;:795,&quot;h&quot;:166,&quot;abs_x&quot;:264,&quot;abs_y&quot;:403}\">Хорошо известная поговорка гласит: &quot;Всегда найдётся кто-то сильнее&quot;. Но что если достигнуть таких высот, что даже равных по силе не видать? Обычный парень по имени Сайтама, после того как его уволили, а затем и не приняли на другую работу, решает стать на путь героя. Пройдя через изнурительные тренировки и жестокие битвы, наш герой в совершенстве овладевает своим телом и познаёт что такое настоящая сила. Ну и попутно лысеет. А что поделать, за силу нужно платить. Вроде всё должно быть замечательно, ведь теперь ему ничего не страшно и он сможет справиться с любыми напастями, обрушивающимися на человечество. Но не тут-то было! Как быть, если все монстры и злодеи не могут выдержать даже одного удара героя? Как дальше заниматься любимым делом, если оно стало рутиной? Как вновь ощутить азарт схватки? Сможет ли хоть что-то развеять эту скуку? Сайтама не знает ответы на эти вопросы, но он постарается их найти.</p>',0.0,0,0),(93,'Я обрел бессмертие в другом мире','invincible-at-the-strt','invincible-at-the-strt/3604d2f86326410b144a4eda89cae093.jpg','Маньхуа',2021,108,'<p>&quot;Динь, пользователь открыл систему!&quot; - на грани смерти Чхэнь Чханань открывает систему, которая делает его непобедимым внутри области. Как обладатель люто имбовой системы, он решается прокачивать её, путешествуя по миру фантазии, сражаясь с культиваторами, монстрами, богами, бессмертными и демонами. За короткое время, он буквально перевернул мир на 180 градусов и не собирается останавливаться.</p>',0.0,0,0),(94,'Я злой бог','im-an-evil-god','im-an-evil-god/high_cover.jpg','Маньхуа',2019,399,'<p>Среди всех королевств появился самый мужественный и самый красивый злой бог в истории! Несравненный красавец Се Янь попал в логово лисицы. Чтобы не погибнуть, он стал путешествовать между различными царствами. Убив сына Божьего и отталкивая конфедерацию Ян И он...</p>',0.0,0,0),(95,'Борьба в прямом эфире','how-to-fight','how-to-fight/9310961eb51fb24ac77612c4bcadb681.jpg','Манхва',2019,197,'<p>Ю Хобин &ndash; ничем не выделяющийся школьник, над которым постоянно издеваются его одноклассники-отморозки, чувствующие свое превосходство над ним. Парню ничего не остается, кроме как и дальше игнорировать их, потому что его жизнь и без того полна трудностей. Однако один непредвиденный инцидент полностью переворачивает его жизнь. Он становится знаменитым благодаря случайно загруженному и ставшему хайповым видео! Деньги и популярность &ndash; что может быть лучше?! Но, так как все вышло случайно, повторить успех первого ролика будет уже не так просто. Искушенный запахом денег, которые можно на этом поднять, и его внезапным всплеском популярности, он планирует делать более увлекательный контент, который будет интересен людям и поможет ему собрать больше подписчиков... Но, чтобы достичь этого, Хобину предстоит научиться сражаться, и именно с этого момента начинается история его канала &laquo;HOW TO FIGHT&raquo;!</p>',0.0,0,0),(96,'Восхождение в тени','the-eminence-in-shadow','the-eminence-in-shadow/1b39575ae6e8c9ae5be79c842d6e9441.jpg','Манга',2018,60,'<p>Подобно тому, как некоторые в детстве боготворят героев, один юноша обожал силы, скрывающиеся в тени. Скрыв свою силу и прожив посредственную жизнь посредственного персонажа, проходя в это время через безумные ночные тренировки, он в конце концов перерождается в ином мире, обретая абсолютную силу. Юноша, отыгрывающий роль скрывающейся в тени силы, его неправильно всё понимающие подчинённые и огромная стёртая в пыль теневая организация... Это история о юноше, обожавшем скрывающиеся во мраке силы, который, вероятно, в итоге обретёт власть над теневой стороной иного мира. </p>',0.0,0,0),(97,'Хроники Святого Демона','chronicles-of-heavenly-demon','chronicles-of-heavenly-demon/high_cover.jpg','Манхва',2018,217,'<p>&laquo;Лишь твои поступки поддерживают гармонию в жизни&hellip; Именно на это ты должен опираться!..&raquo; Преемник секты Искусного Копья и его ученик Хёк Ун-Сон были застигнуты за изучением запретного Демонического искусства и в последствии были наказаны смертью. &laquo;Жалкие лицемеры, опирающиеся на устои своей секты!..&raquo; Но в момент, когда Хёк Ун-Сон предстал перед вратами в ад, артефакт секты Искусного Копья стал излучать странный свет, одаривший юношу новой жизнью. Две противоположности: секта, исповедующая лишь добро, и секта, погрязшая в изучении демонических техник. Приняв свою судьбу и вспоминая всю ту злобу, что накопилась в нём, Ун-Сон начинает свой путь к становлению боевым мастером, чтобы потом отомстить&hellip; Отомстить ублюдкам, что предали его! История о жизни и смерти, о добре и зле, о случайных встречах и удаче&hellip; Начинается!</p>',0.0,0,0),(98,'Как переманить мужа на свою сторону','how-to-make-my-husband-on-my-side','how-to-make-my-husband-on-my-side/95abb63b9e72d3529a4b216be0d9223e.jpg','Манхва',2021,91,'<p>Я стала Рудбекией, второстепенным антагонистом, которая умирает от рук собственного мужа в фантастическом романе. Чёртов отец из этого мира вновь завёл разговор о моём партнёре в политическом браке. Однако проблемка в том, что им как раз-таки и является тот самый муж, от рук которого мне суждено погибнуть! Как бы то ни было, сперва я должна найти способ выжить. Если я покажу себя максимально безобидной людям севера, защищу младшую сестру мужа, которую в оригинале романа я убиваю, а затем сделаю вид, что влюбилась в супруга, пощадит ли он меня? &laquo;Я влюбилась в вас!&raquo; Поэтому умоляю, не убивай!</p>',0.0,0,0),(99,'Второе пришествие обжорства','the-second-coming-of-gluttony','the-second-coming-of-gluttony/19a01ee41f2041875e7cc6efb59db733.jpg','Манхва',2019,109,'<p>Он был наркоманом, неудачником, жалким человеком. Но один мимолётный сон, который мог быть реальностью, пробудил его однажды утерянные чувства. Обладая уникальной способностью, он будет использовать её и странный сон, чтобы проложить свой собственный путь в мир ныне известный как Потерянный Рай.</p>',0.0,0,0),(100,'Клинок, рассекающий демонов','blade_of_demon_destruction','blade_of_demon_destruction/2b39e3f41d3e8edc73c55027263b86f2.jpg','Манга',2016,224,'<p>Танджиро - старший сын в семье, потерявшей кормильца. Однажды он уходит в другой город, чтобы продать древесный уголь, но в конце концов остаётся на ночь в чужом доме, вместо того, чтобы идти домой. А всё из-за слухов о демоне, который разгуливает в горах под покровом темноты. Утром парень вернётся домой живым и невредимым... Но его ждут ужасные известия.</p>',0.0,0,0),(101,'Мастер меча, живущий на крыше','blade-master-from-the-roof','blade-master-from-the-roof/07b4fd6c7c96d3133ac9969fe52629cc.jpg','Манхва',2020,117,'<p>Во время учёбы в средней школе главный герой Так Се Ён был избит восемью одноклассниками. Спустя девять месяцев, отойдя от комы, он узнает, что его родители покончили собой, дабы привлечь внимание общественности на произошедшее с сыном. Вследствие, было возбуждено уголовное дело об избиении и, несмотря на усилия нападавших, что хотели сокрыть это дело, они все же были наказаны. И хотя правосудие свершилось, Се Ена не покидало чувство ненависти и боязнь к окружающему миру. Прошло несколько лет, но он так и не смог выйти из дома. Но вот однажды он слышит странный звук и решается переступить порог своей квартиры. А за дверью, на крыше дома, его ожидает &quot;Меч воина&quot; (он живёт в надстройке, а потому за дверью у него не лестница, а крыша). Голос духа шепчет ему: &quot;Хочешь стать сильнее: возьми меч и беги, беги и маши, маши, пока все силы не иссякнут. Вот и все!&quot; И так, он берет этот меч и месть его начинается.</p>',0.0,0,0),(102,'Герой вернулся','the-warrior-is-bacc','the-warrior-is-bacc/94b0cebe2fd10b1caecdc6116d2298a9.jpg','Манхва',2021,109,'<p>Пак Чон Су, герой, что спас мир только по одной причине - вернуться и отомстить Ким Мин Су.<br />\r\nОн спасся сам, но не смог спасти тех, кто были всем его миром. Пак Чон Су намерен уничтожить того, кто сотворил с ним это.<br />\r\n<br />\r\nИстория без счастливого конца. Пробирающая до костей реальность, в которой герой убивает себе подобных.</p>',0.0,0,0),(280,'Первобытный Охотник','the-first-hunter','the-first-hunter/4849331ad884bc43c16c7cea96449b54.jpg','Манхва',2018,101,'<p>В один миг, Мир канул в Лету и орда Монстров пришла, чтобы взять контроль над землей, но в этом хаосе пробудилась группа людей, и получила разные способности. Они погрузились в ожесточенную битву, дабы защитить свой дом.</p>',0.0,0,0),(103,'Изменщик должен умереть','cheating-men-must-die','cheating-men-must-die/61857568070c6fc2bd518183c2f61b00.jpg','Маньхуа',2019,683,'<p>&laquo;Я всегда считала что мерзавцы крутые&raquo;</p>\r\n\r\n<p> Уничтожение одного&nbsp;подонка дарит мгновение удовлетворения, но жизнь, потраченная на уничтожение подонков&nbsp;&mdash;&nbsp;жизнь, полная наслаждения... Сю Люй Сянвей, наша главная героиня, путешествует по мирам и с помощью &quot;Системы отмщения второстепенных женских персонажей&quot; помогает брошенным женщинам восстановить справедливость. </p>\r\n\r\n<p>Сю Люй Сянвей: &laquo;Единственное, что может утешить меня&nbsp;&mdash;&nbsp;слезы раскаяния мёртвых и боль проституток&raquo;</p>\r\n\r\n<p>Система: &laquo;Жива ли моя хозяйка сегодня? Нет&raquo;</p>',0.0,0,0),(104,'Запомнить','memorizes','memorizes/f8d5ba8023f19ea07bc41de7dc13ea15.jpg','Манхва',2020,101,'<p>Мир, отличающийся от настоящего - Адская Долина. В один из дней после демобилизации из армии, Ким Су Хен был внезапно перемещен в мир под названием &quot;Адская Долина&quot;. Хоть он и смог в конце концов вернуть все в прежнее русло, 10 лет, которые он провёл в адской долине, стали пятном, напоминающим про ужасное прошлое. Для того, чтобы изменить ужасное прошлое, Ким Су Хен решает использовать силу &laquo;кода зеро&raquo;.&nbsp;<br />\r\n<br />\r\n&ldquo;Это глупо использовать предмет, который имеет мощнейшую силу просто ради того, чтобы откатать время назад. В последний раз спрашиваю. Пользователь Ким Су Хен, вы действительно хотите повторить свои мучительные 10 лет?&raquo;&nbsp;<br />\r\n<br />\r\nСерафима, закончившая говорить, теперь смотрела на меня с умоляющими глазами. Вдруг из меня вышел смешок, не имевший никаких предпосылок. Это буквально был смех без какой либо причины.</p>',0.0,0,0),(105,'Владея Ничем','a-nobriner-retur','a-nobriner-retur/cd910937afb7de4ee87872470511a4be.jpg','Манхва',2022,62,'<p>Ли Сун Мин &ndash; обычный школьник. Он попадает в мир под названием Эрия. Без особых способностей и сил он, тем не менее, выживает в этом мире в течении десятилетий. Но встречает позорную смерть. Однако, на этом его история не заканчивается, после смерти он получает второй шанс &ndash; артефакт под названием Камень Прошлой Жизни возвращает его в прошлое. Но и на этот раз он оказывается на грани выживания, лишённый любых преимуществ. Между ним и теми, у кого есть таланты и способности &ndash; пропасть. Он чувствует себя обделенным, и тем не менее, продолжает бороться за место под солнцем. &ldquo;Что бы мне не пришлось пережить, на этот раз я обязательно проживу свою жизнь лучше!&rdquo;.</p>',0.0,0,0),(106,'Бесконечное Поднятие Уровня в Муриме','infinite-levelup-in-moorim','infinite-levelup-in-moorim/6dac53712081b2033533d856377a4520.jpg','Манхва',2020,173,'<p><strong>Тан Ю Сон, младший воин, не имевший таланта, с низким уровнем подготовки, погиб на поле боя.</strong></p><p></p><p><strong>Но когда он открыл глаза, он был сильно удивлён!</strong></p><p></p><p><strong>Он вернулся в свое прошлое, когда ещё был ребёнком!</strong></p><p></p><p><strong>Теперь он может изменить будущее!</strong></p>',0.0,0,0),(107,'Королева со скальпелем','queen_with_a_scalpel','queen_with_a_scalpel/high_cover.jpg','Манхва',2018,144,'<p>В первой жизни она была ужасной королевой, навлёкшей на страну беды, и, в конечном итоге, сожжённой своим же королём на костре. Во второй жизни она стала талантливым хирургом, искупающим свою вину за прошлое, спасая людей. Но из-за авиакатастрофы талантливый хирург Сон Чжи Хён возвращается в свою первую жизнь! В этот раз она решает всё изменить, став врачом.</p>',0.0,0,0),(108,'Выживая в игре за варвара','survive-as-a-barbarian-ingame','survive-as-a-barbarian-ingame/f18e029757b55952e2b93f91c294e481.jpg','Манхва',2023,39,'<p>Главный герой Ли Хан Су наконец-то достиг комнаты финального босса после девяти лет игры в &laquo;Подземелье и камень&raquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Но стоило войти, как появилось уведомление, что он завершил обучение и получает тело варвара Бьёрна.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>В игре &laquo;Подземелье и камень&raquo; после разрушения мира остался только один город. Каждый месяц открывается лабиринт, предлагая исследователям возможность пройти его и получить вознаграждение.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Варвары считаются бесполезными во всём, кроме битвы. И если выяснится, что человек захватил тело персонажа, его окрестят &laquo;злым духом&raquo; и убьют.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>С навыками, которые он накопил за девять лет задротства, и невероятно мускулистым телом варвара, Ли Хан Су сделает всё возможное, чтобы сражаться в лабиринте и выжить!</p>',0.0,0,0),(109,'Я — ранкер, даже когда сплю','even-if-i-sleep-i-rank','even-if-i-sleep-i-rank/d9996f27393c73291110113b1b2f8c9b.jpg','Манхва',2022,98,'<p>&mdash; Онни, он только что отдохнул секунд за 30, да? Это же мне не причудилось?<br />\r\n&mdash; &hellip;Да.<br />\r\nХён Сон после 15 часов работы охотником, снова отправился в бой после 30 секунд отдыха. Это специальный навык Хён Сона.<br />\r\n&laquo;Нарколепсия Тананоса активирована&raquo;.<br />\r\n&laquo;Вы принудительно уснете&raquo;.<br />\r\nТы получил новый предмет после того, как немного поспал?<br />\r\nЧитайте историю несокрушимого потомка Тананоса, Хён Сона, владельца божественного класса.</p>',0.0,0,0),(110,'Фермерство в башне в одиночку','farming-in-the-tower-alone','farming-in-the-tower-alone/cbf204cb9991b8fb87c1054bbc970d7c.jpg','Манхва',2023,37,'<p>Внезапно в один прекрасный день в городе появилась таинственная башня. Люди решили назвать её подземельем, и хоть внутри находилась сплошная пересеченная местность с ордой опасных монстров, она была также и землей возможностей, где находились несметные сокровища. Седжун, молодой человек, ведущий повседневную жизнь, был очень взволнован, когда неожиданно получил приглашение в подземелье. По приглашению он оказывается в ловушке в секретной зоне таинственной башни. У него есть только его тело и несколько семян. Теперь Седжуну предстоит выращивать урожай, собирать припасы и разрабатывать свой собственный план выживания!</p>',0.0,0,0),(111,'Призванный в параллельные фэнтези миры несколько раз','summoned-to-a-parallel-fantasy-world-many-times','summoned-to-a-parallel-fantasy-world-many-times/93abe6180e5195829eb46bb340fc5e43.jpg','Манга',2020,46,'<p>Весь класс парня призывают в другой мир, за исключением того, что он единственный, кого перенесли во второй раз в другой мир. Как только он привыкает к своей новой жизни, его снова и снова вызывают в другой мир.</p>',0.0,0,0),(112,'Мастер Укрощения','tming-master','tming-master/230830734533b3772c585c7caadb8153.jpg','Манхва',2020,127,'<p>Самая популярная в&nbsp;мире игра виртуальной реальности, &laquo;Кайллан&raquo;. Всем известный игрок виртуальной реальности, Ян. Он&nbsp;удалил своего персонажа 93 уровня, чтобы получить скрытый класс&hellip; Однако этот класс в&nbsp;итоге оказался самым бесполезным в&nbsp;Кайллане&nbsp;&mdash; призывателем! Кроме того, внезапный звонок от&nbsp;его профессора практически сводит его с&nbsp;ума! Чтобы избежать испытательного срока в&nbsp;академии, ему необходимо поднять тот&nbsp;же уровень, что был у&nbsp;его удаленного персонажа, всего за&nbsp;два месяца!</p>',0.0,0,0),(113,'Регрессия Падшего Созвездия','return-of-the-broken-constellatio','return-of-the-broken-constellatio/4bc6cd08a6008ca8de885301df258a66.jpg','Манхва',2021,91,'<p><strong>«Сумрачный бог» - простой человек, возвысившийся до звания бога. Прославившись как злой бог, он потерял все: свое созвездие, веру и статус. Его божественность была отозвана, а божественная сила исчезла.<br/><br/>«Я бы хотел, чтобы ты поработал со мной». Именно эти слова он услышал от хозяина подземного мира, Танатоса, когда он протянул ему свою руку...<br/><br/>Взяв Танатоса за руку, «Сумрачный бог» решил снова жить как игрок «Ли Чхан Сон», чтобы отомстить богам, которые бросили его в преисподнюю!<br/><br/>«Итак, я действительно ЩАС ВСЕХ ПЕРЕРЕЖУ!.</strong></p>',0.0,0,0),(114,'Маг, поглощающий Таланты','talent-swalowed-wizard','talent-swalowed-wizard/d7db7c473fac8b293670359427467b06.jpg','Манхва',2022,51,'<p>Элрик Мелвингер.<br />\r\nЕдинственный наследник уважаемой магической семьи.<br />\r\nХоть юноша и обладал врождённым талантом, он был настолько выдающимся, что мешал Элрику изучать магию. Тем не менее, он получил благословение от своих предков.<br />\r\n<br />\r\n[Поедай демонов.]<br />\r\n[Поглощай демонов.]<br />\r\n[Пей демонов.]<br />\r\n[Продолжай накапливать демонов в себе и постигай новую магию.]<br />\r\n<br />\r\nДостигать вершин.<br />\r\nВзобраться настолько высоко, чтобы никто не смог меня достать.</p>',0.0,0,0),(115,'Король-рыцарь, вернувшийся с богами','the-king-of-knights-returns-with-the-gods','the-king-of-knights-returns-with-the-gods/b3a7f67235df3c39bff8e2bacbff044d.jpg','Манхва',2023,35,'<p>После 300 лет охоты на демонов в другом мире, он вернулся на Землю. Однако он пришёл не один.</p>',0.0,0,0),(116,'Перерождение бессмертного горожанина-культиватора','rebirth-of-the-urban-immortal-cultivator','rebirth-of-the-urban-immortal-cultivator/a074927d7853c8e013a2c22c51f05646.jpg','Маньхуа',2017,917,'<p>Чэнь Фань потерпел неудачу в процессе своего вознесения и по необъяснимым причинам вернулся на 500 лет назад, во времена его молодости. Магия, святые и сильнейшие боевые эксперты &mdash; всё это осталось лишь в его воспоминаниях. Чэнь Фань не забыл обиды своей прошлой жизни&hellip; Обуреваемый желанием отплатить, он начинает свой путь сначала.</p>',0.0,0,0),(117,'Реинкарнация безработного ~История о приключениях в другом мире~','mushoku_tensei_if_i_get_to_a_parallel_universe_ill_bring','mushoku_tensei_if_i_get_to_a_parallel_universe_ill_bring/23c0da60ceb0af276cb1173ccc524406.jpg','Манга',2014,103,'<p>34-летний отаку-затворник был выгнан из дома своей семьёй. Этот жирный и уродливый девственник без гроша в кармане осознал, что его жизнь подошла к концу. Затем он понял, что его жизнь вообще могла бы быть намного лучше, если бы он мог избавиться от тёмных страниц своей жизни. Пребывая в сожалениях, он увидел, как грузовик со спящим водителем быстро надвигается на трёх школьников. Собрав все свои силы, он попытался спасти их и погиб.А открыв глаза, он уже переродился в мире меча и магии, как Рудеус Грейрат. Родившись в новом мире, начав новую жизнь, Рудеус решил, что &quot;В этот раз, я проживу свою жизнь на полную, безо всяких сожалений!&quot; И так началось приключение человека, пожелавшего заново начать свою жизнь.</p>',0.0,0,0),(118,'Свинарник','pigpen','pigpen/bb9796970369dbdb3373f2d3ea57e9a9.jpg','Манхва',2019,68,'<p>Главный герой оказывается на необитаемом острове, где перед ним предстает загадочная семья.</p>',0.0,0,0),(119,'Мальчик с ружьем','hunting-rifle-boy','hunting-rifle-boy/664a452d82ec1011a6e752209752aae8.jpg','Манхва',2021,69,'<p>Новый проект от популярного автора Ким Карнби. Расскажет нам о мальчике, который станет оружием.</p>',0.0,0,0),(120,'Некромант - я катастрофа','necromancer-i-am-the-disaster','necromancer-i-am-the-disaster/6df09f7fefa4128f89516254b7fd60ce.jpg','Маньхуа',2023,42,'<p>Игра становится реальностью, правила этого мира меняются, человечество вступает в эпоху смены профессий. </p><p>Смени профессию! </p><p>Прокачивайся и становись сильнее! </p><p>Стань повелителем этого мира! </p><p>В день смены профессий Линь Мо Юй стал единственным, кому выпала скрытая профессия - профессия некроманта. Все существа, что им призваны, никогда не умрут, как и он сам. </p><p>&quot;Я восседаю на троне из костей, шагаю на границе жизни и смерти&quot;. </p><p>&quot;Я - настоящая катастрофа!&quot;</p>',0.0,0,0),(121,'Стала женой главного героя','a-became-my-heroines-wife','a-became-my-heroines-wife/90f1a613decb697af1e75a0398686823.jpg','Манхва',2021,92,'<p>Я попала в тело Фионы, главной злодейки, чья душа была приговорена к вечным страданиям после ужасной кончины от рук главного героя. Её семья издевалась над ней только потому, что она была незаконнорожденной.</p>\r\n\r\n<p>И вот, переселившись в тело за 6 лет до начала романа, меня отправили на войну в возрасте 13 лет! К счастью, Фиона как главная злодейка романа оказалась гениальным магом. Я должна пережить нашествие монстров, но сейчас не могу находиться в центре поля боя. Как раз перед тем как я выдохлась, я столкнулась с главным героем-подростком.</p>\r\n\r\n<p>&hellip;Почему он здесь? Что ж, если главный герой здесь умрёт, то мир будет разрушен. Так что давайте сначала спасём его!</p>',0.0,0,0),(122,'Путь Варвара','barbarian-ques','barbarian-ques/8729ed7be6409bdf786890d16af93c3e.jpg','Манхва',2022,84,'<p>Ульрих - величайший воин племени каменных топоров.<br />\r\nОн смог выйти за пределы &quot;Небесных Гор&quot;, превосходя всех своих соплеменников.<br />\r\nНо оказавшись там, он увидел...<br />\r\nЛюдей, говорящих на незнакомых языках, облаченных в доспехи, сплавленные из железа!<br />\r\n-Так, значит, мир за горами не был чистилищем для мертвых душ!<br />\r\nНовый неизведанный мир и человек, решивший его сотрясти.<br />\r\nВарвар Ульрих отправляется в цивилизацию!&nbsp;</p>',0.0,0,0),(123,'Реинкарнация Военного','god-of-blackfield','god-of-blackfield/685951a1b2d45f5bc1fb0cfb554aef68.jpg','Манхва',2020,197,'<p>Те, кто сражался с ним на поле боя в Африке, в страхе и трепете называл его &laquo;богом Черного Поля&raquo;. Однако, Кан Чан, руководивший операцией по убийству Масаллана, лидера суннитской группировки SISS, был убит таинственной пулей, которая пролетела позади него. В промежутках между тем, как его глаза медленно закрывались и открывались, он постепенно один за одним терял своих коллег, которые верили и следовали за ним. В конце концов его глаза беспомощно сомкнулись. Потерпевший предательство Кан Чан ждал своей смерти, однако каким-то неведомым образом он переносится через 3 года и возвращается в Корею. Ему 19 лет, он изгой и это совсем другой &laquo;Кан Чан&raquo;. Так начинается путешествие Кан Чана в поисках правды о реинкарнации и мести предателю!</p>',0.0,0,0),(124,'Мой навык – копировать способности других','i-can-replicate-talent','i-can-replicate-talent/33073c40c9c3c98b0aa8081ca20101bd.jpg','Маньхуа',2021,62,'<p>Молодой парень Е Тянь приобрел навык копировать способности других, и с тех пор изменил свою судьбу, дабы защитить младшую сестру и постараться выжить в конце света, вызванном вторжением чудовищ. Чтобы стать сильнее, он начал исследовать неизвестные миры, и постепенно раскрыл секрет вторжения других измерений.</p>',0.0,0,0),(125,'Мой сольный бесконечный рост','im-alone-the-trait-grows-infinitely','im-alone-the-trait-grows-infinitely/9a9941957c5fefd6f26dc8a8cd14de04.jpg','Манхва',2022,61,'<p><strong>От студии, создавшей &laquo;Поднятие Уровня в одиночку&raquo;, &laquo;Возвращение героя уровня катастрофы&raquo;!</strong></p>\r\n\r\n<p>Я думал, что никогда не смогу стать охотником. Никогда не надеялся, что у меня появится шанс. Однако я ошибался. &quot;Башня испытаний&quot; отобрала определённых людей с Земли.&nbsp;Пожалуйста выберите уровень сложности. Вознаграждение будет полностью зависеть от степени сложности, выбранной вами. Теперь у меня появился шанс. Это нечто особенное.</p>',0.0,0,0),(126,'Я стала приемной дочерью главного героя','43915-i-became-the-male-leads-adopted-daughter-webtoon','43915-i-became-the-male-leads-adopted-daughter-webtoon/61ae0d1a82821dbbaf566175d155aad6.jpg','Манхва',2021,87,'<p>- Я собираюсь усыновить ребёнка.</p>\r\n\r\n<p>Импульсивное решение герцога Пеллио Борреотти потрясло всех в особняке. Он не только сделал её своей дочерью, но и дал ей имя &quot;зверя&quot;, которое могли получить только прямые члены родословной.</p>\r\n\r\n<p>- Даже сейчас, пока ты дышишь, я зарабатываю деньги.</p>\r\n\r\n<p>- Это уверенность, а не высокомерие.</p>\r\n\r\n<p>- У моего лица действительно есть свои преимущества.</p>\r\n\r\n<p>- В любом случае, она - кладезь талантов. Моя дочь - гений. Её лицо похоже на моё, поэтому она так красива.</p>\r\n\r\n<p>- Но...</p>\r\n\r\n<p>&quot;Я люблю мышцы больше всего!&quot;, &quot;Покажи мне свои мышцы бёдер! Твоя задница могла быть ещё лучше!&quot;</p>\r\n\r\n<p>- Я признаю, моя дочь - извращенка.</p>\r\n\r\n<p>Самый высокомерный отец во всём мире и его испорченная дочь.</p>',0.0,0,0),(127,'Возвращение ранкера SSS-ранга','sssclss-rnkrs-rturn','sssclss-rnkrs-rturn/21cd0a8bfb60dd9bf9799a6feb4b638b.jpg','Манхва',2022,84,'<p>Рокан был &quot;королем насилия&quot;, который правил как сильнейший в игре виртуальной реальности &quot;Властелин&quot;. К сожалению, из-за приказа об убийстве, отданного вражеской гильдией, он потерял все. К его удивлению, когда он проснулся в следующий раз, он вернулся на три года назад!<br />\r\n<br />\r\n&quot;Чертовы отродья, только подождите. Я вас всех сожру!&quot;<br />\r\n<br />\r\nНовая история начинается с того, что Рокан, который путешествовал в прошлое, снова взбирается на вершину!</p>',0.0,0,0),(128,'Белая кровь','white-blood','white-blood/high_cover.jpg','Манхва',2020,94,'Корею поглотил хаос. Уже как десять лет вампиры терроризируют мирных граждан, а правительство бессильно. Пак Хаян (имя означает \"белый\") - 20-летняя студентка колледжа, желающая просто иметь друзей и проводить свои дни, как самый обычный человек, хоть и является вампиром. Все меняется, когда Хаян обнаруживают и на нее открывают охоту как люди, так и её сородичи.',0.0,0,0),(129,'Девушка из анонимного чата!','the-girl-from-random-chatting','the-girl-from-random-chatting/41cf611d5762cd30d580c36367ef82a7.jpg','Манхва',2017,314,'<p>Джун У ненавидит школу и с трудом заводит друзей. Единственное, что приносит ему счастье &mdash; разговоры с незнакомцами в анонимном чате. В этом АнонЧате Джун У знакомится с девушкой, которая оказывается его одноклассницей, по имени Сон А. Сон А даже не догадывается о том, кто её новый знакомый! Сможет ли Джун У побороть свою социофобию и стать ближе к ней в реальной жизни?</p>',0.0,0,0),(130,'Восхождение тирана','became-a-tyrant-of-defense-games','became-a-tyrant-of-defense-games/6860f68aa19e889828d2c99dbf8ec62c.jpg','Манхва',2022,71,'<p>Tower Defense &amp; Dungeon Offense RPG. Я был единственным, кто прошёл эту игру на максимальной сложности... И вот однажды, я оказался в центре сражения из игры! Многие предпочли бы сдаться, но я не такой... Я игрок, который не умеет сдаваться, и именно я смогу поработить всех и вся, став величайшим тираном и властелином этого сраного мира!</p>',0.0,0,0),(154,'Последний человек','the-last-human','the-last-human/444756d136d77d8411a0404957ccb836.jpg','Маньхуа',2017,525,'<p>Цзо Тянь Чэнь&nbsp;&ndash; последний выживший человек в городе, зараженном зомби-инфекцией. Будучи на грани смерти, он внезапно оказался в своем теле десять лет назад, когда город еще не был заражен. Он решил, что в этот раз спасёт близких ему людей и воссоединится со своей старой любовью.&nbsp;Следите за его приключениями, в которых он использует свои воспоминания о следующих 10 годах, чтобы выжить и спасти своих близких!</p>',0.0,0,0),(131,'Бессмертный мечник в обратном мире','immortal-swordsman-in-the-reverse-world','immortal-swordsman-in-the-reverse-world/61469d500945453e6ed0a1220513dfc9.jpg','Маньхуа',2019,382,'<p>&laquo;Чу Цин - мастер по фехтовальщик мечей, который 300 лет назад случайно попал в сказочный мир. В течение этих 300 он начал свое совершенствование. Когда он достиг обители природы, не ожидалось, что он вместо этого откроет коридор пространства и времени и вернется на землю в возрасте 17 лет. Но когда он увидел ситуацию, оказалось, что это была не земля, на которой он когда-то жил, а мир перевернулся между ролями женщин и мужчин. Каким было его путешествие, чтобы найти способ вернуться в изначальный мир, победить и покорить сильных женщин мира ... &raquo;</p>',0.0,0,0),(132,'Отец, я не буду выходить замуж!','dad-im-not-going-to-get-married','dad-im-not-going-to-get-married/97d6285d02531f1af33a0219c5ed8863.jpg','Манхва',2021,121,'<p>Я переродилась как Джубелиан Элой Флойен &ndash; злодейка прочитанной мной новеллы. Я была обречена на смерть, но не тут-то было! Используя воспоминания о прошлой жизни, я собираюсь избежать своей гибели!</p>\r\n\r\n<p>&laquo;Я не выйду замуж за мужчину&nbsp;без чести, семьи, имущества и силы!&raquo;</p>\r\n\r\n<p>Как только я заявила о своём желании жить великолепной и роскошной жизнью, мой отец решил сделать меня невестой кронпринца! Он сумасшедший?! Ведь я буду рассматривать помолвку только в качестве крайней меры.</p>\r\n\r\n<p>&laquo;Почему ты избегаешь помолвки с наследным принцем?&raquo;</p>\r\n\r\n<p>&laquo;Он меня пугает! Он сразу же убивает тех, кто ослушался его!&raquo;</p>\r\n\r\n<p>Через несколько дней наследный принц отправил письмо. &laquo;Не переживай, тебя я не убью&raquo;.</p>\r\n\r\n<p>О, нет... неужели я уже что-то натворила? Что-то, за что должна умереть?</p>',0.0,0,0),(133,'Возвращение темного мага','i-returned-but-it-was-the-day-before-enlistment','i-returned-but-it-was-the-day-before-enlistment/6b3e9d15997767a263ec9e362c276cdf.jpg','Манхва',2023,43,'<p>Ким Минджун &ndash; обычный корейский старшеклассник &ndash; неожиданно был призван в другой мир, где ему пришлось стать <strong>тёмным магом</strong>.</p>\r\n\r\n<p>Преисполненный желания вернуться домой, он преодолел множество трудностей и в конце концов спас мир с помощью тёмной магии, а после, отринув всю честь и славу, благополучно вернулся домой.</p>\r\n\r\n<p>Но Ким Минджун не смог насладиться мирными деньками: неожиданно из подземелья вырвалась орда монстров.</p>\r\n\r\n<p>У Минджуна не осталось иного выбора, кроме как... <strong>снова броситься в бой в первый же день возвращения!!!</strong></p>',0.0,0,0),(134,'Возвращение Еретика','the-return-of-the-immortals','the-return-of-the-immortals/ed2e70b6839121f2cdf8f9694ecc7e8f.jpg','Манхва',2022,77,'<p>Тан У Хён &mdash; Дух Всемогущий, стал самым страшным из бедствий этого мира. Он думал, что будет вечно править на земле. Но всё изменилось, когда Восемь Бессмертных, охраняющих покой и порядок в Срединных Землях, запечатали его на дне озера Дончонхо... Минула тысяча лет. За это время Тан У Хён успокоился, а его тяга к кровопролитию канула в небытие. Лишь гнетущее и изнуряющее одиночество осталось у Всемогущего Духа. В один из дней бесцельно бродящий Тан У Хён, встречает маленькую девочку Хва Со Ми. Одинокий странник почувствовал небывалую связь с малюткой, ведь она также одинока, как и сам путник. История необычной семьи из Срединных Земель. Воин с ледяным сердцем и милая искренняя девочка никого не оставят равнодушным.</p>',0.0,0,0),(135,'Одиночный игрок-багоюзер','i-am-alone-with-bugs','i-am-alone-with-bugs/981084e136aace693c31ac13f16e8bb3.jpg','Манхва',2020,120,'Если можно добиться успеха, используя окольные пути и ухищрения, то я только за!',0.0,0,0),(136,'Истинный злодей','how-villains-live','how-villains-live/135781bc79e45a8909fde64f4465241c.jpg','Манхва',2021,114,'<p>Будь ты хоть мерзавцем, хоть убийцей или насильником, ты всё равно имеешь&nbsp;право участвовать в ней. Участвовать в игре, которая определит преемника бога. И я отношусь к самым худшим из людей. Подлая, грязная, слабохарактерная мразь, которая никогда не стеснялась проявлять свою истинную натуру</p>',0.0,0,0),(137,'Я просто хочу спокойно играть в игры','i-just-want-to-play-game-quietly','i-just-want-to-play-game-quietly/9953459f5cd2aa9049afb1727060e1a4.jpg','Маньхуа',2022,126,'<p>Пространственные штормы обрушились, и на Земле появилось много внепространственных областей. Все виды таинственных внепространственных жизней рождаются в этих областях. Чтобы стать сильными, люди начали проникать в эти опасные районы, чтобы охотиться и убивать внепространственных существ. Но я, Чжоу Вэнь, превратил эти области в подземелья в моей мобильной игре. Повышая уровень своего игрового персонажа, я буду повышать свою силу в реальности. Когда другие рискуют своей жизнью, я здесь становлюсь сильнее, играя.</p>',0.0,0,0),(138,'Моя типичная реинкарнация','reincarnation-plan','reincarnation-plan/bea01ed999dc1b5f48553a516cd89c26.jpg','Манхва',2022,79,'<p>Сильнейший мечник Самион.<br />\r\nДавен был двоюродным братом Самиона, и он был наполовину одиноким человеком без правой руки.<br />\r\nПреодолевая насмешки и презрение однорукого, он превзошел даже гениальность прямой линии Самиона.<br />\r\nВ конце концов, он был предан своими родителями и семьей и встретил самый жалкий конец.<br />\r\nНо это был не конец.<br />\r\n<br />\r\n&mdash; У меня есть правая рука?<br />\r\n<br />\r\nВраг новой семьи.<br />\r\nТело природного таланта.<br />\r\nпредыдущий жизненный опыт.<br />\r\nИ даже Бог с ним.<br />\r\n<br />\r\nКогда я переродился, все изменилось.</p>',0.0,0,0),(139,'Я скоро умру','i-will-die-soon','i-will-die-soon/high_cover.jpg','Манхва',2019,66,'<p>&laquo;Потерпев неудачу в этой жизни, я смогу добиться успеха в следующей.&raquo;Это история моей тринадцатой жизни, лично я называю её &laquo;Наедине со скорой Смертью&raquo;.</p>',0.0,0,0),(140,'Я не тот, за кого меня принимают','im-not-that-kind','im-not-that-kind/47d381a7e7a8680891dd414541099b85.jpg','Манхва',2022,60,'<p>Я, Деон Харт, слабый, больной человек, у которого идёт кровь от малейшего стресса. Однако, в то же время, меня ошибочно приняли за сильнейшего человека. И теперь, в демоническом царстве я известен как Демон Арут, командир 0 отряда Короля Демонов.</p>',0.0,0,0),(141,'Маг, пожирающий книги','the-bookeating-wizard','the-bookeating-wizard/4b88d38518ed4f38453f316531d5fcda.jpg','Манхва',2021,108,'<p>Теодор Миллер -&nbsp;лучший ученик магической академии по части теории, но худший на практике, уже в третий раз ему приходит уведомление&nbsp;о том, что его оставляют на второй год. С каждым днём его мечта стать магом становится всё дальше и дальше. Однако, одним прекрасным вечером, этот одновременно талантливый и безнадежный студент обнаруживает, что теперь он может питаться... книгами, при этом обучаясь описанным в них заклинаниям.</p>',0.0,0,0),(142,'Да здравствует король!','hail-the-king','hail-the-king/high_cover.jpg','Маньхуа',2016,126,'<p>Он был самым обычным студентом, пока однажды случайно не оказался в другом мире в...теле короля?! Теперь с помощью своей новой &quot;способности&quot;, ему суждено вершить великие дела. Это история о короле, покорившем континенты и оставившем легенду, которая будет передаваться в веках!</p>',0.0,0,0),(143,'Раб \"Б\" ранга','b-rank-slave','b-rank-slave/95608974f0072eecfe44bfe35c0f2633.jpg','Манхва',2020,80,'Ниро родился в мире, гармония которого была нарушена Повелителем Теней \"Секнеоном\". В младенчестве полуэльфа приютила пара рабов, но через несколько лет они умерли, и мальчик остался сиротой. Теперь Ниро предстоит защитить свою маленькую семью.\r\nЧтобы снять клеймо раба, юноша должен окончить академию \"Эксканум\", подобно нынешнему императору, который в прошлом тоже был рабом.',0.0,0,0),(144,'Ублюдок покоряет магическую академию!','the-demon-kings-goes-to-the-academy','the-demon-kings-goes-to-the-academy/a5a16c7e0eebb469a66c617b775021d7.jpg','Манхва',2023,46,'<p>Ну вот надо же умудриться сдохнуть, отвечая хейтерам...<br />\r\n<br />\r\nЕщё и какая-то гнида появилась, представившаяся &quot;Мрачным жнецом&quot;... Сказал, что быть плохим писателем - грех. Дабы искупить вину и попасть на небеса, мне нужно пережить финал одного из моих романов.<br />\r\n<br />\r\nИ вот, я вошёл в роман &lsquo;Смерть принца демонов&rsquo;...<br />\r\n<br />\r\n&ldquo;Какого хрена, ублюдки! Почему я не мог просто сдохнуть?!&rdquo;<br />\r\n<br />\r\nПерсонаж, чьё место я занял, был Принцем Демонов, который подох от своей беспомощности в самом начале сюжета!<br />\r\n<br />\r\nЭто пи**ец, товарищи... Конкретный.</p>',0.0,0,0),(145,'Ещё раз в свет','once-again-into-the-light','once-again-into-the-light/b604278f1790b48d84a9f5565bbbb18f.jpg','Манхва',2021,80,'<p>Меня ложно обвинили в попытке убить мою младшую сестру, которой поклонялись как Святой. Не было ни одного человека, который поверил бы мне и не было ни одного человека, который заступился бы за меня. Даже моя кровная родственница. Мне было 14 лет. На дворе была зима. Я, Четвертая принцесса Эденбелла, была прискорбно обезглавлена на глазах у толпы. После моей смерти я проснулась, и то, что произошло&hellip; &ldquo;Моя малышка, моя драгоценная младшая сестренка&quot;&hellip; С восхитительной улыбкой он держал меня на своих руках. Этот теплый жест, тепло и прикосновение. Он пел мне колыбельную, нежно обнимая меня и покачивая.</p>',0.0,0,0),(169,'Я - монстр','became-an-evolving-space-monster','became-an-evolving-space-monster/bf1bb3e5bbf56893993e58260e26df8c.jpg','Манхва',2023,19,'<p>Посреди просторов космоса, в грузовом отсеке холодного металлического корабля, я был вынужден признать, что стал враждебным инопланетным существом в научно-фантастической игре на выживание.</p>',0.0,0,0),(146,'Кости','the-bone','the-bone/213b77c905be8ef5e45806095e9ee994.jpg','Манхва',2023,3,'<p>Джи Хён, преследуемый болью и внутренним гневом, вступил на путь охотника с мечтой стать непобедимым. Но жестокая судьба распорядилась иначе, лишив его самого драгоценного - материнской любви и здоровья. Погрязнув в отчаянии, но не покорившись судьбе, Джи Хён встал на кромке пропасти мести. Ставший тенью самого себя, он восстал из пепла и вновь затмил небеса своим непримиримым решимым. Это история о рождении нового героя, воплощающего всю ярость и решимость, чьи действия будут резонировать по всему миру.</p><p></p><p></p>',0.0,0,0),(147,'Легенда о Суре: Ядовитый Дракон','legend-of-sura-poison-dragon','legend-of-sura-poison-dragon/54a86d17177c7b069b83fc407d89ff10.jpg','Манхва',2021,134,'<p>Чин Джа Ган &ndash; единственный выживший из семьи древнего рода Як, людей которого нещадно истребляют. В столь юном возрасте ему пришлось столкнуться с несправедливостью, узнав, что есть ад отчаяния, питаемый видами рек крови и гор трупов. Дойдя до апогея терпения, в нём пробудился демон, который не успокоится, пока не воздаст должное каждому, пока не убьёт каждого&hellip;</p>',0.0,0,0),(148,'Я вышел из игры','i-come-from-game','i-come-from-game/7bf3f0fe9387358e40c6c49a526ffb50.jpg','Маньхуа',2021,86,'<p>Лин Цэ вернулся в прошлое на три года назад, сохранив все свои воспоминания и умения. Награда это или испытание? Раньше он не мог даже защитить себя, но теперь он может добиться всего и стать самым сильным Пробужденным.</p>',0.0,0,0),(149,'Реалити-квест','rlity-qust','rlity-qust/71b98e413b42de422152d8af93de6f77.jpg','Манхва',2021,115,'<p><strong>После угроз и запугиваний школьного хулигана, который требовал добыть предметы, Ха До Ван всю неделю проводит ночи напролет за играми, умирает и перерождается в школьном кабинете за неделю до этого... Все было точно таким же, как в тот день.</strong></p><p><strong>Изменилось только одно - это &quot;Оповещение о квесте&quot;, которое всплыло перед глазами! Что? От меня требуется победить этого хулигана, используя все мои игровые навыки?</strong></p>',0.0,0,0),(150,'Эволюция меча: Поднятие уровня в подземелье','the-blade-of-evolutionwalking-alone-in-the-dungeon','the-blade-of-evolutionwalking-alone-in-the-dungeon/a435dd969fb507e719dca0a9b39fbb58.jpg','Маньхуа',2020,76,'<p>Человек пробудил силу целителя внутри себя, но она оказалась&nbsp;полным мусором. Во время миссии в подземелье члены его команды были убиты. Это произошло из-за &quot;рассерженного священника&quot;, которого они освободили. В подземелье этот человек обрёл меч и стал учиться им пользоваться. Но что сделает одиночка в огромном подземелье?</p>',0.0,0,0),(151,'Прорыв с запретным мастером','a-breakthrough-brought-by-forbidden-master-and-disciple','a-breakthrough-brought-by-forbidden-master-and-disciple/655ef0e402eebaa29a647d5fa9e6b3f9.jpg','Манга',2020,20,'<p>Эрз - сын одного из восьми великих героев, победивших Короля Демонов. Общество ожидает, что и он будет великим воином, однако Эрз не может оправдать их ожиданий. Какие усилия он бы не прикладывал, он всегда оставался вторым и окружающим этого было мало. Все твердят ему, что он должен быть первым, раз уж он - сын героя, и постоянно сравнивают их.&nbsp;</p>\r\n\r\n<p>Но однажды он встречается с самим королём демонов, поверженым его отцом. Оказывается, их души связаны и Эрз начинает тренироваться вместе с ним, чтоб наконец показать остальным на что он способен. Близится выпускной - турнир, на котором сразятся лучшие ученики школы, и Эрз хочет победить в нём благодаря своему новому мастеру.</p>',0.0,0,0),(152,'Новичок с аккаунтом повелителя','royal-system','royal-system/66f60f2bc5af3538b9592c913f008745.jpg','Маньхуа',2020,343,'<p>Внезапный кризис привел Землю прямо к эпохе OL, и все человечество было низведено на пальму первенства неизвестных сил. Все люди стали первоклассными игроками. В жестокую эпоху слабых и сильных, ученик средней школы Е Хао оставался на третьем уровне и не мог расти. Когда он собирался умереть,он случайно открыл систему обновления учётной записи короля, сможет ли Е Хао стать самым сильным королем?</p>',0.0,0,0),(153,'Царство боевых искусств','martial-arts-reigns','martial-arts-reigns/75d7215cb46244f8f4c8aaf4fb71ba1d.jpg','Маньхуа',2018,631,'<p>Мин Е, восходящая звезда семьи Е, - гений среди своих сверстников-культиваторов. Но его двоюродный брат повредил ему меридианы, искалечил и безжалостно порезал сухожилия. Мин Е не сдается, потому что он пожертвовал бы всем, чтобы отомстить за своих умерших родителей, которые были убиты семьей Хуан. Он не знает, что его считают занозой в шее для семьи Е и хотят его убрать&hellip;...</p>',0.0,0,0),(155,'Младший сын конгломерата','youngest-son-of-a-conglomerate','youngest-son-of-a-conglomerate/80e31187bddf2ac5d315b83f9bba5343.jpg','Манхва',2022,75,'Вернуть 13 лет тяжелой работы через предательство! Юн Хён У, глава Sunyang Group, который жил как слуга и был брошен. В тот момент, когда он думал, что все кончено, он просыпается как Джин До Джун, внук председателя группы \"Суньян\" Чжина! Однако Джин До Джун, младший сын семьи Чеболь, далек от права наследования. Сможет ли он стать окончательным победителем в семейной политической драме? Захватывающая драма мести Юн Хён У, призванная поглотить группу Sunyang, начинается!',0.0,0,0),(156,'50 рецептов чая от герцогини','the-duchess-50-tea-recipes','the-duchess-50-tea-recipes/2167b724db222668652a4139b758fd63.jpg','Манхва',2019,143,'<p>Когда я открыла глаза, то уже стала герцогиней. Однако что-то было не так. Дошло до того, что я стала главной героиней, но оказалось, что герцогиней я была только по статусу. На самом же деле вся прислуга издевается надо мной, а муж и вовсе игнорирует. Какая жалкая жизнь! Боже, я не знаю, что же мне делать дальше. Буду просто наслаждаться своим чаем, так я думала. &ldquo;Ты приготовишь для меня тот чай в следующий раз?&rdquo; Что не так с моим мужем и его холодным отношением ко мне?!</p>',0.0,0,0),(157,'Академия Ранкеров','i-became-a-student-at-the-transcendntal-academy','i-became-a-student-at-the-transcendntal-academy/7c635dd8ad09684941a26eb78722e93b.jpg','Манхва',2022,86,'<p>Со Джун долго копил деньги, чтобы расплатиться с долгами погибших родителей и поступить в академию охотников. Но из-за несчастного случая, все деньги пришлось потратить на лечение.<br />\r\nИ вот, когда он был на грани отчаяния, появилась странная реклама:<br />\r\n&quot;Ты тоже можешь стать пробужденным!&quot;<br />\r\nТерять уже было нечего, и он решил попробовать.<br />\r\n&quot;Господин Ким Со Джун. Приветствуем в Академии Трансцендентов!&quot;<br />\r\nАкадемия охотников, находящаяся в другом измерении! В наше время охотником может стать каждый, но вам выпал шанс стать трансцендентом!</p>',0.0,0,0),(158,'Вор-читер в мире судного дня','the-last-days-of-thieves','the-last-days-of-thieves/56406df27210cafde6d0c4a7dacf9a46.jpg','Маньхуа',2021,163,'<p>Космическая буря привела к множеству различных мутаций. В городе появились ядовитые зомби-тролли, безумно ревущие и размахивающие огромными топорами. В лесах появились редкие животные, борющиеся за территорию. У людей также появились необыкновенные способности, которые назвали &laquo;Звездной силой&raquo;&hellip; Не имеющий такой &laquo;Звездной силы&raquo; Чжоу Чжен, попал в этот мир судного дня. Используя способности игрового персонажа вора, он пытается разрушить темный туман и стремится к высшей силе!</p>',0.0,0,0),(159,'Возрождение иного императора','another-emperor-reborn','another-emperor-reborn/cd58140e363fb92b36a6dac3c19832c4.jpg','Маньхуа',2020,310,'<p>Однажды, весь мир захлестнула невообразимая энергия. Так, по всему земному шару начали появляться люди с невиданными доселе способностями. Но одновременно с тем, толчок в развитии получили и высшие существа. Некоторые таинственные могущественные расы начали постепенно отходить&hellip; от беспробудного векового сна. С течением времени, вся власть над миром перешла в руки одной королевской семьи. Но вот, в один прекрасный день, в тело незаурядного человеческого паренька вселяется душа императорского принца.</p>',0.0,0,0),(160,'Реинкарнация Ранкера-Некроманта в муриме','moorimse-is-a-former-ran','moorimse-is-a-former-ran/a5a3c1d288fd757b927bcb59767cc15d.jpg','Манхва',2021,109,'<p>Кан Тэ Ха, охотник SSS-ранга, в одиночку бросает вызов сильнейшей Гильдии &quot;Грифон&quot;, но погибает после ожесточенного сражения! Однако&hellip;<br />\r\n<br />\r\n&mdash;&hellip;Я стал свиньей?<br />\r\n<br />\r\nЭто мир Мурима? Теперь я &ndash; Ю Шин Ун, старший наследник клана Пэк Ун. Ситуация не из простых и отдыхать некогда, ведь за спиной уже строят козни!<br />\r\n<br />\r\n&mdash;Неужели вы всё ещё не понимаете, кто я?<br />\r\n<br />\r\nНекромантия из прошлой жизни. Боевые искусства из нынешней. Ему подвластно всё! Кажется, этот мир ждут новые потрясения!</p>',0.0,0,0),(170,'Система вампира','biting-is-wrong','biting-is-wrong/0e91ad0b2268eaf2a386e675cedf66a6.jpg','Маньхуа',2020,118,'<p>Что? Быть плохим, чтобы стать сильнее? Что является злом в этой системе?</p>',0.0,0,0),(171,'Вторая жизнь бандита','second-good-life','second-good-life/c4292cbfc0e9451580cd31d565557619.jpg','Манхва',2018,137,'<p>41 год. Чон-Сок О, который до сих пор работал в организации, совершая всевозможные плохие поступки, занял высшее положение в организации.</p>\r\n\r\n<p>Но конец той жизни был бы таким плачевным ...</p>\r\n\r\n<p>Как оказалось смерть не стала его последней остановкой, ангел даровал ему второй шанс и переродил опытного бандита&nbsp;в молодое тело...</p>\r\n\r\n<p>как же он решит прожить свою жизнь?</p>',0.0,0,0),(161,'Регрессия актёра','i-will-live-as-an-actor','i-will-live-as-an-actor/ea7c5a0f4a9e4bdf74e847e328863ad6.jpg','Манхва',2022,64,'Чан Ён Гук - парень, добившийся большого успеха в качестве актёра. Ради этого он прошёл долгий и тернистый путь, давший свои плоды. В день получения своей первой почётной премии, за лучшую мужскую роль второго плана, он узнаёт, что совсем недавно его мать скончалась от продолжительной болезни. Он был опустошён из-за её смерти, так как совсем пренебрёг ею, поставив карьеру и деньги на первый план. Не захотев мириться с такой реальностью, он решается на самоубийство. В моменты, когда вся жизнь пролетает перед его глазами, он вспоминает тёплые воспоминания связанные со своей матерью, жалея о потерянном времени. Именно тогда, неожиданно... он возвращается в своё прошлое! «Я вернулся к той жизни, о которой сожалел, жалкой жизни «эгоиста...». И снова начинается история человека, который хочет быть актёром. Сможет ли он прожить счастливую жизнь, не похожую на прошлую?',0.0,0,0),(162,'Босс школы','boss-in-school','boss-in-school/ba56ec531c239f1b2e07c3d4704d4827.jpg','Манхва',2017,199,'<p>Сет Квон, прирождённый боец, прекращает драться из-за данного матери обещания&hellip; Но всё меняется, когда его отец оставляет ему сообщение: &laquo;Хватит позволять другим бить себя. Это выглядит жалко&raquo;. Теперь, когда он перевёлся в новую школу, никто не сможет победить его.</p>',0.0,0,0),(163,'Изумрудная корона жизни','recorded-crown','recorded-crown/79ae861c4de724c507f4a0d1b0010488.jpg','Манхва',2020,83,'<p>После автомобильной аварии главная героиня перемещается в собственный роман, написанный ею в 15 лет, и занимает тело девушки, что должна была умереть по трагичной случайности. Ран Ромелия Де Лация - второстепенный персонаж романа и любимая дочь тираничной мачехи главного героя.&nbsp;<br />\r\nЗа 3 года до начала оригинальной истории вся семья погибает. Новый наследник в лице Юстафа возвращается из академии, и Ран во что бы то ни стало необходимо переманить его на свою сторону, пока барон, занявший роль его опекуна, не начал строить свои козни.&nbsp;</p>',0.0,0,0),(164,'Я Король-Волшебник','i-am-the-sorcerer-king','i-am-the-sorcerer-king/8f37b2b8d67ad5cbd5884f2565363d0c.jpg','Манхва',2019,60,'<p>10 лет назад орда монстров из разлома в пространстве и времени начала атаковать человечество. В то же время люди начали пробуждать силу и охотиться на монстров за славой и деньгами. Санхун, нуждающийся в деньгах из-за болезни своей матери, берёт опасную работу, помогая охотиться на этих монстров четыре раза в месяц в качестве приманки. Но однажды, оказавшись тяжело раненным, он вспомнит свою прошлую жизнь. &laquo;Я что, только что умер? Погоди-ка, я был королём-волшебником Кратра в прошлой жизни?!&raquo;</p>',0.0,0,0),(165,'Любовный совет от Великого Герцога Ада','love-advice-from-the-great-duke-of-hell','love-advice-from-the-great-duke-of-hell/4db4fc7402f257c5c49682a42212b55b.jpg','Западный комикс',2018,137,'<p>История о любви, дружбе и призыве демона.</p>',0.0,0,0),(166,'Лучший в мире мастер боевых искусств','worlds-strongest-hero','worlds-strongest-hero/2f8e2b728e5b5ae8bd1011027073b864.jpg','Маньхуа',2020,226,'<p>Перерождение - это только начало чего-то великого.</p>',0.0,0,0),(167,'Возвращение игрока','return-of-the-player','return-of-the-player/487e27aa87a7a8e5ff295bc14751b4f6.jpg','Манхва',2020,140,'<p>В один день мир превратился в игру. Неожиданно появившиеся монстры стали убивать людей, а те в свою очередь были вынуждены начать выполнять различные квесты. Во всём этом хаосе апокалипсиса выделился игрок по имени Ким Сехан. Удастся ли ему найти и уничтожить систему, сделавшую мир таким?</p>',0.0,0,0),(168,'Легенда о Регрессии','regression-legend','regression-legend/d6db99abead3382c635ccea1dbafd15a.jpg','Манхва',2021,95,'<p>Из-за 2-го мирового экономического кризиса, компания по ценным бумагам, в которой работал Чан Тхэ-сан, обанкротилась. Пристрастившись к азартным играм Чан Тхэ-сан превратился в бродягу и нищего.&nbsp;<br />\r\nВ один день он погибает, спасая ученика начальной школы, которого чуть не сбила машина, и благодаря доброму делу, которое он совершил, Чан Тхэ-сан возвращается в прошлое на 14 лет назад и начинает новую жизнь.&nbsp;<br />\r\nВместе с радостью о возращении к жизни, к нему вернулась, и забота о вступительном экзамене по математике в институт, от которого просто взрыв мозга. Мало того, что нужно заново сдать экзамен по математике, к этому еще надо и заново сдать, тот самый экзамен по юриспруденции&hellip;&nbsp;<br />\r\nНо ко всему этому в его голове, четко запечатлелся график фондового рынка, который он видел в то время, когда был биржевым маклером ...&nbsp;<br />\r\n&nbsp;<br />\r\nПрошлая жизнь была разрушена, а жизнь после возвращения гарантирует только успех!</p>',0.0,0,0),(172,'Система жизни','the-live-system','the-live-system/69d4a742a40fab1af467d24f5f3efa00.jpg','Манхва',2020,167,'<p>Юн Чжэ потерял свою жену и дочь в результате несчастного случая. Лишившись смысла жизни, он прожигает свою жизнь напрасно. Ему достался лишь дневник его супруги, который она оставила ему на будущее. Может... Он сможет встретиться со своей семьёй ещё раз? &quot;Святой грааль&quot; - главная награда игрока, который смог пройти &quot;игру&quot; и занять первое место. Если Юн Чжэ сможет заполучить его, то его семья снова будет с ним. Однако в жестоком мире, где правит лишь сила, ему придётся преодолеть не мало препятствий, чтобы достичь желаемого. Сможет ли Юн Чжэ стать сильнейшим игроком?Нет!</p>',0.0,0,0),(173,'Легендарный лунный скульптор','legendary_moonlight_sculptor','legendary_moonlight_sculptor/b5b6315af5cd6fd5cf9324a5d2e35bfd.jpg','Манхва',2015,170,'<p>Главный герой Хэн пережил очень трудное детство в нищете, это сделало его очень сильной, безумной и навязчивой личностью. Он всеми силами пытается избежать повтора событий и обезопасить свою сестру и бабушку от бед внешнего мира, поэтому он погружается во всемирно известную игру жанра VRMMO - &quot;Королевская дорога&quot;. На протяжении всего пути ему будут встречаться очень уникальные люди, с которыми у него будут весьма неординарные отношения.</p>',0.0,0,0),(174,'Я убил Бессмертного','i-killed-the-immortal','i-killed-the-immortal/04a808c2a7b0887753116556c9201e4b.jpg','Рукомикс',2021,16,'<p>Меня зовут Артур Готфрид и я просто хотел жениться на дочери мэра.<br />\r\nТеперь мои ноги лежат в двух метрах от меня.</p>\r\n\r\n<p>Но даже отойти на тот свет мне не дали. Бессмертный вырвал меня из лап смерти и сделал своим учеником.<br />\r\n&mdash; Убей меня. &ndash; сказал он мне, - И тогда ты вернешься домой.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Зачем ему это?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Он так и не сказал.</p>',0.0,0,0),(175,'Меч девяти небес','gucheongu-sword','gucheongu-sword/4469a1bbeea3e2e1c16fe9071437189e.jpg','Манхва',2022,74,'«Он — правитель девяти небес». Йон Джоха с детства подвергался всевозможным издевательствам со стороны мачехи и сводных братьев и сёстр. После смерти отца его заперли в складе, но десять лет спустя он сумел сбежать, изучив боевые искусства, выходящие за грань понимания человека. Захватывающие приключения главного героя начинаются прямо сейчас!',0.0,0,0),(176,'Герой, жаждущий мести, уничтожит врагов Силой Тьмы','the-hero-who-seeks-revenge-shall-exterminate-with-darkness','the-hero-who-seeks-revenge-shall-exterminate-with-darkness/69ad4ec3cb77beaa919a61e2060c1124.jpg','Манга',2019,100,'<p><strong>Рауль</strong>, который победил <strong>короля демонов</strong> как сильнейший герой, должен был стать спасителем мира.Этого не произошло. Вместо этого, Рауля казнили по ложному обвинению, которое выдвинула против него Принцесса. Вся родня героя погибла, так что&nbsp; некому было спасать его жизнь. Незадолго до того, как он погиб, сердце Рауля погрузилось во тьму&hellip;&laquo;Я разорву этих предателей на куски. Сожгу их на костре. Расчленю их. Буду пронзать их. Я убью всех этих ублюдков беспощадно и заставлю их вкусить адские страдания!!!&raquo;&nbsp;Получив силу тьмы, Рауль возродился. Усмехаясь, он поклялся отомстить.&laquo;О, я с нетерпением жду этого &ndash; с этого момента я буду купаться в их крови, как мне заблагорассудится.&raquo;Через несколько дней после реинкарнации Рауля в столице страны, где цветут самые красивые цветы в мире, проходит свадьба, на которой замуж выйдет та самая Принцесса&hellip;</p>',0.0,0,0),(177,'Мастер Гу','master-of-gu','master-of-gu/high_cover.jpg','Маньхуа',2018,97,'<p>Это история о злодее Фан Юане, который попал в прошлое на 500 лет назад, переродившись при помощи&nbsp;цикады&nbsp;ЧуньЦю, которую долгое время выращивал. С его глубокой мудростью, боевым и жизненным опытом он стремится победить своих врагов умом и превосходными навыками! Он безжалостен и аморален, у него нет причин сдерживаться, преследуя свои конечные цели. В мире жестокости, где человек совершенствуется, используя Гу &mdash; волшебные существа этого мира, Фан Юань должен подняться выше всех при помощи своей собственной силы.</p>\r\n\r\n<p>Гу &mdash; легендарное ядовитое насекомое, часто используемое в практиках чёрной магии. Оно принимает форму некоторых насекомых, обычно змей, сверчков, червей и т. д.</p>',0.0,0,0),(178,'Жрец порчи','priest-of-decay','priest-of-decay/d2e24779341966913e21ffee7cb4bc2f.jpg','Манхва',2023,33,'<p>Я использовал читы, чтобы получить особый класс в игре. Но стоило нажать кнопку запуска, как я сам стал &laquo;жрецом порчи&raquo; и оказался в игре!</p>\r\n\r\n<p>Это персонаж с отвратительными характеристиками, которого все ненавидят! А из предметов у меня только роба и засохшая женская ладонь, которая оказалась рукой богини!</p>',0.0,0,0),(179,'Создатель злодейки','evil-her-maker','evil-her-maker/18e51aa03dbd378e0079219d4f4cebc4.jpg','Манхва',2021,72,'<p>Я очутилась в теле злодейки романа. К тому же это был фэнтезийный роман, который я сама написала лет 10 назад. Злодейка Айла - женщина, которая проклинала главную героиню, и которой было судьбой уготована смерть от рук главного героя. Но что если я не стану злодейкой, что тогда?<br />\r\n- В этот раз я буду бездельничать как безработная богачка всю свою жизнь!<br />\r\nОднако, стоило мне начать болтаться без дела, как внезапно один и тот же день начал повторяться снова и снова. Возможно ли, что причиной этому стало то, что я решила не вести себя, как злодейка?! Я не хочу умирать!<br />\r\n- Пожалуйста, остановите временную петлю...<br />\r\n- Это легко сделать. Тебе лишь нужно стать настоящей злодейкой.<br />\r\n- Настоящей злодейкой?<br />\r\n- Богатство, власть, почёт, мужчины... Ты можешь присвоить себе всё что угодно.<br />\r\nОднажды ко мне пришёл колдун, от которого так и веяло опасностью.<br />\r\n- Если желаешь, я заберу у неё корону и с радостью возложу на твою голову. И после проложу для тебя дорогу к трону...<br />\r\nЭтот мужчина, словно Дьявол, нашёптывал мне сладкие слова на ушко своим нежнейшим голосом.<br />\r\n- Итак, твой ответ?<br />\r\nИ правда, смогу ли я остановить временную петлю и переродиться истинной злодейкой?</p>',0.0,0,0),(180,'У меня каждую неделю новая профессия','i-randomly-have--new-career-every-week','i-randomly-have--new-career-every-week/449284617828b40b40f8664a15e48d18.jpg','Маньхуа',2021,550,'После увольнения из компании Линь И по ошибке получил систему «Мастер во всем». Лин И полагался на различные профессии и щедрые вознаграждения, предоставляемые системой, для достижения своих амбиций и постепенного обогащения, чтобы стать всемогущим.',0.0,0,0),(181,'Победитель по жизни','the-loser','the-loser/77e1b4ff244a95df88b3a37530bbede5.jpg','Маньхуа',2020,240,'<p>Мэн Фань был хорошим парнем, но по трагической случайности погиб совсем молодым, так и не успев ничего сделать. Для того чтобы восстановить справедливость, Вселенная отправляет его назад за три месяца до гибели и создаёт для него систему, при которой у него не получится впустую тратить жизнь. В первом задании ему нужно будет получить 100 отказов от девушек...</p>',0.0,0,0),(182,'Лукизм','lookism','lookism/e54532628ae3e192c424c4ee2ef05921.jpg','Манхва',2016,467,'<p>Пак Хён Сок &ndash; непривлекательный старшеклассник, страдающий от избыточного веса, из-за чего регулярно подвергается травле и насмешкам со стороны окружающих. Но происходит чудо&hellip;</p>',0.0,0,0),(183,'Сильнейший ранкер-тролль','best-troller-in-game','best-troller-in-game/8e597b067038239e69f351360e58984c.jpg','Манхва',2022,60,'<p>Самая невероятная игра. Реальность, где возможно всё.</p>\r\n\r\n<p>[Добро пожаловать в фантастический мир Аркадии.]</p>\r\n\r\n<p>Удивительное приключение профессионального тролля начинается!</p>',0.0,0,0),(184,'Я был финальным боссом башни','was-the-boss','was-the-boss/f0da5ef26050f599f59bc1144612cdf2.jpg','Манхва',2022,57,'<p>Бафомет, босс Башни Бездны, живёт в вечном ожидании сильного противника. Однообразные бои наскучили ему и, благодаря добытым в бою трофеям из мира людей, стал им интересоваться. Однажды появляется достойный противник, и это только укрепляет восхищение Бафомета человечеством. Он приходит к мысли, что и сам хотел бы стать человеком&hellip;</p>',0.0,0,0),(185,'Перезапуск подземелья','dungeon-reset','dungeon-reset/a95bdf4976aaa176423be4479cb1a544.jpg','Манхва',2020,185,'<p>[Идет перезагрузка Подземелья.] Подземелье или ловушки, в которых была игра, проходят стадию перезагрузки для следующих пользователей.Может, эта &laquo;перезагрузка&raquo; применима и ко мне?! Единственное существо, которое свободно от постоянно перезапускаемой Пещеры. Вооружившись грандиозной силой, Чон Да Ун начинает освоение Подземелья!</p>',0.0,0,0),(186,'Жизнь Неудачника','loser-life','loser-life/ccf50de93eb984f07c0fa0515a183033.jpg','Манхва',2019,56,'<p>21-летний Джан Анчул быстро шел к успеху, когда его проклял одноклассник, над которым он издевался 3 года назад в старшей школе. Теперь, помещенному&nbsp;в тело неудачника, над которым он издевался 3 года назад, ему надо&nbsp;реабилитировать себя в прошлом, чтобы снять проклятие. Как же он пройдёт этот путь, находясь под вечными издевательствами?</p>',0.0,0,0),(187,'Да, я паук, и что с того?','im_a_spider_so_what','im_a_spider_so_what/c121e0348fb9a6eeb8923f3e11247baa.jpg','Манга',2015,142,'<p>История берёт своё начало в мире, где Герой и Повелитель демонов &mdash; два заклятых врага и ведут бесконечную войну друг с другом не на жизнь, а на смерть. Под влиянием могущественной магии граница между нашим и их мирами стирается, и взрыв, сопровождающий появление сражающейся парочки, уничтожает учебный класс вместе со всеми учениками, включая и нашу героиню. Девушка, которая в прошлом имела плохую репутацию в школе и была мишенью для издевательств, переродилась в виде... паука-монстра! Впрочем, долго горевать она не стала и, свыкшись с новым обликом, решила бороться за своё существование в новом мире.</p>',0.0,0,0),(189,'Реинкарнация в безумного наследника','reincarnated-as-a-naughty-small-schoolmaster-exclusive','reincarnated-as-a-naughty-small-schoolmaster-exclusive/2e1d7c96041752084d225737ba255d5e.jpg','Манхва',2021,108,'<p>Ян Чагак, убитый ядом во время политических войн в Муриме, после смерти&nbsp;очнулся в неизвестном месте и вскоре выяснил, что находится в демоническом культе, а изучаемые&nbsp;им техники - высшее искусство владыки демонов, к тому же тело принадлежит безумному наследнику, жаждущему женщин.<br />\r\nP.S. Произведение от студии, что создала:&nbsp;&quot;Solo Leveling&quot; и &quot;Omniscient Reader&quot;</p>',0.0,0,0),(190,'Второй брак императрицы','remarried-empress','remarried-empress/fd13618bfa84c8dd89a76eadaa2a2e27.jpg','Манхва',2019,160,'<p>Я приняла решение. Если я не смогу быть императрицей здесь, то стану в другом месте.</p>',0.0,0,0),(191,'Вторая жизнь хирурга','congressman-live-again','congressman-live-again/3666066dad8c67a27659d6b5d0b4a069.jpg','Манхва',2021,138,'<p>Поехал на медицинское волонтёрство, а попал на гражданскую войну. Хотел спасти пациента &ndash; получил пулю и умер. А после&hellip; стал ребенком?!<br />\r\nРазграбленные повозки, люди в необычных одеждах &ndash; всё это напоминает мир Мурим. Оказав первую помощь пострадавшим, после встретив спасательный отряд из &laquo;Лечебницы трёх поколений поднебесной&raquo; и самого Пэк Рин Ый Сона, я осознал, что нахожусь в мире романа про боевые искусства &laquo;Величайший небесный демон&raquo;.<br />\r\nОдин из тогда спасённых мною &ndash; главный герой книги, будущий небесный демон &ndash; Ё Ха Рюн. &laquo;Эй, за то, что спас, можешь звать меня старшим братом&raquo; &ndash; вот так мы с ним сдружились. А Пэк Рин Ый Сон, рассмотревший во мне талант, стал мне учителем.<br />\r\nМеня зовут Чин Чхон Хи, я - последняя надежда Канхо, и это моя история!</p>',0.0,0,0),(192,'На подработке у богов','albanian-of-the-gods','albanian-of-the-gods/050c9e91a0e3c5a458de130a15a2ea2e.jpg','Манхва',2023,42,'<p>У главного героя Ю Дамдока нет Таланта &ndash; особого свойства, без которого в современном мире не найти работу. Потерпев крах на очередном собеседовании, он на чём свет стоит клянет Бога. Ответ не заставил себя долго ждать &ndash; Дамдока мигом сражает молния. Первое, что он увидел, когда очнулся &ndash; странное окно с вакансиями от богов. Терять нечего, &ndash; думает Дамдок и откликается на первое попавшееся предложение. Теперь он человек в мире богов. Вот только &laquo;начальство&raquo; думает, что он бог низшего уровня&hellip;</p>',0.0,0,0),(193,'Мой папа слишком сильный','my-dad-is-too-strong','my-dad-is-too-strong/408c298182436aec21cd983f9f70f7b7.jpg','Манхва',2020,150,'<p>Самый обычный госслужащий без каких-либо талантов возвращается после смерти.<br />\r\nПосле того, как перенёс неисчислимые страдания и мучения в лесу, он решает прожить оставшуюся жизнь как обычный человек.<br />\r\n&laquo;Пожалуйста, стань моим папой. Это только до выпускного&raquo;<br />\r\nНо в его судьбу вмешивается дочь?</p>',0.0,0,0),(194,'100-я Регрессия Игрока Максимального Уровня','the-100th-regression-of-a-maxlevel-player','the-100th-regression-of-a-maxlevel-player/44a7a84b74c374fb97673f9404f7eeb9.jpg','Манхва',2023,31,'<p>Земле конец. Люди в возрасте от 15 до 29 лет по всему миру должны принять участие в смертельной игре из двадцати раундов. Главный герой начинает свое 100-е испытание благодаря способности к регрессии.</p><p>Пройдя игру 99 раз и дойдя до финала, он наконец получил шанс стать сильнейшим. Условием последнего раунда является наличие группы не менее чем из пяти человек. Поэтому Рю Мин начинает принимать в свою команду других участников, чтобы не повторить своих прошлых ошибок.</p>',0.0,0,0),(195,'Безупречный отец','peerless-dad','peerless-dad/high_cover.jpg','Манхва',2017,275,'<p>История бесподобного отца, которому известна воля небес. Автор Но Гён Чхан широко известен по манхве Красная Буря, но если вам нужна другая причина для чтения, то это удивительная история приключений мастера боевых искусств, включающая свадьбу, заботы отца и битвы. Она во многом похожа на Красную Бурю: крутой мастер, главный герой, беспокоящийся о своей семье, трагическая предыстория.&nbsp;Обязательно к прочтению для каждого, кому понравилась Красная Буря.</p>',0.0,0,0),(210,'Суперзвезда с рождения','superstar-from-age-0','superstar-from-age-0/ab4c48e6bb9cd5e4b7190eaeb0a3db03.jpg','Манхва',2023,22,'<p>После бесчисленного количества реинкарнаций в эльфов, фей, слизней, подарочных коробок, дьяволов и многого другого, Я, Ли Со Чун, переродился человеческим ребёнком!</p>\r\n\r\n<p>В библиотеке, где хранятся все мои воспоминания, я нахожу заветную мечту из самой первой жизни.</p>\r\n\r\n<p>Бог наградил меня красивым лицом и актёрским талантом, поэтому я буду усердно трудиться, чтобы исполнить мечту и стать суперзвездой!</p>',0.0,0,0),(196,'Я так и не смогла усмирить эту злую натуру','i-have-never-been-able-to-pacify-this-evil-nature','i-have-never-been-able-to-pacify-this-evil-nature/2afbd47f96a1bf54656c4fd3a57d2964.jpg','Манхва',2022,88,'<p>Серебристые волосы и алые глаза... на девятый день рождения отец подарил Валлетте юного раба, в котором девочка почти сразу же признала будущего хранителя магической башни и главного антагониста истории.</p>\r\n\r\n<p>Пробудив свой магический дар, Рейнхарт прольет темный гнев на каждого, кто когда-либо посмел его задеть или унизить, а бывшие хозяева станут первыми жертвами на пути его мести. Темная, мрачная и злая натура, от которой невозможно избавиться или убежать и которую она вновь не сможет усмирить&hellip;</p>',0.0,0,0),(197,'Преимущества реинкарнации','privileges-for-possesors','privileges-for-possesors/5a7fc8bdfdbfdd2384b6b7cf747a4406.jpg','Манхва',2022,70,'<p>Готовьтесь к загробной жизни! Я получила странное спам-смс незадолго до своей смерти. Я думала, что умерла, но очнулась в бюро оценки воскресших. Загробная жизнь действительно существует? Меня собираются переселить в книгу? &laquo;Какой твой любимый жанр?&raquo; В прошлой жизни я была фанатом всех жанров. У меня была нелегкая жизнь, поэтому в новой жизни я хотела быть милой маленькой девочкой и иметь всю любовь мира. Сюжет, который мне достался &mdash; это бесконечная реинкарнация, полная сладких бататов, уровень сложности выживания S: &laquo;Воскрешение во спасение мира&raquo;. Персонаж, в которого меня переселят &mdash; дочь простолюдина-слуги, которым командует негодяй-аристократ, злоупотребляя властью! Но я получила особые привилегии благодаря полному пакету страхования жизни воскресшего, который я подписала незадолго до смерти. Это история сладкого выживания, с добродетелями, страховыми выплатами и привилегиями от Бога!</p>',0.0,0,0),(198,'Блондинка-призывательница','blonde-elemental','blonde-elemental/e4fbabb5913baa1a640cc7290c6131aa.jpg','Манхва',2019,108,'<p>Я думала, что умерла, но когда я открыла глаза, я возродилась как благородная дочь?! В свoи 17 лет я умерла, нo вoт я снова жива! Я не хoчу умереть снoва! Вoт мoя 2-я жизнь! Сильная и независимая Джин начинает исследовать дикий континент Кроуэлл!</p>',0.0,0,0),(199,'Восхождение безымянного бога','temporarily-closed-for-personal-reasons','temporarily-closed-for-personal-reasons/e1bb41ba29e5e441b59df1bd1e96aa51.jpg','Манхва',2022,80,'<p>Я - третьесортный писатель новелл по имени Ю Ильшин. По звучанию, мое имя на корейском похоже на &quot;Единственный бог&quot;, только не надо меня подкалывать, я и без вас понимаю, что неудачник...На самом деле я не бог, это просто имя. И хоть только охотников уважают в этом мире, это не означает что все они равны. Когда ваш класс будет определён, жизнь изменится навсегда.Однажды, мои способности, о которых я так долго мечтал, пробудились. Но эти способности немного странные... В этом потустороннем мире, с которым я соединен через&nbsp; мобильный телефон, слабые и никчёмные муравьи почитают меня как бога?.. И вот, оказывается, что такой бесполезный неудачник как я, должен спасать мир... Да хрен там плавал, здесь явно что-то не так!</p>',0.0,0,0),(200,'Её прислужник','her-summon','her-summon/55ca48008c826681411b8279c672894a.jpg','Манхва',2018,62,'<p>Чжинкён, поклонник женской поп-группы, произнёс ошибочное слово в интервью на прямой трансляции на ТВ. Спустя 3 года из-за чувства угнетения он совершенно отдалился от этого мира и общества реальных людей, став настоящим любителем 2D! И однажды, пока он продолжал жить такой жизнью, его неожиданно призвали в невиданный им мир. И там он столкнулся с призывательницей&hellip; В этом мире психическая травма Чжинкёна не давала о себе знать, а сам он стал прислужником невероятной мощи!&nbsp; &nbsp;&nbsp;Бывший фанат женской группы, который теперь помешан на 2D, прислужник Чжинкён и начинающая призывательница Хейз &mdash; их приключения начинаются прямо сейчас!</p>',0.0,0,0),(201,'Дьявол возвращается в школьные годы','school-of-evil','school-of-evil/3a387fc8db0179d41825e6aa12c46e07.jpg','Манхва',2023,39,'<p>Хорошие оценки, привлекательная внешность, боевые навыки выше среднего и немного праведности. Накануне выпускного вечера Ким Хён Сон, которого столкнули с крыши, впадает в вегетативное состояние. Не в силах умереть, сохранив лишь слух и сознание, он проводит следующие десять лет в аду, пока внезапно не возвращается в тот день, когда начались издевательства.</p>',0.0,0,0),(202,'Я вошла в семью злодея по контракту','i-bcm--contrct-fmily-with-th-villin','i-bcm--contrct-fmily-with-th-villin/e54ca5b130ce6404f696798168fdbf4f.jpg','Манхва',2021,99,'<p>Ария предложила заключить брачный контракт. И из всех она выбрала продавшего душу дьяволу молодого принца Валентина, чтобы защитить себя и его. &mdash; Женись на мне. Ария, дрожа всем телом, давала брачный обет с листом в руках. &mdash; Развод состоится через 10 лет по истечению брачного контракта... Затем молодой принц забрал документ из ее рук и разорвал. &mdash; Так где мне поставить печать? &mdash; Я же сказала, что разведусь с тобой. Внезапно он, охваченный дьяволом, наклонился к ней и произнес: &mdash; Ты уже немаленькая, нам нужно заключить взрослый контракт.</p>',0.0,0,0),(203,'Злодейка сегодня счастлива','the-wench-is-happy-today','the-wench-is-happy-today/266f518ce678cc8f6fafc273b3edf38d.jpg','Манхва',2021,77,'<p>Подруга увела моего парня, а затем осмелилась с улыбкой вручить приглашение на свадьбу?<br />\r\nХа! Восторгаясь своей местью, я вернулась домой и заснула...<br />\r\nНо, проснувшись, обнаружила себя в теле злодейки фэнтези-романа, у которой было всё: красота, ресурсы и интеллект.<br />\r\nЕдинственное, чего девушке не хватало, проницательности в оценке мужчин.<br />\r\nОставим ублюдочного принца главной героине, а сами насладимся роскошью власти и денег!<br />\r\n&nbsp;</p>',0.0,0,0),(204,'Поднятие уровня с нуля','the-people-on-earth-are-too-ferociou','the-people-on-earth-are-too-ferociou/b6829e86346f6f3cb197efe47e193841.jpg','Маньхуа',2021,228,'<p>50 лет назад в городе Лунчэн прошла ожесточенная битва, между земной цивилизацией и ужасающими иноземными монстрами.<br />\r\nМэн Чао, что попал под эту битву умирает, воскресает молодым. Он осознает, что ему нужно стать сильнее, чтобы переписать свою историю. Итак, наш возродившийся главный герой начал уничтожать монстров, растаптывать демонов, разрывать голыми руками древних богов и подчинять миры. В этой жизни он поклялся, что всеми силами станет сильнейшим!</p>',0.0,0,0),(205,'Поднятие уровня начиная с максимально возможного','leveling-up-at-maximum-level','leveling-up-at-maximum-level/37bea0615eda1c537091ed953e7d5728.jpg','Манхва',2021,53,'<p><strong>Вы достигли максимального уровня.</strong></p>\r\n\r\n<p><br />\r\n<strong>Ча Шин Хён бесспорно лучший в мире. Почему после конца пустоты и возвращения, Земля настолько изменилась?</strong></p>\r\n\r\n<p><br />\r\n<strong>Мир, в котором монстры выходят из подземелий, и охотники повышающие уровень за счет окна статуса.</strong></p>\r\n\r\n<p><br />\r\n<strong>&laquo;Начать с 1 уровня? Что же мне делать, если я уже достиг максимального уровня?&raquo;</strong></p>',0.0,0,0),(206,'Возвращение Героя','hero-returns','hero-returns/a20d839497ad4b9af3fc6ad8f4dd0dd7.jpg','Манхва',2022,70,'<p>Сильнейший герой человечества Ким Сон Бин. Он бросил все на кон и сражался, но&hellip;&nbsp;не cмог предотвратить разрушение мира. Однако его легенда только начинается, когда Сон Бин возвращается на 20 лет в прошлое.</p>',0.0,0,0),(207,'Регрессия Сильнейшего Мастера','star-armor-soul-will-pass','star-armor-soul-will-pass/e284a397df9eb86e8e0e3681851cf714.jpg','Маньхуа',2021,168,'<p>Последний из Мастеров Звездной Души, Сун Юньсян. В юности из-за дефекта души на него смотрели с пренебрежением, из-за того, что он был слишком слаб. На его глазах погибли его родственники и друзья. Повернув время вспять благодаря системе Звездной души, у него за спиной был шестидесятилетний опыт сражений и знаний стратегии. Снова вернувшись в Школу, с его знаниями он мог создать лучшего Генерала звездной души&hellip; всё, о чем он когда-то жалел, люди, которые когда-то предали его... В этот раз он не оставит места для сожалений.</p>',0.0,0,0),(208,'Рай монстров','monster-paradise','monster-paradise/589ef0f7ea85466d149ce18904df8cd0.jpg','Маньхуа',2021,113,'<p>800 лет назад, 3 000 пространственных врат открылись по всему миру. Как будто 3 000 разноцветных глаз открылись и монстры хлынули из них, словно слёзы. Некоторые могли одним ударом уничтожить городские стены, тела их были гигантские и питались они людьми. Некоторые крепились к людям, вытягивали из них питательные вещества и порабощали их. Некоторые проникали в города, маскируясь под обычных жителей, в то время как питались они человеческой кровью, чтобы поддерживать свою жизнь.<br />\r\n<br />\r\nВ одну ночь человеческая раса упала на дно пищевой цепи, и мир превратился в рай для монстров...</p>',0.0,0,0),(209,'Великий маг в прямом эфире','bj-grad-mage','bj-grad-mage/c4bb6cbd55c3310ba871c19c9dd06419.jpg','Манхва',2022,90,'<p>От автора манхвы &ldquo;Убить героя&rdquo;: Джун Хён У не обладал ни деньгами, ни талантом, ни даже удачей. &ldquo;Почему я вижу скрытую информацию в игре?&rdquo; После несчастного случая (удара током), Джун Хён У начал видеть в онлайн игре то, чего никто другой не мог видеть.</p>',0.0,0,0),(211,'Дракон внутри меня','dragon-inside-me','dragon-inside-me/ac90bc54115373cbbac41394ced26963.jpg','Маньхуа',2018,630,'<p>Наставник императора небесного царства переродился во время учебы в старшей школы. Однако, он к удивлению, обнаружил, что в его теле также находится дракон&hellip; Сможешь ли ты сопротивляться угнетающим обстоятельствам или сдашься, когда ты еще очень слаб? В прошлой жизни он подчинился, но в этой жизни&hellip;выдающийся наставник императора теперь главенствует в городе, может одной ладонью обрушить небеса, но только в его голове крутилась лишь одна мысль: почему я, великий царь, оказался среди людей?</p>',0.0,0,0),(212,'Квестовое Превосходство','qust-suprmcy','qust-suprmcy/f1e2b87b97afa9535881e83a07b4cb57.jpg','Манхва',2021,112,'<p><strong>[Действие происходит в той же вселенной, что и «Лукизм» и «Борьба в прямом эфире»] </strong></p><p></p><p><strong>Ким Сухён – обычный старшеклассник. Он не очень хорош в учебе, борьбе и совсем не привлекателен.</strong></p><p> </p><p><strong>Внезапно прямо перед ним возникает окно квестов.</strong></p><p> </p><p><strong>Получив возможности игровой [Системы] из ниоткуда, как наш герой будет противостоять стоящим перед ним вызовам?</strong></p>',0.0,0,0),(213,'Я единственный, кто использует заклинания','im-the-only-one-who-uses-spells','im-the-only-one-who-uses-spells/ef075f9c499612158623cc690cc9e9d5.jpg','Манхва',2020,134,'<p>&quot;Было бы здорово, если бы я смог использовать все эти способности в жизни!&quot;<br />\r\nЯ думал, что исполнить это желание не под силу даже Богу, но в момент смертельной опасности, похоже он услышал меня.<br />\r\nСамое время сыграть в реальность!<br />\r\nДа, теперь я единственный, кто использует заклинания!</p>',0.0,0,0),(214,'Симбиоз между кроликом и чёрной пантерой','symbiosis-between-rabbit-and-panther','symbiosis-between-rabbit-and-panther/1ff95a9ed197f5404e8d9047d65c06a6.jpg','Манхва',2020,123,'<p>Я кролик-оборотень, не сумевшая превратиться в человека к церемонии своего совершеннолетия. Моя семья сказала, что я лишь слабая полукровка, и бросили меня, оставив в корзинке&hellip;</p>',0.0,0,0),(215,'Архимаг, Преодолевающий Регрессию','74456-the-archmage-who-transcends-by-returning','74456-the-archmage-who-transcends-by-returning/50b5a35f43a76e9857ecb2d4fed893c9.jpg','Манхва',2022,80,'<p>Михаил Вальфургис, единственный в мире маг 9-го круга, пал в ожесточенном бою из-за воина, проигравшего гнусному демону. В последний момент, на пороге смерти, он сумел применить могущественное магическое заклинание &lt;Возращение во времени&gt;. Обратив время вспять, он вернулся на 20 лет назад. &quot;Отлично, теперь я займу место того воина&quot;</p>',0.0,0,0),(216,'Гельмут: Отвергнутое дитя','hlmut','hlmut/b7d767c20c79dce0119b44ff2d5880f6.jpg','Манхва',2022,45,'<p>Гельмут &ndash; ребёнок, которого младенцем бросили в лесу Демонических зверей. Лишь в юношестве он встретил своего первого человека &ndash; им оказался сам Дариэн &laquo;Святой Меч&raquo;. Вряд ли тогда он понимал, насколько кардинальна эта встреча изменит всю его жизнь... &mdash;Если хочешь выбраться отсюда, ты должен стать сильнее. Взращённый созданиями тьмы, Гельмут внезапно попал в мир людей! Он был несравнимым воином, обладал выдающейся внешностью и острым умом, только одного ему не хватало: человечности. &mdash;Отныне именно я &ndash; настоящий хищник!</p>',0.0,0,0),(217,'Бурный век','volcanic_age','volcanic_age/dea3a708a83af2f5301ae8b64dcb787d.jpg','Манхва',2017,251,'<p>На смертном одре старейшина Чу Сочхон (주서천) жалеет о прожитой жизни, полной сомнений и сожалений. Он умирает, но вместо загробного мира возвращается в прошлое. Сможет ли он исправить свои ошибки и вновь прожить жизнь так, чтобы не сожалеть?</p>',0.0,0,0),(218,'Магический стрелок','matans-shooters','matans-shooters/8db727d37e096884d17504c59f61bcbc.jpg','Манхва',2021,136,'<p><strong>Сериал про гиперреалистичную фэнтезийную игру! </strong></p><p></p><p><em>«Сержант Ха, ты сумасшедший ублюдок. </em></p><p><em>Ты выстрелил еще раз в пулю?» </em></p><p></p><p><strong>Меткий стрелок Ха ЛиХа просто хотел навсегда стать частью армии. </strong></p><p><strong>Однако из-за несчастного случая он стал парализованным и был отброшен обратно в общество. </strong></p><p><strong>Революционная игра VR [Средиземье] подарила ему новую жизнь. Деньги, полученные в [Средиземье], имеют реальную ценность!</strong></p><p><strong> Тем не менее, он испортил свой шанс, выбрав персонажа самого низкого уровня! «Я не такой, как другие.</strong></p><p><strong> Это все, что у меня есть». Черный порох, железные шары и шомполы ...</strong></p><p><strong><em> Я вам всем покажу, что такое настоящий «мушкетер»!</em></strong></p>',0.0,0,0),(219,'Злодейка-марионетка','villainess-is-marionette','villainess-is-marionette/520a02f8763170c46c96a2b2c6573cad.jpg','Манхва',2021,81,'<p>Принцесса Каена, прославившаяся своей красотой на всю Империю, не знает ничего, кроме алчности и злобы. Долгое время она пыталась избавиться от своего младшего брата-тирана, но встретила смерть от руки своего мужа.  - Я помогу тебе стать Императором.  - Сестра... вы обо мне?..  - Но в обмен... ты подаришь мне свободу.  До того, как &quot;я&quot; стану принцессой Каеной.</p>',0.0,0,0),(220,'Семья мужа одержима мной','sworld-is-obsssd-with-m','sworld-is-obsssd-with-m/fc10a1cc2e9eafe224cb34f55ed7a228.jpg','Манхва',2021,83,'<p>Семья моего мужа убила меня из-за наследства. Чтобы спасти свою жизнь и наследство, я вернулась в прошлое и заключила с графом Лафиреоном брак по договору сроком на один год.<br />\r\nТеперь мне необходимо благополучно развестись с ним..<br />\r\n&quot;Дорогая, ты думала, что сможешь сбежать от меня?&quot;<br />\r\nМой муж и вся его семья внезапно стали одержимы мной</p>',0.0,0,0),(221,'Чтобы не умереть','in-order-not-to-die','in-order-not-to-die/858d675f861d9bf7d6bf16966d4a3a25.jpg','Манхва',2021,106,'<p><strong>Лим Даджун -&nbsp;ученик старшей школы и&nbsp;извечная&nbsp;мишень для издевок в школе. </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Будучи уже на грани того, чтобы отказаться от своей жизни, он случайно натыкается на интервью по телевизору, в котором говорилось о школьнике,&nbsp;убившем своих одноклассников, которые издевались над ним.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Даджун вдохновляется увиденным и тоже решает отомстить.</p>\r\n\r\n<p><br />\r\n<strong>Месть удается, однако его&nbsp;жизнь переворачивается с ног на голову. Школьным денькам&nbsp;конец, и&nbsp;теперь ему придется выживать в жестоком уличном мире.</strong></p>',0.0,0,0),(222,'Гений необычайных кровей','extraordinary-pedigee-genius','extraordinary-pedigee-genius/4d3411235e01ed96e83a0fee7557074c.jpg','Манхва',2022,51,'<p>Я просто хочу перебить всех захватчиков и жить своей обычной жизнью.<br />\r\nРазве я так многого прошу?<br />\r\nНо все только твердят: &quot;За двумя зайцами погонишься ни одного не поймаешь&quot;</p>',0.0,0,0),(223,'Шальные девчонки','girl_the_wilds','girl_the_wilds/high_cover.jpg','Манхва',2011,263,'<p>Как вы думаете &mdash; какая самая главная проблема в романтике нашего времени? Конечно же, нехватка женственности и мужества. Зная творения писателей золотого века литературы, мы можем с лёгкостью сказать, какими милыми и воспитанными девушки были в те времена. Но годы идут, всё меняется... И об этих изменениях и расскажет эта манхва. &nbsp;&nbsp; Давайте представим обычную школу для девушек, &nbsp;в которой главную роль при обучении отводят боевым искусствам. Однажды управляющий этой школы призадумался и решил, что его ученицам не хватает женственности. В итоге школа переходит на совместное обучение. И вроде всё идёт как по маслу, но... Только&nbsp;один&nbsp;ученик мужского пола подал заявку на поступление. Без отца и матери он самостоятельно приглядывает за сестрой и братом. Вот и соблазнился стипендией за любые отметки, да и решил поступить в это заведение. Вот только не знал он, что в школе его поджидают девчонки - шальные, неудержимые и юные.</p>',0.0,0,0),(224,'Восхождение небесного демона','cultivation-of-havn','cultivation-of-havn/173fb9ca3468d8b438c6c658de59ee63.jpg','Манхва',2021,94,'<p>Группа разведчиков была направлена в район секты горы Хуаньшань их великим лидером Мантисом. Главный герой, Соль Хви, сталкивается с Мастером секты Хуаньшань &ndash; Гу Чжон Мен и оказывается на грани смерти. Появляется окно статуса, которое возвращает его в то время, когда он ещё не принял роковую миссию.&nbsp;<br />\r\nВновь получив этот билет в один конец, Соль Хви изо всех сил пытается изменить свою судьбу. Окно статуса, которое появляется в критические моменты. Выбор с неизвестными последствиями.&nbsp;<br />\r\nЭто история Соль Хви, пытающегося найти лучшее решение, идущего по грани жизни и смерти.</p>',0.0,0,0),(225,'Бог войны, регрессировавший на 2 уровень','the-warlord-who-returned-to-level-2','the-warlord-who-returned-to-level-2/3cd88208df25eeb495171fe9aa0ce90c.jpg','Манхва',2023,37,'<p>Battle Net – игра, обернувшаяся катастрофой для человечества. После создания Космической лиги все живые организмы во вселенной были вынуждены сражаться за своё выживание. Представители Земли, люди, терпели неудачу за неудачей, пока не были удалены за свою бесполезность. Выжил лишь один человек, боевой святой Сон Джихан, чья способность препятствовала его удалению. Благодаря этому случаю человечество получило ещё один шанс, воплотить который дано лишь Сон Джихану. Ему уже известно, чего ждать от игры, поэтому в этот раз всё будет иначе.</p>',0.0,0,0),(227,'Я застрял в одном и том же дне на тысячу лет','ive-been-stuck-on-the-same-day-for-a-thousand-years','ive-been-stuck-on-the-same-day-for-a-thousand-years/900190e689c44f961f8cec443fb337d1.jpg','Маньхуа',2022,52,'<p>У Чэнь попал в ловушку постоянного повторения одного и того же 7 июля 2020 года! Он предавался безумству, совершал всевозможные преступления и в отчаянии расправлялся с собой, но в итоге все начиналось сначала. И так он повторял один и тот же день тысячу лет, пока однажды внезапно все не встало на свои места. Время: 8 июля 2020 года.</p>',0.0,0,0),(228,'Я оказалась в мире фэнтези романа','anyway-its-ok','anyway-its-ok/ce9b7fa2aa8044172d126f9459a6264f.jpg','Манхва',2021,96,'По стандарту любого фэнтези романа, главная героиня Литтера попадает в мир новеллы. Для того, чтобы обрести счастливую жизнь, она предлагает Великому Герцогу северных земель заключить брак по договору. В представлении Литтеры герцог казался красивым молодым человеком с прекрасным характером, однако... на самом деле у него косматая борода, огромные шрамы по всему телу и яростный взгляд... \"Когда фэнтези роман успел превратиться в новеллу о боевых искусствах?!\" Интересно, сможет ли Литтера обрести свое счастье в этом непростом романе?',0.0,0,0),(229,'Бессмертный культиватор против суперспособностей','an-immortal-cultivator-against-superpowers','an-immortal-cultivator-against-superpowers/3e2453def560f933a51abf3549ac4b5a.jpg','Маньхуа',2020,281,'<p>Могущественный человек с бессмертного континента случайно переместился в современное героическое общество, и на этой крошечной земле существуют суперспособности! Известные в этом мире супергерои, боровшиеся со злом, увидев в небе странного человека, сразу же решили разобраться с ним. Неизвестный никому стоящий в небе молодой парень, хотел лишь спросить, что это за место. Но супергерои не стали церемониться, даже не выслушав его, они решили показать все свои силы. И это оказалось для них огромнейшей ошибкой...</p>',0.0,0,0),(230,'Перерождение Убийцы в Копа','the-killer-police','the-killer-police/bbdfed2738d01115145da20b4e8597d9.jpg','Манхва',2023,39,'<p><strong>Воспитанный убийцами знаменитый киллер Ким Кён Су по прозвищу &quot;Яркий Декабрь&quot; готовится исполнить свою последнюю миссию.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>однако погибает в результате предательства.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Легендарный убийца перерождается в теле полицейского и клянется отомстить обманщикам из клана Хвагукса.</strong></p>',0.0,0,0),(231,'Жуткий фармацевт: все мои пациенты ужасны','creepy-pharmacist-all-my-patients-are-horrible','creepy-pharmacist-all-my-patients-are-horrible/c115bcddcc481f4cf43c6172bb0ae096.jpg','Маньхуа',2023,176,'<p>Поглотит ли его коварная тьма, или он превратится в страшное существо и выживет? Как врач, который должен лечить людей, попал в мир чудовищ? Лин Ан лечит «нежно» и «искренне» радуется каждому пациенту! «Анестезия? Используем в следующий раз». «Мой нож быстро справится с задачей, потерпите!» Добро пожаловать в аптеку «Кровавая пила», мы будем рады обслужить вас!</p>',0.0,0,0),(232,'Перерождение: Монстр','re_monster','re_monster/a161c8fa029c8f9b6d2a2ea329591fed.jpg','Манга',2014,100,'<p>После смерти Томоки Каната возрождается слабым гоблином по имени Роу. Сохранив все воспоминания своей прежней жизни, он необычайно быстро эволюционирует, становясь сильнее и получая способности того, кого съест.Действия манги разворачиваются в альтернативном мире, где выживают лишь самые приспособленные. Сможет ли пати обычных гоблинов стать его героями в водовороте блестящих сюжетных поворотов нестандартного сценария?&nbsp;</p>',0.0,0,0),(233,'неОРДИНАРНЫЕ','unordinary','unordinary/59bdbdb48a4e9a559b61f353dd514119.jpg','Западный комикс',2015,330,'<p>Не только <strong>супергерои</strong> обладают <strong>суперспособностями</strong>.<br />\r\nИногда и обычные люди могут удивить уникальными <strong>силами</strong>...</p>',0.0,0,0),(289,'Я стала горничной герцога','i-became-a-dukes-maid','i-became-a-dukes-maid/6ac546a91b39e10a887fc372af4d36c6.jpg','Манхва',2019,110,'<p>Однажды, открыв глаза, я оказалась внутри популярной новеллы в качестве горничной герцога, второстепенного персонажа и злодея этой истории, Леандро Кийо Вел Лавити.&nbsp;Изменится ли судьба Леандро с появлением нового &laquo;особого&raquo; персонажа? И что же скрывается за его проклятием?</p>',0.0,0,0),(234,'Я создал бункер в замороженном мире','freezing-the-world-i-built-a-doomsday-safehouse','freezing-the-world-i-built-a-doomsday-safehouse/8e188fd7288ff13f9813e3cdac0c4d87.jpg','Маньхуа',2023,144,'<p>Мир поглотил Ледниковый период, 95% человечества вымерло! В прошлой жизни чжан И погиб от руки человека, которому помог по доброте и наивности. Переродившись, он пробудил силу космоса, и стал словно безумец заниматься сбором ресурсов. Я стану единственным правителем этого ледяного ужаса! Клянусь, что отплачу за прошлую боль в стократном размере!</p>',0.0,0,0),(235,'Сорок тысяч лет культиваций','forty-millenniums-of-cultivation','forty-millenniums-of-cultivation/high_cover.jpg','Маньхуа',2016,374,'<p>В современном мире духовная сила и технологии соединились воедино, это соединение дало начало Эре Культивирований!</p>\r\n\r\n<p>Это история о юноше, который хочет стать лучшим мастером артефактов в Эре Культивирований и исполнить мечту своего старика!</p>',0.0,0,0),(236,'Реинкарнация скелета','the-revolt-of-the-bones-from-the-fire-and-ash','the-revolt-of-the-bones-from-the-fire-and-ash/e6cd98c9d83966be0e5ac2cdec4bc627.jpg','Манхва',2021,24,'<p>Давным-давно по всему миру начали образовываться порталы подземелий, из которых вылазили огромные монстры. В то же время среди людей начали появляться люди, обладающие сверхчеловеческой силой. Их именовали пробужденными. Этот мир, который больше похож на фэнтези новеллу... мир, в котором я живу. Однажды я случайно попал в одно из таких подземелий через портал странного цвета. Отныне моя жизнь, в которой мне приходилось только зарабатывать деньги ради выживания, полностью изменится.</p>',0.0,0,0),(237,'Вернувшийся игрок','a-relife-player','a-relife-player/2b29dced06a17186b67d9b8d15da9243.jpg','Манхва',2022,59,'<p>[От создателей &lt;Чёртова реинкарнация&gt; и &lt;S-Ранг притворяющийся слабаком&gt;!]<br />\r\n&lt;Несмертный&gt; Но Юнха.<br />\r\nПосле трагической потери своей семьи он закрылся в себе с единственным желанием: найти и убить как можно больше чудовищ.<br />\r\nПрямо перед концом своей жизни в &lt;Подземелье Бездны&gt; я вернулся к началу своего жизненного пути.<br />\r\nРаз уж я переродился, стоит изменить мою жизнь.<br />\r\nРади своего счастья я пойду на всё.<br />\r\nРади выживания я буду делать всё, что угодно, включая бесчисленные убийства.<br />\r\nДаже если я должен пройти эту тернистую дорогу один и никто не узнает обо мне.<br />\r\nВ этой жизни я...</p>',0.0,0,0),(238,'Недосягаемая леди','unaccessible-lady','unaccessible-lady/8f5f6bbe2398b15d824f8330690c190e.jpg','Манхва',2020,122,'<p>&mdash; Пожалуйста, Хиллис. Пожалуйста, умри вместо Габриэль. &mdash; произнёс мужчина.<br />\r\n<br />\r\nВпервые мой всегда величественный брат умолял меня. Он хотел, чтобы я отдала жизнь вместо нашей сестры, с которой мы даже не одной крови.<br />\r\n<br />\r\n&mdash; В первый и последний раз я прошу тебя об этом.<br />\r\n<br />\r\nЯ всегда была несчастна. В седьмой раз, когда меня предали и убили, я полностью освободилась от своих чувств к ним.<br />\r\n<br />\r\n&mdash; Рада, что ты так и остался мерзавцем.<br />\r\n<br />\r\nЯ больше никогда не поддамся влиянию любви. Теперь мой черёд быть эгоисткой.</p>',0.0,0,0),(239,'Я попал в мир ужасов с системой богатства','opening-trillions-of-plutonium','opening-trillions-of-plutonium/38bf37333ac6694058dab5e71f3841b3.jpg','Маньхуа',2023,73,'<p>Однажды Линь Юй пробуждает Божественную систему, которая каждый день выплачивает ему деньги. Жалко лишь деньги не простые, а так называемые минби, что можно использовать только после смерти! Через несколько лет его накопления пробили отметку в триллион и внезапно ему пришло приглашение на бета-тест триллер-игры. Только вот это не компьютерная игра... в назначенный момент его переносят в мир ужасов, где обитают злые духи, что без проблем могут убить тебя. Единственный способ выжить - стать повелителем призраков! В то время как другие все еще со страхом пытаются угодить духам, Линь Юй со своим статусом Бога из-за данной ему системы отдыхает словно на курорте! Оказывается, когда есть деньги, можно и черта заставить крутить жернова!</p>',0.0,0,0),(240,'Учитель Святых Созвездий','constellations-are-my-disciples','constellations-are-my-disciples/b1f00ec28168d1009ae804868e81916d.jpg','Манхва',2023,44,'<p>В прошлом, много лет назад, Богу боевых искусств Ким Хён О удалось освободить мир от угрозы начала конца, одолев Барче, босса Башни разрушения, под завалами которой Хён О и встретил свою смерть. Однако спустя три сотни лет он неожиданно переродился в теле 17-летнего Ким Джу Хёка, узнав, что &ldquo;созвездия&rdquo;, появившиеся за время его забвения &mdash; на самом деле его собственные ученики. Чтобы встретиться с каждым из них, он решил отправиться в долгое путешествие.</p>',0.0,0,0),(241,'Надоело быть профи, хочу отдыхать!','how-a-pro-from-a-previous-life-sucks-honey','how-a-pro-from-a-previous-life-sucks-honey/1b9a1cc1c0fd59ccff235da02a82e7d4.jpg','Манхва',2023,50,'<p>Чёрт... я опять переродился. Это уже какое... 101 перерождение? Да и ещё фэнтези? Да как же меня всё это достало!</p><p>В этой жизни я принц, мать которого была служанкой. С одной стороны я принц, а с другой - никакое наследство мне не грозит. Вроде не всё так плохо: я ноунейм, на которого всем посрать.</p><p>Надеюсь, мне не потребуется опять спасать мир, а то я уже задолбался...</p>',0.0,0,0),(242,'Безграничный Некромант','the-all-master-necromancer','the-all-master-necromancer/82282c6135ffd1c82df3c8ee821e12d2.jpg','Манхва',2023,41,'<p><strong>История от автора &laquo;Моей типичной Реинкарнации&raquo;.</strong><br />\r\n<br />\r\nБашня - загадочное место неустанных перемен.<br />\r\nДесять лет спустя я перевоплотился в тело мальчика, живущего на Земле в Южной Корее.<br />\r\n<br />\r\n&quot;Урод, что вонзил мне нож в спину, и тот, кто за ним стоит&hellip; Я им отомщу!&quot;<br />\r\n<br />\r\n<strong>Духовный мастер Ча Джин Хёк - человек, достигший вершины и получивший высший класс. Будучи &ldquo;Всемогущим&rdquo;, он отомстит, поднявшись на башню в качестве некроманта.</strong></p>',0.0,0,0),(243,'Я должен быть монстром','i-must-be-a-monster','i-must-be-a-monster/fd7a80191296925a379bde0a7230b026.jpg','Маньхуа',2022,44,'<p>Спокойно защищая человечество, герой Сяо Цю внезапно оказывается в центре недопонимания и презрения от своих же соратников. Прожив не самую лучшую жизнь и вновь переродившись, он решает встать на путь хладнокровного и безжалостного монстра. &laquo;Спасать человечество?.. Хах, разве люди того стоят?&raquo;</p>',0.0,0,0),(244,'Игрок скрывает прошлое','the-player-hides-past','the-player-hides-past/fb40f644d8886e1afaebf0f6bdbf0bb5.jpg','Манхва',2023,31,'<p>VR-игра «История континента Аркана» внезапно стала частью реальности. Для защиты мира появились синхронизированные с настоящими людьми «игроки».</p><p></p><p>Ли Хо Ёль, обычный офисный работник, получил тело персонажа, которого он создал ещё в средней школе – «Грандфелл Клауди Арфей Ромео». В обычной ситуации это было бы полным провалом, но не в случае Грандфелла, последнего «охотника на демонов»!</p>',0.0,0,0),(245,'Вернувшийся из ада - Хан Дэсон','daesung-han-came-back-from-hell','daesung-han-came-back-from-hell/4109ecf868e7bb27e1f42d04e6c887b5.jpg','Манхва',2023,61,'<p>Хан Дэсон 80 лет провел в аду. Но вернувшись на Землю из абсолютного ада, пообещал отныне жить нормальной жизнью, но... Земля изменилась. Те, кто противостоят мне, я дам вам вкусить адскую боль!</p>',0.0,0,0),(246,'Это не твой ребенок','the-baby-isnt-your','the-baby-isnt-your/c5355e799d7826777755cf1c14428adf.jpg','Манхва',2022,60,'<p>- &quot;...Это правда ребёнок? Внутри меня растёт малыш?&quot; Великая героиня Калия когда-то положила конец кровопролитной войне. Но однажды она узнаёт, что беременна. Отец ребёнка - архимаг империи и по совместительству лучший друг герцог Шаймон, с которым она провела всего одну страстную ночь.</p>\r\n\r\n<p>- &quot;Ты... всё ещё ненавидишь детей?&quot;</p>\r\n\r\n<p>-&quot;Ненавижу. Всё ещё. И буду продолжать ненавидеть&quot;. Из-за ответа Шаймона, Калия решила не раскрывать правду и, объявив об уходе с поста главнокомандующей рыцарского ордена, исчезла без следа.</p>',0.0,0,0),(247,'Удобно и хорошо, потому что ты злодейка?','its-nice-and-comfortable-because-youre-villainess','its-nice-and-comfortable-because-youre-villainess/4a8afee94d1f646c2f43a1015103227f.jpg','Манхва',2022,45,'<p>&quot;Удобно и хорошо, потому что ты злодейка?&quot; - это манхва о том, как главная героиня Юн Дохви оставила свою жизнь неудачницы и перевоплотилась в злодейку, родившуюся с ложкой из орихалка во рту. Теперь она соединяет в себе милый характер, внешность коварной женщины и обширные знания.</p>',0.0,0,0),(248,'Мукхян — Дарк Леди','mookhyang--dark-lady','mookhyang--dark-lady/6a65fdb50f262c27ce2b5aea83a84bc7.jpg','Манхва',2019,200,'<p>Будучи мастером школы темных искусств и непобедимым незыблемым истым демоном, Мукхян, к несчастью, попадает в странный фэнтезийный мир из-за магии своих врагов (школа искусств крови). В новом мире эльфов, колдунов, рыцарей и драконов, разворачивается приключение Мукхяна по поиску пути назад в его старый мир, Мурим.</p>',0.0,0,0),(249,'Токийские мстители','toukyou-revengers','toukyou-revengers/1b8782e90655c832e8e0ec088cbb9b33.jpg','Манга',2017,287,'<p>В один день 26 летний девственник-неудачник, Такемичи, узнаёт, что единственная девушка, которая с ним встречалась, погибла в ходе разборок токийской группировки &ldquo;Свастоны&rdquo;. После того, как он падает под поезд, Такемичи перемещается на 12 лет назад, во времена средней школы. Он решает изменить будущее, дабы спасти девушку. Заручившись помощью от её младшего брата, Такемичи начинает свой путь к верхушкам самой опасной группировки города.</p>',0.0,0,0),(250,'Сказания о Бессмертных и го','lan-ke-qi-yuan','lan-ke-qi-yuan/76110e3fef12e386596405aa56d479e8.jpg','Маньхуа',2021,180,'<p>Позвольте для начала рассказать вам легенду, что была заложена в название этой маньхуа &quot;Легенда Ланкешань&quot; (&quot;Гора&quot; с гнилой рукоятью топора) Легенда гласит о лесорубе, что забрел глубоко в лес, и встретил двух бессмертных, играющих в &quot;Го&quot; (Китайские шахматы). Лесоруба заинтересовала их игра, так что он отложил свой топор и наблюдал за игрой. Один из игроков в го дал ему что-то вроде семечки, чтобы тот не чувствовал ни голода, ни жажды. Впав в транс, и наблюдая за игрой час, а может два, он наконец очнувшись обернулся. &nbsp;Он обнаружил свой топор, рукоятка которой уже почти вся сгнила, а он сам оброс бородой. &nbsp;Вернувшись в свою деревню он обнаружил, что его семья исчезла, а в деревне его уже никто не знал.</p>\r\n\r\n<p>События в наши дни: Теперь главный герой выбрался на кемпинг, а его товарищи попросили сходить и набрать дров. Зайдя чуть в лес, он обнаружил одинокую доску для &quot;Го&quot; и почти сгнивший топор рядом с ней. Чуть задержавшись и сделав один ход, наш главный герой решил вернуться и рассказать об этом своим товарищам, но его встретила только поисковая группа, которая искала вот уже больше полумесяца, как вы уже догадались именно его, на ряду со всем случившимся, он потерял сознание, и в возрасте 19 лет &nbsp;умер от обезвоживания, и переродился в суровом и жестоком мире. Что его ждёт? Какова его дальнейшая судьба?</p>',0.0,0,0),(251,'Переродившийся убийца — гений фехтования','reincarnated-assassin-is-a-swordsman-genius','reincarnated-assassin-is-a-swordsman-genius/e2726b2be6a1570f7919f1cde7cf69dd.jpg','Манхва',2023,29,'<p>Всю свою жизнь Раон словно пёс на цепи.<br />\r\n<br />\r\nОднако, благодаря повороту судьбы, он обрёл новую жизнь &mdash; пусть даже гнев остался в обрывках его порванного поводка.<br />\r\n<br />\r\nНаконец-то он смог встать на ноги и решил жить как диктует его воля.<br />\r\n<br />\r\n&mdash; Я убью любого, кто встанет на моем пути... даже если это будет бог.</p>',0.0,0,0),(252,'Бог боевых искусств','god_of_martial_arts','god_of_martial_arts/e6a29c5b1bed6c1b3b662533fb998eed.jpg','Маньхуа',2017,382,'<p>В этом мире пользуются уважением боевые искусства. У слабых боевых искусств достаточно силы, чтобы рассекать валуны. Сильные же могут разделить реки и расколоть горы. Есть среди мастеров Короли боевых искусств, всезнающие и способные пересечь Вселенную. Боевое искусство здесь решает всё &mdash; судьбу, жизнь и смерть. Статус людей в этом мире определяет их уровень боевых искусств. Слабых унижают, пока сильные смотрят на мир свысока. Каждая фракция борется за титул &laquo;Сильнейшей&raquo;. Только у сильных есть право на выживание. Неважно, в каком&nbsp;клане или фракции ты состоишь, если ты слаб, над тобой будут издеваться и изгонять без пощады.</p>',0.0,0,0),(253,'Моя эволюция в демона','i-evolution-devil','i-evolution-devil/bd7468d9991c6893599ed301b6840066.jpg','Маньхуа',2023,38,'<p>Сильнейший воин человечества, Ан, находясь на грани смерти, странным образом перемещается на 60 лет в будущее, где узнаёт, что внутри него скрыта неоднозначная сила &laquo;самого могущественного демона&raquo;.<br />\r\nЧтобы исправить свои прежнее ошибки и докопаться до правды, ему остаётся только постоянно &laquo;эволюционировать&raquo;, только так можно избежать повторения судьбы прошлого.<br />\r\n&laquo;Теперь не нужно полагаться на удачу, мое будущее в моих руках!&raquo;</p>',0.0,0,0),(254,'Игрок','player','player/fcc418f5b25255676fc4913b360c7ea7.jpg','Манхва',2020,186,'Из-за обещания данного в лучшем комментарии, я стал главным героем вебтуна.',0.0,0,0),(255,'Безумная эволюция','evolution-frnzy','evolution-frnzy/cf9f28d2e9f5cd6da6e66e0640bbaa43.jpg','Маньхуа',2021,160,'<p>После смерти Дуань Фэй возвращается на 20 лет назад во времени всего за несколько часов до начала вирусной катастрофы, и ему выпал шанс исправить то, о чем он сожалел последние 20 долгих лет. Он использует все знания, которые накопил до того, как попасть в прошлое, чтобы вооружиться и быть готовым к надвигающемуся апокалипсису. Его недавно приобретенное &laquo;Эволюционное древо&raquo; также помогает ему постоянно улучшать свою силу. Дуань Фэй, который из последних сил пытался выжить в своей предыдущей жизни, теперь герой и будущий спаситель мира.</p>',0.0,0,0),(263,'Мукхян: Начало','mukhyang-the-origin','mukhyang-the-origin/c54557324556b450fdf7e4b66d07d3e1.jpg','Манхва',2021,47,'Эта история разворачивается в легендарном Муриме, где многочисленные силы борются за превосходство. Номер 2044 ещё в детстве похищает демонический культ, чтобы воспитать из него наёмного убийцу. Но он сумел выжить в тяжёлых тренировках, прошёл через множество испытаний и получил имя “Мукхян” в знак признания своих навыков.\r\n\r\nОднако Мукхян на протяжении всей жизни испытывал неудовлетворённую тягу к следованию пути меча! Образ жизни убийцы не смог помочь ему утихомирить то, что у него внутри, но всё меняется, когда он встречает учителя - “Хван Сагом Юпэка”. Сможет ли Мукхян достигнуть уровня Тальма – наивысшей точки мастерства в боевых искусствах?\r\n\r\nМукхяну предстоит сразиться со множеством мастеров и узнать, есть ли предел его силе!\r\n\r\nВозвращение легендарного героя!',0.0,0,0),(256,'Сильнейшие люди мира одержимы мной','the-strongest-people-in-the-world-are-bsessed-with-me','the-strongest-people-in-the-world-are-bsessed-with-me/22479d35318c58662a960b8eb2997db4.jpg','Манхва',2021,96,'<p>Однажды, когда ей было тринадцать лет, внезапно вспомнила свою прошлую жизнь. Это обедневший игровой мир отомэ, где главные герои сходят с ума, а она родилась сестрой худшего злодея будущего!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Нельзя допустить такого конца! Семья будет истреблена, а меня выбросят. Так что, несмотря ни на что, я должна как можно скорее покинуть эту семью!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Теперь, когда это так, мне нужно ослабить их бдительность и убежать.&raquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Чтобы избавиться от родственников, которые нацелены на семью и лукавого императора, лучше иметь благосклонность к моему брату.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Я хочу танцевать с Далией. В чем проблема?&raquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Мне очень жаль, но моя сестра стесняется&raquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&laquo;Далия сказала, что я ее любимец!&raquo;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Почему-то я приручила не только своего брата, но и все сильнейшие персонажи в этом мире одержимы мной!</p>',0.0,0,0),(257,'Осколок времени','house-of-time','house-of-time/a58960b151f21a8d5685c95ab13f0097.jpg','Манхва',2020,130,'Девушка, подвергшаяся насилию. Встречается с мужчиной средних лет, обладающим ужасным характером и всё это время жившем в мире, где ничего нет.',0.0,0,0),(258,'Выжить в романе','to-survive-in-the-novel','to-survive-in-the-novel/37268279adf0d27824c05fccbcfc7cbc.jpg','Манхва',2021,102,'<p>Чарли ведет блаженную и комфортную жизнь в любовном романе. Она настолько сильно зациклена на главном герое романа - Джине, что все статисты превращаются в буквально в черные тени. Но вот однажды ее история внезапно меняет жанры. И вот она осознает, что, если она хочет жить, то ей нужно будет объединиться с статистами, которых она раньше игнорировала, и работать с ними вместе, чтобы выжить.</p>',0.0,0,0),(259,'Создатель концовки','43208-endings-maker','43208-endings-maker/36fdb210a0cfddf0eb90a133ac75d8f9.jpg','Манхва',2022,56,'<p>Два профессиональных игрока в игре &quot;Легенда Героев 2&quot;: Кан Чжин Хо - Первый в мировом топе и Хон Ю Хи - вторая в мировом топе, однажды открыли глаза и оказались внутри своей любимой игры в телах игровых персонажей.</p>\r\n\r\n<p><br />\r\n- Эй, и ты... тоже?</p>\r\n\r\n<p><br />\r\n- Д-да, и я...</p>\r\n\r\n<p><br />\r\nФиналом &quot;Легенды Героев 2 &quot; является разрушение человеческого мира.&nbsp;<br />\r\nОднако, если они не одни... если топ 1 и топ 2 мира вместе... то... Они вновь пройдут по протоптанному пути с намерениями добиться &quot;Хорошей Концовки&quot;!</p>',0.0,0,0),(260,'Ограниченный временем тёмный рыцарь','the-timelimited-genius-dark-knight','the-timelimited-genius-dark-knight/08f27560b1849259ca95f83ece3a5386.jpg','Манхва',2023,34,'<p>- Фэнтезийная RPG, печально известная своей высокой сложностью.<br/><br/>Только вот для Ючхона, у которого в юном возрасте была диагностирована неизлечимая болезнь, эта игра была всей его жизнью и теперь стала реальностью.<br/><br/>Отныне Ючхон должен выживать в этом мире как Нокс фон Рейнхард, худший злодей в первом акте игры. Сможет ли он благополучно дойти до конца истории?</p>',0.0,0,0),(261,'Имбовая деревянная дубинка 99-го Уровня','99-reinfored-wood-stick','99-reinfored-wood-stick/abb816c100cb45ebd7c5669f54a1e744.jpg','Манхва',2022,85,'<p>В онлайн игре Chrono Life я познал страшную тайну о законах, которые на самом деле царят в этом совершенном фентезийном мире. Каким-то чудом мне удалось прокачать совершенно бесполезное оружие для новичков - деревянную дубинку - до имбового уровня 99+. И теперь настал мой час отомстить тем, кто потешался надо мной! Начнём имбовое приключение!</p>',0.0,0,0),(262,'Распятие Шести','juujika-no-rokunin','juujika-no-rokunin/4c2e1c9c7a0513990eadfd5a018807f7.jpg','Манга',2020,145,'<p>&laquo;Можно ли убивать людей?&raquo;<br />\r\n&laquo;Сюн, если он&nbsp;перевоплотился, отпусти его. Ему нужно дать шанс&raquo;.<br />\r\n&laquo;Дедушка, надеюсь, он не переродится&raquo;.<br />\r\nЧтобы победить нескольких бесчеловечных монстров, мальчик сам стал чем-то ужасным.<br />\r\nСюн Урума, ученик шестого класса, которого пять одноклассников назвали &laquo;Экспериментальным телом: А&raquo;, они подвергали его жестоким издевательствам, он жил в аду. Единственной отрадой были младший брат и родители, которые защищали его .... пока пять монстров их не убили.<br />\r\nКогда он наконец теряет все и сталкивается с настоящим адом, внутри Сюна рождается тёмное &laquo;желание&raquo;. Он переродился под воздействием тренировок своего деда, который служил в секретном подразделении во время Второй мировой войны. Теперь, четыре года спустя, он предстанет перед своим судьбоносным врагом.<br />\r\n&laquo;Я не позволю НИКОМУ забрать мою&nbsp;месть&raquo;.</p>',0.0,0,0),(265,'Эстио','esti','esti/2fb246fcb217ae09048aba2862301a50.jpg','Манхва',2022,94,'<p>&laquo;Это ты звал меня?&raquo; Черношёрстный зверь смотрел на него снизу своими жёлтыми сияющими глазами. &laquo;Теперь всё хорошо. Больше не будет больно. Поэтому всё хорошо&raquo;. Эстио &ndash; младший сын, рождённый в семье фермера. Но все люди его презирали. Он ребёнок, который читает души животных и людей. И&hellip; &laquo;Ребёнок, получивший проклятие&raquo;. Наконец, церемония взросления, которая проводится, как только человеку исполняется 19 лет. И вот Эстио отправляется в путешествие, чтобы обрести своё счастье. По мотивам веб-романа известного писателя Кон Дынтхапа.</p>',0.0,0,0),(266,'Раскол','pounding','pounding/high_cover.jpg','Манхва',2018,81,'<p>Я был в отчаянии из-за своей никчемной жизни. Все изменилось, когда я встретил его. Он мой спаситель, но ... также и мой злейший враг.</p>',0.0,0,0),(267,'Я не святой, а доктор!','the-saint-is-the-horn-the-power-of-modern-medcine','the-saint-is-the-horn-the-power-of-modern-medcine/28e97794c82255e8b4fed9f6d6034978.jpg','Манхва',2022,72,'<p>Ю Сонг &ndash; гениальный врач, широко известный в мире медицины. Всю свою жизнь он провёл в операционной. Попав в ДТП, Ю Сонг очнулся в другом мире. Но... Святой? Священная Империя? Магия исцеления?</p>\r\n\r\n<p>&laquo;Я приложил столько усилий, изучая медицину, но теперь всё, что мне нужно сделать: это прикоснуться к кому-нибудь, и он будет полностью здоров? Серьёзно, кажется, я сошёл с ума&raquo;.</p>',0.0,0,0),(268,'Всё, что тебе нужно - это убивать','edge_of_tomorrow','edge_of_tomorrow/high_cover.jpg','Манга',2014,17,'<p>Сюжет подаётся от лица Кэйдзи Кирии &mdash; нового рекрута Объединённого Фронта Обороны, ведущего войну с таинственными пришельцами, нападающими на Землю. Первый же бой оказывается для Кэйдзи последним. Но, вместо того, чтобы спокойно отойти в мир иной, он попадает во временную петлю. После каждой смерти его переносит в прошлое, ровно за один день до судьбоносной битвы. Застряв в этом цикле смертей и перерождений, Кэйдзи постепенно набирается боевого опыта и безуспешно старается изменить свою судьбу. Позже он встречает девушку и надеется с ее помощью покинуть этот замкнутый круг.</p>',0.0,0,0),(269,'Игрок 1-го уровня','level-1-player','level-1-player/2d6742a51075657a54545b30379bef41.jpg','Манхва',2022,80,'<p>[Он &ndash; исключение из правил, которым подчиняется мир охотников, не кто иной, как первоуровневый, способный уничтожать ранкеров!]<br />\r\n&laquo;Ты пробудился&raquo;.<br />\r\nС ним наконец произошло настоящее долгожданное &laquo;чудо&raquo;! Казалось бы, теперь жизнь изменится и дела пойдут на лад...<br />\r\n&ndash; Подожди. Почему я не могу повысить свой уровень?<br />\r\nМало того, что стата пошла по пи**е, так ещё и навыков ноль!.. Когда Хен Сон от отчаяния начал сетовать на своего проклятого персонажа и судьбу-злодейку, заметил странный уникальный навык.<br />\r\n&ndash; Продажа и покупка.<br />\r\n&nbsp;</p>',0.0,0,0),(270,'Принцесса, запечатлевшая изменника','princess-imprinted-the-traitor','princess-imprinted-the-traitor/902b7703b34c4cd35d8a7845c0fbb652.jpg','Манхва',2021,58,'<p>После падения императорской семьи от рук гомункулов, седьмая принцесса Ивенроуз умирает, выпив яд, предложенный сестрой. Очнувшись, она узнает, что вернулась на восемь лет назад и решает сделать Михаэлиса, короля гомункулов и чудовища, своим личным рыцарем, чтобы предотвратить восстание и гибель своего рода.<br />\r\n&quot;Михаэлис, ты мне нужен. Очень сильно. &quot;</p>',0.0,0,0),(271,'Я стала женой принца-монстра','i-became-the-wife-of-a-monster-prince','i-became-the-wife-of-a-monster-prince/f449beecf4ffa6ba3b404ab08b6a71cd.jpg','Манхва',2021,88,'<p><strong>Она переселилась в тело Ансии, нынешней жены чудовищного наследного принца Блейка, в любовном романе 19+.<br />\r\n<br />\r\nВ оригинальной истории Ансия покончила с собой в день их свадьбы, в результате чего Блейк получил тяжелую травму. Но на этот раз Ансия не сделает ничего подобного.<br />\r\n<br />\r\nВ оригинальном романе Блейк был второстепенным персонажем. Его изображали как зверя, обладающего невероятной красотой. Но сейчас он подобен милому кролику.<br />\r\n<br />\r\nЕдинственный человек, который может снять проклятие наследного принца, &mdash; это героиня Диана. Моя же роль состоит в том, дабы не дать этому маленькому кролику пострадать, а затем погибнуть, но&hellip;<br />\r\n<br />\r\n&mdash; Ансия, не оставляй меня!<br />\r\n<br />\r\nЭтот прекрасный кролик продолжает преследовать меня. Что же мне делать?</strong></p>',0.0,0,0),(272,'Моя девушка - зомби','my-girlfriend-is-a-zombie','my-girlfriend-is-a-zombie/18f3f6ab45060c28809c1a83026cd40b.jpg','Маньхуа',2019,382,'<p>Когда люди начали превращаться в зомби, у обычного парня по имени Лин Мо пробудилась способность управлять ими. Он использовал свою силу, чтобы найти свою девушку по имени Ё Лиан, которая превратилась в зомби... По роману Хэй-Ань Личжи «Моя девушка — зомби» (кит. 我的女友是丧尸). Китайское название маньхуа отличается от романа: «我的病毒女友» — «Моя заражённая девушка».</p>',0.0,0,0),(273,'Ради моего брошенного любимого','for-my-lost-love','for-my-lost-love/42766e47dfa1705630debb53341e144a.jpg','Манхва',2022,61,'<p>Только спаси моего любимого!.. Хестия взахлеб прочитала до конца роман и заснула, а очнулась персонажем произведения &ndash; но не главной героиней, а &quot;экстра&quot;, лишней единицей. Она любовалась главными героями издалека, не вмешиваясь, и роман дошёл до финала согласно сюжету. Но ожидание возвращения в реальную жизнь разбилось вдребезги. Хестия застряла в романе ещё на год, пока однажды её любимый не столкнулся с ней. &quot;Теперь я защищу своего любимого!&quot;</p>',0.0,0,0),(274,'Давайте сменим жанр','lets-change-the-genre','lets-change-the-genre/d2acb7a92372b2ecaf81e3934ddd9ff3.jpg','Манхва',2021,81,'<p>В любимом романе я превратилась в злую тетку главного героя.</p>\r\n\r\n<p>Я оберегала и заботилась о своем племяннике, зная, что скоро мне придется с ним расстаться.</p>\r\n\r\n<p>Но когда за племянником пришел привлекательный мужчина и спросил, можно ли взять его с собой,</p>\r\n\r\n<p>племянник вдруг подбежал ко мне, обнял за талию и закричал &quot;мама&quot;.</p>',0.0,0,0),(275,'Легендарный хирург','surgen-who-got-burned-out','surgen-who-got-burned-out/07e5a0fa335660edc0224d40492d779f.jpg','Манхва',2022,90,'<p>Из-за своего прямолинейного характера Хан Джин Су, врач-интерн 3 года в отделении общей хирургии, однажды умер. Но благодаря хорошим поступкам, получил возможность возрождения от ангела, дьявола или какой-то неизвестной системы. И вот уже Хан Джин Су воскресает в теле убитого разбойниками господина. Кстати, это что, тело легендарного хирурга Хуа То?!&nbsp;</p>\r\n\r\n<p>В эпоху героев и военной смуты, в эпоху гостепреимства и грубых слов, Хан Джин Су пытается с достоинством прожить жизнь прославленного хирурга...</p>\r\n\r\n<p>Да начнется необычное приключение молодого хирурга в мире &quot;Троецарствия&quot;!</p>',0.0,0,0),(276,'С сегодняшнего дня я лорд города','starting-from-today-ill-work-as-a-city-lord','starting-from-today-ill-work-as-a-city-lord/da931310cbdbde304c83e0c71451a750.jpg','Маньхуа',2019,465,'Нашего героя-отаку убило лёгким движением ноги в 220 вольт , Ну и что ? Неко-тян сестра, лиса Лоли, милая кролик младшая сестра... это не зоопарк! Это другой мир куда закинуло нашего ГГ , где сильные охотятся на слабых, но опять же не все так замечательно как хотелось бы!',0.0,0,0),(277,'Маг на полную ставку','versatile_mage','versatile_mage/ddb74ecc19e2fe05d7cd978b9a9e071c.jpg','Маньхуа',2018,1013,'<p>Он проснулся в знакомом мире, который так сильно изменился. Его знакомая школа стала магической школой, которая учит волшебству, побуждая всех стать могущественными волшебниками. За пределами города бродят множество монстров. Мир науки и технологии превратился в мир магии!<br />\r\nНесмотря на это, его амбиции и положение в обществе не изменилось. Он отброс общества, у которого сестра-инвалид, которая не может ходить. Тем не менее, Мо Фань обнаружил, что все люди могут управлять лишь одним элементом, но только не он, ему подвластно больше!</p>',0.0,0,0),(278,'Гениальный Мечник Академии','academy-genius-swordsman','academy-genius-swordsman/a47f4d8e13585561d4c6786a0e9f952b.jpg','Манхва',2023,24,'<p>Жизнь Ронана была бесцельной и полной сожалений. Но в конце его бестолковых дней ему выпал второй шанс - он вернулся на десять лет назад! Он полон решимости начать новую жизнь во имя людей, пожертвовавших своими жизнями ради него.</p>',0.0,0,0),(279,'Две Луны','two-moon','two-moon/ce07eea8f280998fb3b76ecf1c883de1.jpg','Манхва',2015,84,'<p>Принцу Джину одиннадцать, когда он исчезает в лесу посреди ночи. Он встречает таинственное существо, которое захватывает его тело и превращает его в гибрид с огромной силой. Пять лет спустя он возвращается и требует земли и богатства своей семьи. Они были переданы дочери Императора, которая теперь живет на его земле. Благодаря своему медальону Джин доказал что он принц, поэтому королева Бёк Ха вынуждена уйти. Некоторые люди хотят избавиться от него, послав ниндзя, чтобы убить его... Но уничтожить его будет нелегко! Его сверхчеловеческие способности позволяют ему защищать себя и сражаться.</p>',0.0,0,0),(281,'Не приходите в канцелярский магазин злодейки!','dont-come-to-the-villans-stationery-shop','dont-come-to-the-villans-stationery-shop/f0a6d0a262dc044d6bb26b175b5c83c0.jpg','Манхва',2022,76,'<p>&mdash;Ты позоришь имя нашей семьи. Забирай эти деньги и вали отсюда!<br />\r\n&mdash;Отлично! Пока-пока!<br />\r\n<br />\r\nОна очнулась ни на что не способной злодейкой, которая творила зло, чтобы завоевать любовь её жениха, главного героя.<br />\r\n<br />\r\nЕё репутация и без того была на дне, а главные герои, которые не могут жить друг без друга, закрутили роман.<br />\r\n&mdash;Меня хоть и выперли, но дали деньги &ndash; уже неплохо!<br />\r\n<br />\r\nПосле того, как её выгнали из дома, она открыла первый магазин канцелярских товаров прямо перед школой. Помимо прочего, там продаются закуски, сладости и даже жвачка! Ну, детишки, держитесь!<br />\r\n<br />\r\nНо&hellip; Почему её юные клиенты такие странные?<br />\r\n<br />\r\n&mdash;Я найду тебе красивого и скромного парня, а не дурня, ходящего налево, как мой брат!<br />\r\n&mdash;Ха, а как насчет моего брата, наследного принца?<br />\r\n&mdash;Хозяин Башни просто лучший.<br />\r\n<br />\r\nВеликий магический воин, королевский принц, ужасающий владелец башни и таинственный злодей.<br />\r\n<br />\r\nМирная жизнь, которую она хотела от магазина канцелярии, обернулась совсем иначе.<br />\r\nПомогите! Я просто хотела жить нормальной жизнью!</p>',0.0,0,0),(282,'Рыцарь огня','knight-of-the-remaining-fire','knight-of-the-remaining-fire/0b06200339c3d0cf742ce1fb9ff95d97.jpg','Манхва',2021,113,'<p>Мой брат-близнец, единственный член семьи, восходящая звезда и главный кандидат на становление рыцарем, был убит. В отличие от него, у меня совсем не было таланта к боевым искусствам. Однако ради того, чтобы отомстить за своего брата, я должен стать сильнее.</p>',0.0,0,0),(283,'Прорыв игрока','game-master','game-master/31fd8b270e1f047f9c43ee3219d1f432.jpg','Манхва',2020,125,'<p>Ким Ки Бон, молодой парень, оказался в ловушке из-за неизвестных ему обстоятельств. И только через три тысячи лет, он смог &quot;пробудиться&quot;. Но в реальности прошло лишь 10 лет, и за это время, весь мир был наводнён разными и ужасными монстрами..<br />\r\nИ с этого момента, пробудившийся Ким Ки Бон вступает в битву, чтобы найти ответы на все свои вопросы.</p>',0.0,0,0),(284,'Ген Супер Бога','supergene','supergene/1e0173d83c0227585c606b4c4b5c18a0.jpg','Маньхуа',2022,186,'<p>В межзвёздном будущем на планету вторглись бесчисленные инопланетные звери, поедая которых люди могут получить новые гены. Хан Сен, новичок, на первый взгляд &quot;демон&quot;, но также &quot;Бог&quot;, на которого все равняются!<br />\r\n&laquo;Увы, но я единственный, кто может получить ген Сверхбога!&raquo;</p>',0.0,0,0),(285,'Шаман великого духа','shaman-of-stormy-spirit','shaman-of-stormy-spirit/16886a26260ca9beb732500a961aa1a4.jpg','Манхва',2020,116,'<p>Он отправится в ад, если Жнец Смерти трижды назовёт его имя: (Хюкренмуган), (Хюкренмуган), (Хюкренму&hellip;) Эй, ты, мерзавец! Изыди, ведь я должен жить!!! Не могу поверить, что, съев траву вечной молодости, остался в живых. Но, очнувшись, не мог понять, почему меня окружают даосские монахи, и надеялся, что это лишь сон! Везде эти мастера из Мутанга?! И какого чёрта я оказался в теле мальчишки на побегушках&hellip; Я сошёл с ума?! Да чтоб я&hellip; Всемогущий Хюкренмуган, хозяин Сапэчхона! Мерзавцы-мастера Мутанга, это всё ваших рук дело! Нужно оставаться хладнокровным. Став главным учеником Мутанга, вам несдобровать. Ну что ж, следите за судьбой самого безжалостного и подлого властелина Мурима, хозяина Сапэчхона, Хюкренмугана вместе с нами!</p>',0.0,0,0),(286,'Лучший наставник','a-place','a-place/b0203c2aa0d684a3c29135905fa9dece.jpg','Манхва',2021,99,'<p>Он обучился сильнейшим техникам боевых искусств,&nbsp;только чтобы быть убитым и переродиться в деревенского наставника по имени Пэк Сурён, известного как &laquo;Один удар&raquo;!</p>',0.0,0,0),(287,'Свет и тень','light__shadow','light__shadow/high_cover.jpg','Манхва',2016,103,'<p>Это грубое оскорбление, когда замуж за герцога Элая отдают скромную и упрямую горничную Эдну, а не благородную девушку, которую он ждал. Однако амбициозная горничная скрывает еще большую тайну, ту, которая может изменить историю самого королевства. Могут ли эти двое найти свободу, искупление и любовь - не обводя друг друга мечами?</p>',0.0,0,0),(288,'Небылица мачехи','a-stepmothers-fairy-tale','a-stepmothers-fairy-tale/ee724530260a71c6758b0372ae7917f6.jpg','Манхва',2017,121,'<p>&laquo;Железная вдова&raquo;, &laquo;чёрная вдова&raquo;, &laquo;охотница на мужчин&raquo;, &laquo;ведьма из замка Нойванштайн&raquo;, позор всех благородных дам&hellip; Все эти слова использовались для описания маркизы, Сури ван Нойванштайн. Несмотря на то, что она подверглась такой критике от всего мира, у неё получилось вырастить и воспитать детей, которые не имели с ней кровного родства.<br />\r\nИ наконец, в день свадьбы первого сына Джереми, она почувствовала, что весь её тяжёлый труд был не напрасен. Но маркиза ужасно ошиблась. Она получила сообщение с просьбой не присутствовать на свадьбе и попала в аварию, покидая замок. Но когда вновь открыла глаза, то проснулась в день похорон своего мужа, семь лет назад.&laquo;Я отказываюсь больше страдать. В этот раз я не буду жить так, как раньше!&raquo;</p>',0.0,0,0),(290,'Таков закон','this-is-the-law','this-is-the-law/a9213016b6c8bbc9436852c221cb1d41.jpg','Манхва',2021,115,'<p>Фантастика о возвращении гениального адвоката! Но Хёнджин был выпускником университета с отличием по адвокатуре, и так называемым успешным адвокатом с 95% выигрышам по делам! В борьбе со злом в лице высшей власти Южной Корее, пытаясь вернуть справедливость в свою страну, он был безжалостно убит агентами национального агентства разведки.<br />\r\n<br />\r\n&ldquo;Он не должен был умирать&hellip;&rdquo; Но Хёнджин был возвращен императором Ёмра, чтобы очистить коррупцию на Земле, вернув его назад во времени и дав некую силу. Что же за силу ему даровал император? Сможет ли Но Хёнджин изменить как своё будущее, так и всей Южной Кореи?!</p>',0.0,0,0),(291,'Лунный бог, приключение и другой мир','moon_led','moon_led/7454ee7db4b512d9a1eeb61d25f3aef2.jpg','Манга',2015,90,'<p><strong>Мидзуми Макото &ndash; ученик старшей школы, перенесенный в другой мир богом Цукуёми. </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Он должен был стать героем, но пришелся не по нраву местной богине.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Выброшенный на край мира, Макото должен найти свой собственный путь!</strong></p>',0.0,0,0),(292,'Битва Сверхлюдей','superman-game','superman-game/baa083648a0d4cb256b9d52a94a58582.jpg','Манхва',2022,83,'<p><strong>Когда-то Со Мун Еоп был самым сильным сверхчеловеком в мире и он пожертвовал своей жизнью ради спасения человечества. Он думал, что умер, но не тут то было - неведомая сила перемещает его во времени на 17 лет вперёд, в мирное будущее, где сверхчеловеческие соревнования совершенно меняют смысл и суть. Футуристический экшн-блокбастер начинается!</strong></p>',0.0,0,0),(293,'Смерть от меня всё никак не отстаёт','my-death-flags-show-no-sign-of-ending','my-death-flags-show-no-sign-of-ending/edd5720b14941f89f2caaafe582a9aca.jpg','Манга',2018,62,'<p><strong>Когда он пришел в себя, Хирасава Казуки, обычный студент университета, обнаружил, что обладает телом игрового персонажа.</strong></p>',0.0,0,0),(294,'Операция \"Истинная любовь\"','operation-name-pure-love','operation-name-pure-love/194babb4fe958bef9d3ef32f5fc86d2c.jpg','Манхва',2022,88,'<p>Я застала поцелуй своего парня и лучшей подруги. Невольным свидетелем поцелуя стал не кто иной, как мой одноклассник Ко Ынхёк, с которым у меня нелучшие отношения. Я в полном замешательстве&hellip; Количество любви, которое получает каждый человек за всю жизнь, как-то предопределено?? И у меня это количество равно нулю??? План &laquo;измена&raquo; с участием бедной Суэ, которая пытается изменить свою судьбу и Ынхёка, который впутался в это дело! Они лишь собирались сделать вид, что изменяют, но это постепенно перерастает во что-то большее?! Этот план&hellip; ведь сработает?</p>',0.0,0,0),(295,'Возрождение мага восьми кругов','the-rebirth-of-an-8thcircled-mage','the-rebirth-of-an-8thcircled-mage/6484b0f77eb50a88aeff7229866df8bf.jpg','Манхва',2020,152,'<p>Герой, спасший целый континент Верховный архимаг восьми кругов Генри Морис. После смерти императора Сондэ, с которым он был близок, аристократы превратили сына императора в марионетку, а он был казнён за измену. Уже умирая, в момент, когда все должно было закончиться, он перемещается в тело слабого и, по всей видимости, ленивого сына барона по имени &quot;Генри&quot;. Теперь великий маг восьми кругов станет мастером меча! Роскошная и жестокая месть Генри начинается сейчас!</p>',0.0,0,0),(296,'Только троньте моего братика, и всем вам конец','if-you-touch-my-brother-you-are-all-dead','if-you-touch-my-brother-you-are-all-dead/00c4ba97140eac60fcba9c6e7362ad34.jpg','Манхва',2021,74,'<p>Я стала шестнадцатилетней Розалитой.Свалившись с кровати и открыв глаза, я обнаружила себя в классической сумасшедшей, страстной, но утомляющей BL новелле &laquo;Астерион голубого звёздного неба&raquo;. Из всех возможных вариантов, я стала старшей сестрой главного героя Астериона, которому суждено покончить жизнь самоубийством.</p>\r\n\r\n<p>Я решила просто плыть по течению и дойти так до финала новеллы, но стоило этому произойти, меня вернуло обратно в тело Розалиты.</p>\r\n\r\n<p>Поскольку прошлое решение было неверным, во второй раз я попробовала растить своего братика в любви, но и на этот раз он погиб, пусть и не по своей воле. Я же вновь вернулась к началу.</p>\r\n\r\n<p>Тогда я попробовала совершенно другую тактику &ndash; сфокусироваться не на брате, а на самой себе. Но и это не помогло. Я переродилась, даже обучившись магии, прямо во время написания моего выпускного диплома в башне.</p>\r\n\r\n<p>А раз я постоянно возвращаюсь в тело Розалиты Роксбог, стоит попробовать найти способ для собственной красивой смерти.</p>',0.0,0,0),(48,'Почтенный бессмертный Ло Вуцзи','xianzun-luo-wuji','xianzun-luo-wuji/f5d1e757dc5388e80fc5fa95fe0eb647.jpg','Маньхуа',2021,247,'<p>Бессмертный Ло Вуцзи, возрождается в наше время, когда он еще был подростком.</p>',8.0,1,1);
